(11, 1, 'Our Workshop', '&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Looking to customise your cake even further? Ordering a fully customised cake requires a longer lead time (minimum 3 weeks), subject to schedule availability. As we have limited slots for each day, do plan early to avoid disappointment.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;To open an enquiry, kindly fill up the form below and our admin team will get back to within 2-3 days. Do let us know the required collection/delivery date and the number of people you intend to serve. Sample images of desired designs will also be helpful for us to get an idea of the design you are looking at, so that we can create your desired cake!&lt;/p&gt;', 'Fully Customised Ice Cream', '', ''),
