INSERT INTO `j5ui84yug_yng8e54e_product_attribute` (`product_id`, `attribute_id`, `language_id`, `text`) VALUES
(1, 3, 1, '&lt;p&gt;**This design is available in the sizes in the drop down list above.&lt;/p&gt;\r\n\r\n&lt;p&gt;All serving suggestions are recommendations and would ultimately depend on the size of slices served.&lt;/p&gt;\r\n\r\n&lt;p&gt;Weights are approximations only, please note that certain premium flavours tend to be slightly heavier.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Sizing Chart&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/Standard Cake/Sizing Chart/Sizing Chart.PNG&quot; style=&quot;width: 519px; height: 169px;&quot; /&gt;&lt;/p&gt;'),
(1, 4, 1, '&lt;p&gt;This customised cake design is frosted with swiss meringue buttercream, which is best consumed at room temperature when soft and creamy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nIf refrigerated, thaw for at least 30 minutes to 1 hour or until cream is soft to the touch to ensure that it cuts well. Do note consume straight from the fridge as it will be crumbly and hard to cut.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThe cake can be displayed in an air con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun, or in warm and humid areas.&lt;/p&gt;'),
(1, 5, 1, '&lt;p&gt;Do note that the ears are skewered on with bamboo skewers for stability purposes. These skewers must be removed before the cake is consumed.&lt;/p&gt;'),
(2, 3, 1, '&lt;p&gt;&lt;strong&gt;**This design is available in the sizes in the drop down list above.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;All serving suggestions are recommendations and would ultimately depend on the size of slices served.&lt;/p&gt;\r\n\r\n&lt;p&gt;Weights are approximations only, please note that certain premium flavours tend to be slightly heavier.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Sizing Chart-5&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/Standard Cake/Sizing Chart/Sizing Chart.PNG&quot; style=&quot;width: 507px; height: 186px;&quot; /&gt;&lt;/p&gt;'),
(2, 4, 1, '&lt;p&gt;This customised cake design is frosted with swiss meringue buttercream, which is best consumed at room temperature when soft and creamy.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;If refrigerated, thaw for at least 30 minutes to 1 hour or until cream is soft to the touch to ensure that it cuts well. Do note consume straight from the fridge as it will be crumbly and hard to cut.&lt;br /&gt;\r\nThe cake can be displayed in an air con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun, or in warm and humid areas.&lt;/p&gt;'),
(2, 5, 1, '&lt;p&gt;Do note that the eyes are skewered on with bamboo skewers for stability purposes. These skewers must be removed before the cake is consumed.&lt;/p&gt;'),
(3, 3, 1, '&lt;p&gt;**This design is available in the sizes in the drop down list above.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;All serving suggestions are recommendations and would ultimately depend on the size of slices served.&lt;/p&gt;\r\n\r\n&lt;p&gt;Weights are approximations only, please note that certain premium flavours tend to be slightly heavier.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Sizing Chart&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/Standard Cake/Sizing Chart/Sizing Chart.PNG&quot; style=&quot;width: 519px; height: 169px;&quot; /&gt;&lt;/p&gt;'),
