(7, 4, 1, '&lt;p&gt;Our customised cakes are frosted with swiss meringue buttercream, which is soft and creamy at room temperature. Because it is made with butter, it will harden if stored in the fridge. Therefore, our cakes (single-tier and two-tier designs) are best consumed at room temperature.&lt;/p&gt;\r\n\r\n&lt;p&gt;If refrigerated, it needs to thaw for at least 1 hour or until cream is soft to the touch to ensure that it cuts well. (Not recommended for cakes with fondant that cannot be self-assembled ie. Cakes with rainbow bunting, 3D cat cake, Monster Cake, Floral Longevity Cake etc.) &lt;br /&gt;\r\n&lt;br /&gt;\r\nIf cake is to be displayed, it can last in an air con room (at least 18°C) for up to 5 hours. It is not recommended to display or store cakes without air con, especially under the hot sun.&lt;/p&gt;'),
