(206, 1, 1, '&lt;p&gt;Each cupcake is approx. 3.5cm in diameter and each box is 16cm (length) by 9cm (width).&lt;/p&gt;'),
(206, 2, 1, '&lt;p&gt;Do note that these cupcakes are EGG-FREE and DAIRY-FREE but are made in an environment that handles eggs and dairy and not recommended for those with serious allergies.&lt;/p&gt;'),
(206, 4, 1, '&lt;p&gt;Display in cool, air-conditioned area and consume within the same day for best taste and texture. Leftovers can be kept in the fridge (in air-tight container) up to 2 days, thaw 20-30mins before consumption&lt;/p&gt;'),
(206, 6, 1, '&lt;p&gt;Additional costs will apply for individual paper bags requested. &lt;/p&gt;'),
(207, 1, 1, '&lt;p&gt;Assorted flavours available are:&lt;/p&gt;\r\n\r\n&lt;p&gt;Coffee, Raspberry, Lemon, Earl Grey, Salted Caramel, Orange, Passionfruit, Chocolate&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Flavours are not customisable. Macarons are approximately 3.5cm in diameter and they contain nuts.&lt;/strong&gt;&lt;/p&gt;'),
(207, 4, 1, '&lt;p&gt;Keep refrigerated for best taste and texture. Leftovers can be kept in the fridge (in air-tight container) up to 3 days&lt;/p&gt;'),
(208, 4, 1, '&lt;p&gt;We recommend refrigeration for best taste and texture. Leftovers can be kept in the fridge for up to 2 weeks. &lt;/p&gt;'),
(210, 4, 1, '&lt;p&gt;&lt;strong&gt;Blondies are best consumed on the same day for optimal taste, appearance and freshness. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Keep in air con area (at least 18 degrees) for up to 4-5 hours. We like our brownies straight from the fridge for a chewy fudgy texture. If you like them soft and melt-in-your-mouth, consume at room temperature.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;To ensure freshness, we recommend keeping leftovers in the fridge in an air-tight container/ cling wrap for up to three (3) days or frozen up to seven (7) days from date of collection/delivery. If frozen, thaw for a minimum of two hours till soft before consumption at room temperature&lt;/p&gt;'),
(212, 1, 1, '&lt;p&gt;Item will be packed separately for self-assembly. &lt;span&gt;&lt;/span&gt;&lt;span&gt;Please be careful with this topper as it can be bent if mishandled.&lt;/span&gt;&lt;/p&gt;'),
(228, 3, 1, '&lt;p&gt;6&quot;x 6&quot; Square - Approx 1.5kg, good for 5-15 pax&lt;br /&gt;\r\n8&quot;x 8&quot; Square - Approx 2.1kg, good for 10-21 pax&lt;/p&gt;'),
(228, 4, 1, '&lt;p&gt;Cake should be kept refrigerated (not frozen) till time of consumption. Leftovers can be kept in the fridge in an air-tight container up to 3 days&lt;/p&gt;'),
(229, 3, 1, '&lt;p&gt;6&quot; Size - Approx 1kg, good for 5-8 pax&lt;br /&gt;\r\n8&quot; Size - Approx 1.8kg, good for 10-15 pax&lt;br /&gt;\r\n10&quot; Size - Approx 2.5kg, good for 20-25 pax&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;box-sizing: border-box; color: rgb(34, 35, 35); font-family: Arapey, serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;&quot;&gt;&lt;/span&gt; &lt;/p&gt;'),
(229, 4, 1, '&lt;p&gt;This cake can be displayed in an air-con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun or in warm and humid areas.&lt;/p&gt;\r\n\r\n&lt;p&gt;If refrigerated, thaw at room temperature for approx. 30-60min or until cream is soft to touch. Do not consume straight from the fridge as it will be crumbly and hard to cut.&lt;/p&gt;\r\n\r\n&lt;p&gt;Leftovers can be kept in the fridge in an air-tight container up to 3 days, thaw 20-30mins before consumption.&lt;/p&gt;'),
(230, 3, 1, '&lt;p&gt;&lt;img alt=&quot;Two Tier Sizing Chart-1&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/Sizing Chart/Two Tier Sizing Chart-1.PNG&quot; style=&quot;width: 334px; height: 94px;&quot; /&gt;&lt;/p&gt;'),
(230, 4, 1, '&lt;p&gt;This customised cake design is frosted with swiss meringue buttercream, which is best consumed at room temperature when soft and creamy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nIf refrigerated, thaw for at least 30 minutes to 1 hour or until cream is soft to the touch to ensure that it cuts well. Do note consume straight from the fridge as it will be crumbly and hard to cut.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThe cake can be displayed in an air con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun, or in warm and humid areas.&lt;/p&gt;'),
(231, 3, 1, '&lt;p&gt;&lt;img alt=&quot;Two Tier Sizing Chart-1&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/Sizing Chart/Two Tier Sizing Chart-1.PNG&quot; style=&quot;width: 334px; height: 94px;&quot; /&gt;&lt;/p&gt;'),
