(405, 4, 1, '&lt;p&gt;This customised cake design is frosted with swiss meringue buttercream, which is best consumed at room temperature when soft and creamy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nIf refrigerated, thaw for at least 30 minutes to 1 hour or until cream is soft to the touch to ensure that it cuts well. Do note consume straight from the fridge as it will be crumbly and hard to cut.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThe cake can be displayed in an air con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun, or in warm and humid areas.&lt;/p&gt;'),
(405, 5, 1, '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--{cke_protected}{C}%3C!%2D%2Dtd%20%7Bborder%3A%201px%20solid%20%23ccc%3B%7Dbr%20%7Bmso-data-placement%3Asame-cell%3B%7D%2D%2D%3E-&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;&lt;!--{cke_protected}{C}%3C!%2D%2Dtd%20%7Bborder%3A%201px%20solid%20%23ccc%3B%7Dbr%20%7Bmso-data-placement%3Asame-cell%3B%7D%2D%2D%3E-While the dried rose petals and buds and thyme sprigs are edible, the baby\'s breath flowers used as decorations on this cake are thoroughly washed but remain inedible and must be removed before consumption.&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;\r\n&lt;/style&gt;\r\nWhile the dried rose petals are edible, the rosemary wreath used as decorations on this cake are thoroughly washed but remain inedible and must be removed before consumption.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;This design will feature slightly exposed cake sponge layers. The colour of the exposed cake layers will be dependent on the colour of the sponge/flavour chosen&lt;/p&gt;'),
