(406, 4, 1, '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\n&lt;span data-sheets-userformat=&quot;{&amp;quot;2&amp;quot;:17217,&amp;quot;3&amp;quot;:{&amp;quot;1&amp;quot;:0},&amp;quot;9&amp;quot;:1,&amp;quot;11&amp;quot;:4,&amp;quot;12&amp;quot;:0,&amp;quot;17&amp;quot;:1}&quot; data-sheets-value=&quot;{&amp;quot;1&amp;quot;:2,&amp;quot;2&amp;quot;:&amp;quot;✓&amp;quot;}&quot; style=&quot;font-size:10pt;font-family:Arial;font-weight:bold;font-style:normal;text-align:center;&quot;&gt;&lt;/span&gt;This customised cake design is frosted with swiss meringue buttercream, which is best consumed at room temperature when soft and creamy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nIf refrigerated, thaw for at least 30 minutes to 1 hour or until cream is soft to the touch to ensure that it cuts well. Do note consume straight from the fridge as it will be crumbly and hard to cut.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThe cake can be displayed in an air con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun, or in warm and humid areas.&lt;/p&gt;'),
