(453, 3, 1, '&lt;p&gt;6&quot; Size - Approx. 1kg, good for 5-10 pax&lt;/p&gt;\r\n\r\n&lt;p&gt;8&quot; Size - Approx. 1.7kg, good for 10-17 pax&lt;/p&gt;\r\n\r\n&lt;p&gt;10&quot; Size - Approx. 2.9kg, good for 20-29 pax&lt;/p&gt;'),
(453, 4, 1, '&lt;p&gt;This cake can be displayed in an air-con room (at least 18°C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun or in warm and humid areas.&lt;/p&gt;\r\n\r\n&lt;p&gt;If refrigerated, thaw at room temperature for approx. 30-60min or until cream is soft to touch. Do not consume straight from the fridge as it will be crumbly and hard to cut.&lt;/p&gt;\r\n\r\n&lt;p&gt;Leftovers can be kept in the fridge in an air-tight container up to 3 days, thaw 20-30mins before consumption.&lt;/p&gt;'),
(454, 1, 1, '&lt;p&gt;This product contain nuts. Each loaf is approximately 8.3cm x 6.35cm and each box contains 2 loaves. Each box is approximately 13cm x 13cm x 8.5cm&lt;/p&gt;\r\n\r\n&lt;p&gt;Additional costs will apply for individual paper bags requested. &lt;/p&gt;'),
(454, 4, 1, '&lt;p&gt;Display in cool, air-conditioned area and consume within the same day for best taste and texture. Leftovers can be kept in the fridge (in air-tight container) up to 2 days, thaw 20-30mins before consumption&lt;/p&gt;'),
