(481, 4, 1, '&lt;p&gt;&lt;strong&gt;Pavlova are best consumed on the same day for optimal taste, appearance and freshness. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Keep in air con area (at least 18 degrees) for up to 4-5 hours. We like our brownies straight from the fridge for a chewy fudgy texture. If you like them soft and melt-in-your-mouth, consume at room temperature.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;To ensure freshness, we recommend keeping leftovers in the fridge in an air-tight container/ cling wrap for up to three (3) days or frozen up to seven (7) days from date of collection/delivery. If frozen, thaw for a minimum of two hours till soft before consumption at room temperature&lt;/p&gt;'),
