(485, 4, 1, '&lt;p&gt;&lt;strong&gt;Cake is best consumed on the same day for optimal taste, appearance and freshness. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Do not consume straight from the fridge as it will be crumbly and difficult to cut. Keep in air con area (at least 18 degrees) for up to 4-5 hours. Eat at room temperature for best texture and easy cutting. If refrigerated, it should be removed and thawed at room temperature 1 hour before serving.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;To ensure freshness, we recommend keeping remaining slices in the fridge in an air-tight container for up to two days from date of collection/delivery.&lt;/p&gt;'),
