(515, 6, 1, '&lt;p&gt;Flowers used for the bouquet may be replaced with a similar item/colour depending on availability.The colour of the buds may fade naturally, depending on the environment. No watering is required. Keep dry and keep out of direct sunlight. Flowers may last up to a year and beyond if kept in good condition. &lt;/p&gt;'),
