(523, 4, 1, '&lt;p&gt;Fresh cream cakes should be kept refrigerated (not frozen) till time of consumption. Leftovers can be kept in the fridge in an air-tight container up to 3 days&lt;/p&gt;'),
(524, 4, 1, '&lt;p&gt;&lt;strong&gt;Blondies are best consumed on the same day for optimal taste, appearance and freshness. &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Keep in air con area (at least 18 degrees) for up to 4-5 hours. We like our brownies straight from the fridge for a chewy fudgy texture. If you like them soft and melt-in-your-mouth, consume at room temperature.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;To ensure freshness, we recommend keeping leftovers in the fridge in an air-tight container/ cling wrap for up to three (3) days or frozen up to seven (7) days from date of collection/delivery. If frozen, thaw for a minimum of two hours till soft before consumption at room temperature&lt;/p&gt;'),
(525, 1, 1, '&lt;p&gt;Each cupcake is approx. 3.5cm in diameter and each box is 16cm (length) by 9cm (width).&lt;/p&gt;'),
(525, 4, 1, '&lt;p&gt;Display in cool, air-conditioned area and consume within the same day for best taste and texture. Leftovers can be kept in the fridge (in air-tight container) up to 2 days, thaw 20-30mins before consumption&lt;/p&gt;'),
(525, 6, 1, '&lt;p&gt;Additional costs will apply for individual paper bags requested. &lt;/p&gt;'),
(526, 1, 1, '&lt;p&gt;Each Sparkler candle lasts approx. 15 seconds. Standard candles (big and small) will not be provided upon purchase of these candles unless requested.&lt;/p&gt;'),
(527, 1, 1, '&lt;p&gt;Sparkler Number Candle is only available in Number 1 and Number 2. Each sparkler number lasts approx. 10 seconds. Standard candles (big and small) will not be provided upon purchase of these candles unless requested.&lt;/p&gt;'),
