INSERT INTO `j5ui84yug_yng8e54e_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(1, 1, 'Kitty Cat Cake', '&lt;p&gt;Our kitty cat cake features handpiped fur buttercream, a popular design for cat lovers and kids alike.&lt;/p&gt;', '', 'Kitty Cat Cake', 'Our kitty cat cake features handpiped fur buttercream, a popular design for cat lovers and kids alike.', 'cat, kitty, sculpted cake, 3D, animal'),
(2, 1, '5-Eyed Monster Cake', '&lt;p&gt;This quirky monster cake features handpiped fur, and five googly fondant eyes that are sure to put a smile on anyone\'s face.&lt;/p&gt;', '', '5-Eyed Monster Cake', 'This quirky monster cake features handpiped fur, and five googly fondant eyes that are sure to put a smile on anyone\'s face.', 'monster\r\nnovelty\r\nkids\r\nchildren\r\nkids friendly\r\nkid party'),
(3, 1, 'Aeroplane &amp; Clouds Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nAn aviation-themed cake featuring a sky blue hue, with handpiped \'clouds\' and a pastel yellow aeroplane topper. Choose your desired fondant letters for a more personalised look.&lt;/p&gt;', '', 'Aeroplane &amp; Clouds Cake', 'An aviation-themed cake featuring a sky blue hue, with handpiped \'clouds\' and a pastel yellow aeroplane topper.', 'Aeroplane, Piped Clouds, Blue Cake, Sky, Ombre, Sky Blue, Pastel Blue, Airplane'),
(4, 1, 'Auspicious Longevity Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis popular longevity design features a red base with gold pearls and gold dusting on the rims. Decorated with marbled fondant koi toppers and beautiful fondant dragons that are individually handpainted gold and placed around the circumference. Topped with a gold glitter paper topper symbolising the Chinese longevity character. In Chinese culture, koi fish are often seen as a symbol of strength, ambition and good luck and are commonly featured during auspicious celebrations. Dragons are also popular motifs that symbolise courage, strength and prosperity.&lt;/p&gt;', '', 'Auspicious Longevity Cake', 'This popular longevity design features a red base with gold pearls and gold dust on the top rim, along with marbled fondant koi toppers and a glittery paper cutout of the Chinese character symbol of longevity. In Chinese culture, koi fish are often seen a', 'Longevity Cake, Shou, Koi Fish, Koi, Red Cake, Dragons, Gold Cake, Gold Dragons, 80th Birthday, 70th Birthday, 90th Birthday'),
(5, 1, 'Bear Cake', '&lt;p&gt;Our sculpted bear cake features handpiped fur cream, along with a cheeky smile that\'s sure to put a smile on your face.&lt;/p&gt;', '', 'Bear Cake', 'Our sculpted bear cake features handpiped fur cream, along with a cheeky smile that\'s sure to put a smile on your face.', 'Bear Cake, Kid-Friendly, Children, Kids Party'),
(6, 1, 'Black &amp; Gold Marble with Silver Chocolate Sails', '&lt;p&gt;Our black marbled cake features painted gold swashes, topped with white chocolate drizzle. Black and gold sprinkles adorn the top rim, and the cake is finished with silver-dusted tempered dark chocolate sails. A popular choice for birthday boys and celebrations with a black and gold theme.&lt;/p&gt;', '', 'Black &amp; Gold Marble with Silver Chocolate Sails', 'Our black marbled cake features painted gold swashes, topped with white chocolate drizzle. Black and gold sprinkles adorn the top rim, and the cake is finished with silver-dusted tempered dark chocolate sails. A popular choice for birthday boys and celebr', 'Black &amp; Gold Marble with Silver Chocolate Sails, Black Cake, Gold Cake, Chocolate Sails, Silver Sails, Marble Cake, Guy-Friendly, Gold, Marble'),
(7, 1, 'Black &amp; Navy Blue Marble with Silver Chocolate Sails', '&lt;p&gt;Our black and navy blue marbled cake is drizzled with white chocolate glaze, topped with silver chocolate gem drops and silver-dusted tempered dark chocolate sails. A popular choice for birthday boys and celebrations with a black and white theme.&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Black &amp; Navy Blue Marble with Silver Chocolate Sails', 'Our black and navy blue marbled cake is drizzled with white chocolate glaze, topped with silver chocolate gem drops and silver-dusted tempered dark chocolate sails. A popular choice for birthday boys and celebrations with a black and white theme.', 'Black &amp; Navy Blue Marble with Silver Chocolate Sails, Black Cake, Blue Cake, Navy Blue, Marble Cake, Silver Chocolate Sails, Silver Chocolate, Guy-Friendly, Gold, Marble'),
(8, 1, 'Gold Marbled Cake with Macarons and Strawberries', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur marbled cake is handpainted with swashes of gold, topped with macarons, strawberry halves and edible floral petals. Choose your desired marble&nbsp;and macaron colour for a personalised look.&lt;/p&gt;', '', 'Semi-Customised - Gold Marbled Cake with Macarons and Strawberries', 'Our marbled cake is handpainted with swashes of gold, topped with macarons, strawberry halves and edible floral petals.', 'Blue Cake, Gold Cake, Marbled Cake, Macarons, Strawberries, Sky Blue, Pink, Strawberry'),
(9, 1, 'Bohemian Fox Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis bohemian-inspired fox cake has a handpiped crown of pastel pink and white buttercream rosettes and leaf piping. A cheerful cake that\'s sure to delight all!&lt;/p&gt;', '', 'Bohemian Fox Cake', 'This bohemian-inspired fox cake has a handpiped crown of pastel pink and white buttercream rosettes and leaf piping. A cheerful cake that\'s sure to delight all!', 'Bohemian, Fox, Bohemian Fox Cake, Rustic'),
(10, 1, 'Bohemian Rustic Gold Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis bohemian-inspired design has gold-brushed accents on the circumference, crowned with a brown plaited wreath. Decorated with hand-painted gold-tipped fondant feathers.&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Bohemian Rustic Gold Cake', 'This bohemian-inspired design has gold-brushed accents on the circumference, crowned with a brown plaited wreath. Decorated with hand-painted gold-dipped fondant feathers.', 'Themed Cake, Back to 80s, Back to 90s, Back to 70s, Retro, Classy, Classic'),
(11, 1, 'Cactus Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis cactus cake was inspired by our love for spiky greens! Each buttercream cactus is handpiped by our cake artists, and garnished with \'sand\' crumble. Topped with a rustic rosemary bunting as a final touch to this beautiful centrepiece for any rustic-themed occasion.&lt;/p&gt;', '', 'Cactus Cake', 'This cactus cake was inspired by our love for spiky greens! Each buttercream cactus is handpiped by our cake artists, and garnished with \'sand\' crumble. Topped with a rustic rosemary bunting as a final touch to this beautiful centrepiece for any rustic-th', 'Cactus, crumbs, rosemary bunting, rustic, plant, sand, soil, nature'),
(12, 1, 'Candyland Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur Candyland cake is the cake of every girl\'s dream. It has rainbow sprinkles on the circumference, rainbow-sprinkled meringues, confetti sprinkles and mini marshmallows. We top it off with handmade fondant sugar lollipops, swirled in pink and white.&lt;/p&gt;', '', 'Candyland Cake', 'Our Candyland cake is the cake of every girl\'s dream. It has rainbow sprinkles on the circumference, rainbow-sprinkled meringues, confetti sprinkles and mini marshmallows. We top it off with handmade fondant sugar lollipops, swirled in pink and white.', 'Candyland Cake, Teal Cake, Rainbow Sprinkles, Hot Pink, Meringues, Marshmallows, Confetti Sprinkles, Lollipop'),
(13, 1, 'Cascading Rainbow Hearts Cake', '&lt;p&gt;An understated cake, this design features a solid colour exterior, with cascading vibrant rainbow hearts on the circumference for a touch of fun.&lt;/p&gt;', '', 'Cascading Rainbow Hearts Cake', 'An understated cake, this design features a solid colour exterior, with cascading vibrant rainbow hearts on the circumference for a touch of fun.', 'hearts, rainbow, rainbow hearts, girly, pink, blue, green, sky blue, yellow, red, orange'),
(14, 1, 'Chocolate Overload Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur Chocolate Overload Cake is exactly what it says it is. Topped with dark chocolate drizzle, a gold-dusted tempered dark chocolate sail. Decorated with cookie sticks, Toblerones, Kinder Buenos, and enough chocolates for all chocolate lovers to go gaga over!&lt;/p&gt;', '', 'Chocolate Overload Cake', 'Topped with dark chocolate drizzle, a gold-dusted tempered dark chocolate sail. Decorated with cookie sticks, Toblerones, Kinder Buenos, and enough chocolates for all chocolate lovers to go gaga over!', 'Chocolate Cake, White Cake, Dark Chocolate, Rainbow Sprinkles, Gold Chocolate Sails, Gold Chocolate, Macarons, Kinder Bueno, Toblerone, Oreos, Hershey\'s, Pocky'),
(15, 1, 'Chocolate Popcorn Cake', '&lt;p&gt;This chocolatey cake is drizzled with dark chocolate ganache, and topped with handmade caramel popcorn for a crunchy finish.&lt;/p&gt;', '', 'Chocolate Popcorn Cake', 'This chocolatey cake is drizzled with dark chocolate ganache, and topped with handmade caramel popcorn for a crunchy finish.', 'Chocolate Popcorn Cake, Chocolate Cake, Popcorn Cake, Popcorn, Drizzle, Chocolate Drizzle, Caramel Popcorn'),
(16, 1, 'Chocolate Truffle with Mixed Berries', '&lt;p&gt;This chocolatey cake is drizzled with dark chocolate ganache, and topped colourful strawberries, blueberries and raspberries for a sweet finish.&lt;/p&gt;', '', 'Chocolate Truffle with Mixed Berries', 'This chocolatey cake is drizzled with dark chocolate ganache, and topped colourful strawberries, blueberries and raspberries for a sweet finish.', 'Chocolate Truffle with Mixed Berries, Chocolate Truffle Cake, Chocolate Cake, Mixed Berries, blueberries, raspberries, strawberries, gold dust, drizzle, chocolate drizzle'),
(17, 1, 'Confetti Cake with Rainbow Balloons', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis popular design features an exterior adorned with confetti sprinkles, topped with an eye-catching bouquet of rainbow balloons that\'s sure to be the centre of everyone\'s attention. Choose your desired rainbow shades and fondant letters for a personalised look.&lt;/p&gt;', '', 'Confetti Cake with Rainbow Balloons', 'This popular design features an exterior adorned with confetti sprinkles, topped with an eye-catching bouquet of rainbow balloons that\'s sure to be the centre of everyone\'s attention.', 'Confetti Cake with Rainbow Balloons, Confetti Sprinkles, Rainbow Balloon, Balloon, Fondant Letters, Fondant, sprinkles, rainbow, vibrant, pastel'),
(18, 1, 'Dark Galaxy Cake', '&lt;p&gt;Our dark galaxy cake features a marbling of blue, purple and black cream, finished with silver splatter for the perfect galactical blast-off. A popular choice for birthday boys and space-themed birthday celebrations.&lt;/p&gt;', '', 'Dark Galaxy Cake', 'Our dark galaxy cake features a marbling of blue, purple and black cream, finished with silver splatter for the perfect galactical blast-off. A popular choice for birthday boys and space-themed birthday celebrations.', 'dark, marbled, marble, silver splatter, space, guy-friendly, galaxy, rocket, stars, boys, party,'),
(19, 1, 'Dill and Spice Wreath Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis rustic cake is garnished with sprigs of dill, topped with dehydrated lemon slices, cinnamon sticks and star anise for a beautiful look inspired by nature\'s herbs.&lt;/p&gt;', '', 'Dill and Spice Wreath Cake', 'This rustic cake is garnished with sprigs of dill, topped with dehydrated lemon slices, cinnamon sticks and star anise for a beautiful look inspired by nature\'s herbs.', 'Dill and Spice Wreath Cake, Rustic Cake, Dill, Lemons, Cinnamon, star anise, leaves, rustic naked'),
(20, 1, 'Floral Longevity Cake', '&lt;p&gt;According to Chinese folk legend, longevity buns are a symbol of immortality and are popular auspicious symbols to present to elderly people as a celebration of their age. Our signature longevity cake features pink and red cherry blossoms, with each blossom piped individually by hand. The cake is decorated with a handcut fondant longevity wording, along with hand-sculpted fondant \'shou taos\', or longevity buns.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Floral Longevity Cake', 'Our signature longevity cake features pink and red cherry blossoms, with each blossom piped individually by hand. The cake is decorated with a handcut fondant longevity wording, along with hand-sculpted fondant \'shou taos\', or longevity buns.', 'Floral Longevity Cake, Floral Cake, Longevity Cake, Longevity Bun, Red and Pink, Shou, Cherry blossoms, piped flowers, Shou Tau, red flowers, pink flowers'),
(21, 1, 'Garden Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur garden-themed cake is coated with a white buttercream, finished with handpiped grass buttercream and fondant daisies. Choose from our range of fondant and paper decorations to make this cake your own!&lt;/p&gt;', '', 'Garden Cake', 'Our garden-themed cake is coated with a white buttercream, finished with handpiped grass buttercream and fondant daisies.', 'Garden Cake, Green Grass, Flowers, Daisies, fondant daisies, soccer, sports, piped grass'),
(22, 1, 'Gold Accent Cake with Mixed Berries and Florals', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis geometric-inspired gold-accented cake is embellished with fresh florals, gold and white sprinkles, and a mound of fresh berries for a pop of colour. This sweet and sophisticated design is a great choice for floral-themed celebrations.&lt;/p&gt;', '', 'Gold Accent Cake with Mixed Berries and Florals', 'This geometric-inspired gold-accented cake is embellished with fresh florals, gold and white sprinkles, and a mound of fresh berries for a pop of colour. This sweet and sophisticated design is a great choice for floral-themed celebrations.', 'Gold Accent Cake with Mixed Berries and Florals, White Cake, Mixed Berries, Floral Cake, White Sprinkles, Gold Sprinkles, Baby\'s Breath, Flowers, Blueberries, Raspberries, Strawberries, Gold'),
(24, 1, 'Gold Ombre with Baby&#039;s Breath', '&lt;p&gt;This understated design features handpainted gold swashes, topped with baby\'s breath for an ethereal floral look.&lt;/p&gt;', '', 'Gold Ombre with Baby\'s Breath', 'This understated design features handpainted gold swashes, topped with baby\'s breath for an ethereal floral look.', 'Gold Ombre with Baby\'s Breath, Gold Ombre, Ombre Cake, Baby\'s Breath, Flowers, Floral Cake'),
(25, 1, 'Gold Splatter Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis understated design features an abstract gold splatter for a subtle touch of glam. Choose your desired cake colour for a personalised look. To personalise this cake even more, do check out our range of fondant and paper decorations.&lt;/p&gt;', '', 'Gold Splatter Cake', 'This understated design features an abstract gold splatter for a subtle touch of glam. Choose your desired cake colour for a personalised look. To personalise this cake even more, do check out our range of fondant and paper decorations.', 'Gold Splatter Cake, Gold Platter, Gold, Silver, Rose Gold'),
(26, 1, 'Golf Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis golf-themed cake features handpiped buttercream \'grass\', along with two handsculpted, handpainted fondant golf clubs and a golf ball. Perfect for all golf lovers! Choose your desired fondant flag number for a personalised look.&lt;/p&gt;', '', 'Golf Cake', 'This golf-themed cake features handpiped buttercream \'grass\', along with two handsculpted, handpainted fondant golf clubs and a golf ball. Perfect for all golf lovers!', 'golf cake, golf, guy friendly, sports, grass, golf club, golf ball'),
(27, 1, 'Ice Cream Cone Drizzle Cake', '&lt;p&gt;This design features a chocolate drizzle and hand-placed confetti on the circumference. The top surface is adorned with macarons, oreos, ice cream cones, mini marshmallows and confetti sprinkles. Choose the desired chocolate drizzle, macaron colours and fondant letters for a personalised look!&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Ice Cream Cone Drizzle Cake', 'This design features a chocolate drizzle and hand-placed confetti on the circumference. The top surface is adorned with macarons, oreos, ice cream cones, mini marshmallows and confetti sprinkles.', 'Ice Cream Cone Drizzle Cake, Ice Cream Cone, Ice Cream, Drizzle, Kid-Friendly, Birthday'),
(28, 1, 'Ice Cream Sundae Cake', '&lt;p&gt;Our Ice Cream Sundae Cake is coated with vibrant rainbow sprinkles, topped with a dark chocolate drizzle and a mountain of smile-inducing \'ice cream\' scoops! The scoops are made out of buttercream, drizzled with dark chocolate ganache, mini marshmallows and an ice cream cone. Choose your desired cake colour for a more personalised look. Perfect for sundae lovers!&lt;/p&gt;', '', 'Ice Cream Sundae Cake', 'Our Ice Cream Sundae Cake is coated with vibrant rainbow sprinkles, topped with a dark chocolate drizzle and a mountain of smile-inducing \'ice cream\' scoops! The scoops are made out of buttercream, drizzled with dark chocolate ganache, mini marshmallows a', 'Ice Cream Sundae Cake, Ice Cream, Sundae, Birthday, Kid Friendly'),
(29, 1, 'Jungle Animal Themed Cake', '&lt;p&gt;This popular jungle-inspired cake is adorned with intricate fondant faces handmade by our fondant artists, including the hippo, zebra, lion and monkey. Finished with handpiped grass piping. To spruce this cake up even more, choose from our range of fondant and paper decorations to make this cake truly your own!&lt;/p&gt;', '', 'Jungle Animal Themed Cake', 'This popular jungle-inspired cake is adorned with intricate fondant faces handmade by our fondant artists, including the hippo, zebra, lion and monkey. Finished with handpiped grass piping.', 'Jungle Animal Themed Cake, Jungle Animal, Jungle Themed, Birthday, Kid Friendly'),
(31, 1, 'Marbled Cake with Candy Shards and Macaron Decor', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis marbled cake is topped with a white chocolate glaze, decorated with silver leaves,&nbsp;candy shards and macarons. Choose either a pink or blue theme for a personalised look - blue is a&nbsp;popular choice for ice princess themes!\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Marbled Cake with Candy Shards and Macaron Decor', 'This marbled cake is topped with a white chocolate glaze, decorated with silver leaves, candy shards and macarons. Choose either a pink or blue theme for a personalised look - blue is a popular choice for ice princess themes!', 'silver flakes, pink shards, hot pink, blue shards, sky blue, white macaron, blue macaron, pink macaron, frozen, elsa, anna'),
(32, 1, 'Marbled Cake with Chocolate Drizzle', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;span data-sheets-userformat=&quot;{&amp;quot;2&amp;quot;:769,&amp;quot;3&amp;quot;:{&amp;quot;1&amp;quot;:0},&amp;quot;11&amp;quot;:4,&amp;quot;12&amp;quot;:0}&quot; data-sheets-value=&quot;{&amp;quot;1&amp;quot;:2,&amp;quot;2&amp;quot;:&amp;quot;This marbled cake is topped with chocolate drizzle - choose your desired marble colour and drizzle colour for a personalised look.&amp;quot;}&quot; style=&quot;font-size:10pt;font-family:Arial;font-style:normal;&quot;&gt;This marbled cake is topped with chocolate drizzle - choose your desired marble colour and drizzle colour for a personalised look.&lt;/span&gt;&lt;/p&gt;', '', 'Marbled Cake with Chocolate Drizzle', 'This marbled cake is topped with chocolate drizzle - choose your desired marble colour and drizzle colour for a personalised look.', 'Marbled, Drizzle, Marbled Cake with Chocolate Drizzle, Birthday'),
(33, 1, 'Marbled Cake with Drizzle and Cascading Berries', '&lt;p&gt;This marbled cake is drizzled with a dark chocolate glaze, and topped with a Belgian ice cream cone and an assortment of fresh berries for a pop of colour. Choose your desired marble colour for a personalised look.&lt;/p&gt;', '', 'Marbled Cake with Drizzle and Cascading Berries', 'This marbled cake is drizzled with a dark chocolate glaze, and topped with a Belgian ice cream cone and an assortment of fresh berries for a pop of colour. Choose your desired marble colour for a personalised look.', 'Marbled Cake with Drizzle and Cascading Berries, Berries, Berry, Marbled, Birthday'),
(34, 1, 'Marbled Cake with Drizzle and Lavender', '&lt;p&gt;This marbled cake is drizzled with a white chocolate glaze, garnished with sprigs of lavender for a floral finish.&lt;/p&gt;', '', 'Marbled Cake with Drizzle and Lavender', '', 'Marbled Cake with Drizzle and Lavender, Floral, Drizzle, Marbled, Lavender'),
(36, 1, 'Marbled Cake with White Chocolate Drizzle and Baby&#039;s Breath', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis design features a marbled exterior, finished with a white chocolate drizzle, and topped with baby\'s breath for a subtle floral touch.&lt;/p&gt;', '', 'Marbled Cake with White Chocolate Drizzle and Baby\'s Breath', 'This design features a marbled exterior, finished with a white chocolate drizzle, and topped with baby\'s breath for a subtle floral touch.', 'Marbled Cake with White Chocolate Drizzle and Baby\'s Breath, Marbled, Drizzle, Baby\'s Breath'),
(37, 1, 'Marbled Gold Chocolate Candy Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;span data-sheets-userformat=&quot;{&amp;quot;2&amp;quot;:769,&amp;quot;3&amp;quot;:{&amp;quot;1&amp;quot;:0},&amp;quot;11&amp;quot;:4,&amp;quot;12&amp;quot;:0}&quot; data-sheets-value=&quot;{&amp;quot;1&amp;quot;:2,&amp;quot;2&amp;quot;:&amp;quot;A marbled cake with cascading gold leaves, topped with a feast of vanilla macarons and chocolate candies that\'s sure to please candy lovers.&amp;quot;}&quot; style=&quot;font-size:10pt;font-family:Arial;font-style:normal;&quot;&gt;A marbled cake with cascading gold leaves, topped with a feast of vanilla macarons and chocolate candies that\'s sure to please candy lovers.&lt;/span&gt;&lt;/p&gt;', '', 'Marbled Gold Chocolate Candy Cake', 'A marbled cake with cascading gold leaves, topped with a feast of vanilla macarons and chocolate candies that\'s sure to please candy lovers.', 'Marbled Gold Chocolate Candy Cake, Marbled, Gold, Chocolate, Kid Friendly, Birthday, Sweet'),
(38, 1, 'Marbled with Baby&#039;s Breath', '&lt;p&gt;This design features a marbled exterior, topped with baby\'s breath for a subtle floral touch.&lt;/p&gt;', '', 'Marbled with Baby\'s Breath', 'This design features a marbled exterior, topped with baby\'s breath for a subtle floral touch.', 'marbled, Baby\'s Breath, flowers'),
(39, 1, 'Gold Painted Cake with Macarons and Candy Shards', '&lt;p&gt;This show-stopping cake is handpainted with edible luster dust, drizzled with a white chocolate glaze, and decorated with a beautiful combination of painted macarons and candy shards. Choose your cake colour for the perfect look for your glamorous occasion.&lt;/p&gt;', '', 'Gold Painted Cake with Macarons and Candy Shards', 'This show-stopping cake is handpainted with edible luster dust, drizzled with a white chocolate glaze, and decorated with a beautiful combination of painted macarons and candy shards. Choose your cake colour for the perfect look for your glamorous occasio', 'Gold, Rose Gold, Silver, Macarons, Candy Shards, Drizzle'),
(40, 1, 'Monster Cake', '&lt;p&gt;Our sculpted monster cake features handpiped fur cream, along with a cheeky grin that\'s sure to put a smile on your face.&lt;br /&gt;\r\n &lt;/p&gt;', '', 'Monster Cake', 'Our sculpted monster cake features handpiped fur cream, along with a cheeky grin that\'s sure to put a smile on your face.', 'Monster, 3D, 3D sculpted, Sculpted, Kid Friendly'),
(41, 1, 'Ombre Rosette Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;span data-sheets-userformat=&quot;{&amp;quot;2&amp;quot;:769,&amp;quot;3&amp;quot;:{&amp;quot;1&amp;quot;:0},&amp;quot;11&amp;quot;:4,&amp;quot;12&amp;quot;:0}&quot; data-sheets-value=&quot;{&amp;quot;1&amp;quot;:2,&amp;quot;2&amp;quot;:&amp;quot;Our ombre rosette cake features handpiped buttercream rosettes in ombre tones for a sweet and classic finish.&amp;quot;}&quot; style=&quot;font-size:10pt;font-family:Arial;font-style:normal;&quot;&gt;Our ombre rosette cake features handpiped buttercream rosettes in ombre tones for a sweet and classic finish.&lt;/span&gt;&lt;/p&gt;', '', 'Ombre Rosette Cake', 'Our ombre rosette cake features handpiped buttercream rosettes in ombre tones for a sweet and classic finish.', 'Ombre Rosette, Ombre, Rosette, classic'),
(42, 1, 'Ombre Striped with Confetti and Balloons', '&lt;p&gt;This popular cake features our signature ombre cake decorated with colourful confetti sprinkles, topped with an eye-catching bouquet of rainbow balloons that\'s sure to be the centre of everyone\'s attention. Choose your desired rainbow shades and fondant letters for a personalised look. A popular design for kids\' birthdays and rainbow-themed celebrations.&lt;/p&gt;', '', 'Ombre Striped with Confetti and Balloons', 'This popular cake features our signature ombre cake decorated with colourful confetti sprinkles, topped with an eye-catching bouquet of rainbow balloons that\'s sure to be the centre of everyone\'s attention.', 'Ombre, Confetti, Balloons, Kid Friendly, Birthday, party, rainbow'),
(48, 1, 'Ombre Nautical Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis nautical-themed cake features a sky blue ombre exterior, garnished with a fondant plaited wreath and a medley of blue and white sprinkles. The cake is embellished with fondant buntings, a hand-cut boat, a ship\'s helm, and a 3D fondant buoy. It\'s topped with a navy blue anchor resting on \'sand\' crumble to create the perfect centrepiece for any nautical-themed celebration!&lt;/p&gt;', '', 'Ombre Nautical Cake', 'This nautical-themed cake features a sky blue ombre exterior, garnished with a fondant plaited wreath and a medley of blue and white sprinkles. The cake is embellished with fondant buntings, a hand-cut boat, a ship\'s helm, and a 3D fondant buoy. It\'s topp', 'One-tier Nautical Cake, One-tier Cake, Nautical Cake, Blue Customized Cake, Sea Theme, Nautical Theme, White, Blue, Red, Sand, Beach, Sea, Ombre'),
(49, 1, 'One-Tier Under The Sea Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nDive deep into these sky blue ombre waves - we create a wavy texture on this ombre cake by hand, and top the cake with purple \'seaweed\', hand-moulded seashells and \'sand\' crumble to finish of this \'under the sea\' look.&lt;/p&gt;', '', 'One-Tier Under The Sea Cake', 'Dive deep into these sky blue ombre waves - we create a wavy texture on this ombre cake by hand, and top the cake with purple \'seaweed\', hand-moulded seashells and \'sand\' crumble to finish of this \'under the sea\' look.', 'ocean, seaweed, seashells, sand, sandy, beach, seaside, tropical, waves, sea waves'),
(61, 1, 'Happy Pineapple Cake', '&lt;p&gt;Huat ah! Our Pineapple Cake features a handpiped yellow exterior, topped with green fondant stems, and an ever-happy grin. A favourite at birthdays and prosperity celebrations.&lt;/p&gt;', '', 'Happy Pineapple Cake', 'Huat ah! Our Pineapple Cake features a handpiped yellow exterior, topped with green fondant stems, and an ever-happy grin. A favourite at birthdays and prosperity celebrations.', 'Pineapple Cake, Kid-friendly, Longevity, prosperity, chinese new year, huat, good luck, fruits, fruit, children'),
(97, 1, 'Gold Ombre Cake with Gold Leaves', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis ombre striped cake is handpainted with edible luster dust, and topped with a medley sprinkles on the top rim. Choose from 24 Karat gold or silver leaf embellishments, and also your preferred ombre colour for a personalised look.&lt;/p&gt;', '', 'Gold Ombre Cake with Gold Leaves', 'This ombre striped cake is handpainted with edible luster dust, and topped with a medley sprinkles on the top rim.', 'Gold ombre Cake With Gold Leaves, Shimmery Ombre, Gold Leaves, Gold, Rose Gold, Ombre, 24 Karat gold, silver leaf, embellishments, gold flakes, silver flakes, sprinkles'),
(105, 1, 'Train Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis train-themed cake features handcut fondant train motifs on the circumference and handpiped buttercream \'grass\' on the top surface. Choose your desired fondant letters and number for a personalised look.&lt;/p&gt;', '', 'Train Cake', 'This train-themed cake features handcut fondant train motifs on the circumference and handpiped buttercream \'grass\' on the top surface. Choose your desired fondant letters and number for a personalised look.', 'choo choo, transportation, transport theme, piped grass, vehicle, public transport'),
(106, 1, 'Wavy Rosette Mermaid Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis beautiful mermaid-theme cake features handpiped swirly rosettes that mimic the waves of the ocean. The cake is adorned with handsculpted fondant seashells and intricate mermaid tails that are sure to be the delight of the party.&lt;/p&gt;', '', 'Wavy Rosette Mermaid Cake', 'This beautiful mermaid-theme cake features handpiped swirly rosettes that mimic the waves of the ocean. The cake is adorned with handsculpted fondant seashells and intricate mermaid tails that are sure to be the delight of the party.', 'Under the Sea, Waves, Ombre, Mermaid Tail, Seashells, Starfishes, Starfish, Seashell, Fish'),
(107, 1, 'White Nautical Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis understated nautical-inspired cake features hand-moulded ship helm and anchor motifs on the circumference, a white plaited wreath and sprinkles for a sophisticated look. A great choice for nautical-themed celebrations and wedding occasions.&lt;/p&gt;', '', 'White Nautical Cake', 'This understated nautical-inspired cake features hand-moulded ship helm and anchor motifs on the circumference, a white plaited wreath and sprinkles for a sophisticated look. A great choice for nautical-themed celebrations and wedding occasions.', 'White Ropes, Anchors, Wheels, Sea, Pure, Marine, Navigation, Ship'),
(108, 1, 'Yellow Bus Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nWheels on the bus go round and round...our popular Yellow Bus Cake was inspired by the School Bus theme. It features a blue exterior with fondant \'bushes\', traffic lights and clouds, and topped with a handcut yellow bus fondant topper. Choose your desired fondant letters&nbsp;and style for a personalised look.&lt;/p&gt;', '', 'Yellow Bus Cake', 'Wheels on the bus go round and round...our popular Yellow Bus Cake was inspired by the School Bus theme. It features a blue exterior with fondant \'bushes\', traffic lights and clouds, and topped with a handcut yellow bus fondant topper.', 'Novelty, Bus, Piped Grass, Traffic Lights, Clouds, Road, Bushes, Fondant, Pastel Blue, Sky, Kids, Kid Party, Children, Young Age'),
(112, 1, 'Rum &amp; Raisin Cake', '&lt;p&gt;Rum lovers, prepare to have a wild night with one of our favourite boozy specials! Our Rum and Raisin is made with rum-soaked chocolate sponge, layered with 66% dark chocolate ganache and juicy rum-soaked raisins.&lt;/p&gt;', '', 'Rum &amp; Raisin Cake', 'Rum lovers, prepare to have a wild night with one of our favourite boozy specials! Our Rum and Raisin is made with rum-soaked chocolate sponge, layered with 66% dark chocolate ganache and juicy rum-soaked raisins.', 'Rum &amp; Raisin Cake, Rum and Raisin Cake, Chocolate, Alcohol'),
(116, 1, 'Standard Cake Main Template', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(149, 1, 'Gin &amp; Tonic Cake', '&lt;p&gt;If G&amp;T is your go-to drink at a bar, we\'ve found the perfect combination of refreshing cocktail and sinful dessert for you! This cake features layers of lime sponge and gin &amp; tonic buttercream, decorated with edible floral petals and lime slices. Cheers to a great cocktail cake!&lt;/p&gt;', '', 'Gin &amp; Tonic Cake', 'If G&amp;T is your go-to drink at a bar, we\'ve found the perfect combination of refreshing cocktail and sinful dessert for you! This cake features layers of lime sponge and gin &amp; tonic buttercream, decorated with edible floral petals and lime slices.', 'Gin &amp; Tonic Cake, Alcohol, Lime, Buttercream'),
(150, 1, 'Black Forest Cake', '&lt;p&gt;A modern take on the black forest cake, this cake has layers of Kirsch-soaked chocolate sponge, fresh cream and chopped Griottine cherries. Finished with a dark chocolate drizzle and gold-dusted Kirsch-soaked cherries.&lt;/p&gt;', '', 'Black Forest Cake', 'A modern take on the black forest cake, this cake has layers of Kirsch-soaked chocolate sponge, fresh cream and chopped Griottine cherries. Finished with a dark chocolate drizzle and gold-dusted Kirsch-soaked cherries.', 'Black Forest Cake, Chocolate, Alcohol, Fruit, Fresh Cream'),
(151, 1, 'Earl Grey Lavender Cake', '&lt;p&gt;One of our bestsellers, our earl grey lavender cake is made with soft chiffon sponge infused with premium earl grey tea leaves. Our buttercream is scented with natural lavender oil for a fragrant floral scent that pairs well with the tea.&lt;/p&gt;', '', 'Earl Grey Lavender Cake', 'One of our bestsellers, our earl grey lavender cake is made with soft chiffon sponge infused with premium earl grey tea leaves. Our buttercream is scented with natural lavender oil for a fragrant floral scent that pairs well with the tea.', 'Earl Grey Lavender Cake, Tea, Buttercream'),
(153, 1, 'Yuzu Matcha Cake', '&lt;p&gt;Our refreshing Yuzu Matcha Cake is made with pure premium Matcha powder imported directly from Japan, paired with a light yuzu chantilly made with 100% yuzu juice and no artificial flavouring. Topped with matcha drizzle glaze and finished with edible flower petals.&lt;/p&gt;', '', 'Yuzu Matcha Cake', 'Our refreshing Yuzu Matcha Cake is made with pure premium Matcha powder imported directly from Japan, paired with a light yuzu chantilly made with 100% yuzu juice and no artificial flavouring. Topped with matcha drizzle glaze and finished with edible flow', 'Yuzu Matcha Cake, Yuzu, Matcha, Tea, Fresh Cream, Fruit'),
(154, 1, 'Matcha Dark Chocolate Cake', '&lt;p&gt;Matcha lovers unite! Using premium pure Matcha powder imported from japan, the mild natural bitterness of our Matcha sponge is paired with dark chocolate ganache for that perfect balance of flavours, topped off with matcha drizzle and freeze-dried raspberry pieces.&lt;/p&gt;', '', 'Matcha Dark Chocolate Cake', 'Matcha lovers unite! Using premium pure Matcha powder imported from japan, the mild natural bitterness of our Matcha sponge is paired with dark chocolate ganache for that perfect balance of flavours, topped off with matcha drizzle and freeze-dried raspber', 'Matcha Dark Chocolate Cake, Matcha, Chocolate, Tea, Ganache'),
(155, 1, 'Honey Lemon Chamomile Cake', '&lt;p&gt;A popular choice for floral tea lovers, this light and refreshing cake flavour features layers of honey lemon sponge and chamomile-infused cream. Topped with dehydrated lemon slices, edible floral petals and finished with marbled lemon buttercream.&lt;/p&gt;', '', 'Honey Lemon Chamomile Cake', 'A popular choice for floral tea lovers, this light and refreshing cake flavour features layers of honey lemon sponge and chamomile-infused cream. Topped with dehydrated lemon slices, edible floral petals and finished with marbled lemon buttercream.', 'Honey Lemon Chamomile Cake, Fruit, Tea, Buttercream, Honey, Lemon'),
(157, 1, 'Lychee Rose Cake', '&lt;p&gt;Our popular Lychee Rose cake features soft and fluffy vanilla swiss sponge, with chopped lychee pieces generously sandwiched between a rose-scented buttercream. A perfect choice for the older crowd and kids alike!&lt;/p&gt;', '', 'Lychee Rose Cake', 'Our popular Lychee Rose cake features soft and fluffy vanilla swiss sponge, with chopped lychee pieces generously sandwiched between a rose-scented buttercream. A perfect choice for the older crowd and kids alike!', 'Lychee Rose Cake, Fruit, Buttercream'),
(158, 1, 'Raspberry Passionfruit Cake', '&lt;p&gt;Experience fruity madness with our Raspberry Passionfruit Cake! For those that prefer a less sweet flavour, this tangy combination of raspberry cream and passionfruit cream, paired with our lemon sponge and freeze-dried raspberry pieces are sure to tickle your tastebuds.&lt;/p&gt;', '', 'Raspberry Passionfruit Cake', 'Experience fruity madness with our Raspberry Passionfruit Cake! For those that prefer a less sweet flavour, this tangy combination of raspberry cream and passionfruit cream, paired with our lemon sponge and freeze-dried raspberry pieces are sure to tickle', 'Raspberry Passionfruit Cake, Fruit, Buttercream'),
(159, 1, 'Strawberry Shortcake', '&lt;p&gt;Our Strawberry Shortcake is simple yet elegant, with vanilla chiffon sponge made with fragrant vanilla beans, layered generously with sweet sliced strawberries. Finished with fresh whipped cream.&lt;/p&gt;', '', 'Strawberry Shortcake', 'Our Strawberry Shortcake is simple yet elegant, with vanilla chiffon sponge made with fragrant vanilla beans, layered generously with sweet sliced strawberries. Finished with fresh whipped cream.', 'Strawberry Shortcake, Fruit, Freshcream'),
(161, 1, 'Vegan Banana Cake (Refined Sugar-Free, Egg-Free, Dairy-Free)', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis banana cake is so moist and delicious, no one would ever guess it&rsquo;s made without eggs, refined sugar and dairy! We pair the banana sponge with a light coconut frosting, covered it with dessicated coconut and topped with some natural, freeze-dried raspberries for a pop of colour.&lt;br /&gt;\n&lt;br /&gt;\nSweetened with pure Canadian maple syrup, this cake is a great option for the health-conscious or those with dietary restrictions too as it is soy-free, dairy-free, refined sugar-free and made without honey.&lt;/p&gt;', '', 'Vegan Banana Cake (Sugar-Free, Egg-Free, Dairy-Free)', 'This banana cake is so moist and delicious, no one would ever guess it’s made without eggs, refined sugar and dairy! We pair the banana sponge with a light coconut frosting, covered it with dessicated coconut and topped with some natural, freeze-dried ras', 'Vegan Banana Cake (Sugar-Free, Egg-Free, Dairy-Free), Sugar Free, Egg Free, Dairy Free, Banana Cake, Vegan Cake, Baby Friendly'),
(162, 1, 'Vegan Chocolate Mudcake (Egg- &amp; Dairy-Free)', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nChocolatey, guilt-free goodness coming your way- we\'ve perfected the texture of our chocolatey mudcake, pairing a rich chocolate ganache with moist and fudgy chocolate cake. This cake is egg-free and dairy-free, making it a great alternative for kids and those with dietary requirements.&lt;br /&gt;\n&nbsp;&lt;/p&gt;', '', 'Vegan Chocolate Mudcake (Egg- &amp; Dairy-Free)', 'Chocolatey, guilt-free goodness coming your way- we\'ve perfected the texture of our chocolatey mudcake, pairing a rich chocolate ganache with moist and fudgy chocolate cake. This cake is egg-free and dairy-free, making it a great alternative for kids and', 'Vegan Chocolate Mudcake (Egg- &amp; Dairy-Free), Vegan Cake, Chocolate Cake, Chocolate Mudcake, Egg Free, Dairy Free'),
(163, 1, 'Peanut Butter Banana Cake', '&lt;p&gt;This brown sugar banana cake is paired with layers of rich peanut butter cream, topped with mini vanilla macarons and gold chocolate flakes.&lt;/p&gt;', '', 'Peanut Butter Banana Cake', 'This brown sugar banana cake is paired with layers of rich peanut butter cream, topped with mini vanilla macarons and gold chocolate flakes.', 'Peanut Butter, Banana, Cake'),
(164, 1, 'Gluten-Free Pandan Coconut Cake', '&lt;p&gt;A gluten-free version of our popular Pandan Coconut Gula Melaka cake! Pandan sponge with salted coconut buttercream, gula melaka coconut filling, covered with dessicated coconut.&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Gluten-Free Pandan Coconut Cake', 'A gluten-free version of our popular Pandan Coconut Gula Melaka cake! Pandan sponge with salted coconut buttercream, gula melaka coconut filling, covered with dessicated coconut.', 'Gluten-Free Pandan Coconut Cake, Pandan Cake, Coconut Cake, Gula Melaka, Buttercream Cake, Gluten Free'),
(165, 1, 'Pandan Coconut Gula Melaka Cake', '&lt;p&gt;A classic pairing that\'s sure to tingle the local tastebuds! Our Pandan Coconut Gula Melaka Cake is reminiscent of the Ondeh-Ondeh kueh, featuring a fragrant and moist pandan sponge between layers of handcooked gula melaka coconut filling and salted coconut buttercream. Coated with dessicated coconut. A popular choice for all ages.&lt;/p&gt;', '', 'Pandan Coconut Gula Melaka Cake', 'A classic pairing that\'s sure to tingle the local tastebuds! Our Pandan Coconut Gula Melaka Cake is reminiscent of the Ondeh-Ondeh kueh, featuring a fragrant and moist pandan sponge between layers of handcooked gula melaka coconut filling and salted cocon', 'Pandan Coconut Gula Melaka Cake, Pandan, Local, Buttercream'),
(166, 1, 'Gula Melaka Bundt Cake', '&lt;p&gt;A nostalgic flavour. Fragrant gula melaka bundt cake with salted coconut glaze, topped with toasted coconut flakes.&lt;/p&gt;', '', 'Gula Melaka Bundt Cake', '', 'Gula Melaka Bundt Cake, Gula Melaka, Bundt Cake, Toasted Coconut'),
(168, 1, 'Cookie Dough Speculoos Chocolate Cake', '&lt;p&gt;A crowd favourite, our Cookie Dough Speculoos cake has something for everyone. Featuring cookie dough (egg-free and without raw flour), speculoos spread and dark chocolate ganache between the layers of chocolate sponge, this cake is filled with all kinds of chocolatey goodness.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Cookie Dough Speculoos Chocolate Cake', 'A crowd favourite, our Cookie Dough Speculoos cake has something for everyone. Featuring cookie dough (egg-free and without raw flour), speculoos spread and dark chocolate ganache between the layers of chocolate sponge, this cake is filled with all kinds ', 'Cookie Dough Speculoos Chocolate Cake, Chocolate Cake, Cookie Dough, Speculoos, Dark Chocolate, Ganache'),
(169, 1, 'Speculoos Chocolate Crunch Cake', '&lt;p&gt;Speculoos is the star ingredient in this flavour - we\'ve paired it with fluffy vanilla sponge and alternating layers of 66% Valrhona chocolate cream and crunchy Valrhona Caramelia chocolate pearls. Topped with a delicious speculoos drizzle glaze and biscuits.&lt;/p&gt;', '', 'Speculoos Chocolate Crunch Cake', 'Speculoos is the star ingredient in this flavour - we\'ve paired it with fluffy vanilla sponge and alternating layers of 66% Valrhona chocolate cream and crunchy Valrhona Caramelia chocolate pearls. Topped with a delicious speculoos drizzle glaze and biscu', 'Speculoos Chocolate Crunch Cake, Vanilla Sponge Cake, Chocolate, Speculoos, Chocolate Pearls'),
(170, 1, 'Salted Caramel Chocolate Cake', '&lt;p&gt;Our homemade salted caramel sauce is cooked to a deep amber colour, seasoned with Maldon sea salt flakes to accentuate the bittersweet notes of the caramel. Paired with our moist chocolate sponge and not too cloyingly sweet, this cake is a great choice for any celebration.&lt;/p&gt;', '', 'Salted Caramel Chocolate Cake', 'Our homemade salted caramel sauce is cooked to a deep amber colour, seasoned with Maldon sea salt flakes to accentuate the bittersweet notes of the caramel. Paired with our moist chocolate sponge and not too cloyingly sweet, this cake is a great choice fo', 'Salted Caramel Chocolate Cake, Salted Caramel, Chocolate Cake, Sea Salt, Buttercream Cake'),
(171, 1, 'Chendol Cake', '&lt;p&gt;Calling all Chendol fans! We\'ve reimagined your favourite local dessert into a cake! Layers of gula melaka sponge and gula melaka coconut cream topped with chendol and adzuki red beans. Not too sweet but full of flavour, a great after-meal dessert.&lt;/p&gt;', '', 'Chendol Cake', 'Calling all Chendol fans! We\'ve reimagined your favourite local dessert into a cake! Layers of gula melaka sponge and gula melaka coconut cream topped with chendol and adzuki red beans. Not too sweet but full of flavour, a great after-meal dessert.', 'Chendol Cake, Local, Fresh Cream'),
(172, 1, 'Chocolate Hazelnut Cake', '&lt;p&gt;If you love Ferrero Rochers and the classic pairing of hazelnuts and chocolate, this cake is for you. Our Chocolate Hazelnut Cake is made of moist chocolate sponge, layered with hazelnut praline and roasted hazelnuts, finished with chocolate chantilly and topped with Ferrero Rochers.&lt;/p&gt;', '', 'Chocolate Hazelnut Cake', 'If you love Ferrero Rochers and the classic pairing of hazelnuts and chocolate, this cake is for you. Our Chocolate Hazelnut Cake is made of moist chocolate sponge, layered with hazelnut praline and roasted hazelnuts, finished with chocolate chantilly and', 'Chocolate Hazelnut Cake, Chocolate, Hazelnut, Fresh Cream Cake'),
(173, 1, 'Chocolate Truffle Cake', '&lt;p&gt;This classic chocolate cake features layers of chocolate sponge and 66% dark chocolate whipped ganache. Topped with dark chocolate glaze, roasted cocoa nibs and chocolate pieces for a classic look.&lt;/p&gt;', '', 'Chocolate Truffle Cake', 'This classic chocolate cake features layers of chocolate sponge and 66% dark chocolate whipped ganache. Topped with dark chocolate glaze, roasted cocoa nibs and chocolate pieces for a classic look.', 'Chocolate Truffle Cake, Chocolate, Ganache'),
(174, 1, 'Butter Bundt Cake with Mixed Berries', '&lt;p&gt;Remember that rich buttery smell wafting from your mum\'s oven when you were a child? Our rich, fragrant and buttery bundt cake is sure to bring back those memories! We pair ours with a light dusting of raspberry icing sugar and rose gold-dusted mixed berries for a classic finish.&lt;/p&gt;', '', 'Butter Bundt Cake with Mixed Berries', 'Remember that rich buttery smell wafting from your mum\'s oven when you were a child? Our rich, fragrant and buttery bundt cake is sure to bring back those memories! We pair ours with a light dusting of raspberry icing sugar and rose gold-dusted mixed berr', 'Butter Bundt Cake with Mixed Berries, Mixed Berries, Bundt Cake, Cream Free'),
(192, 1, 'Matcha Blondies', '&lt;p&gt;Matcha madness with every bite! Our Matcha Blondies are made with premium pure Matcha powder imported from japan, featuring a mild natural bitterness that enhances the fragrance of the tea leaves.&lt;/p&gt;', '', 'Matcha Blondies', 'Matcha madness with every bite! Our Matcha Blondies are made with premium pure Matcha powder imported from japan, featuring a mild natural bitterness that enhances the fragrance of the tea leaves.', 'Chocolate, Matcha, Blondies, Brownies, Bitter, Sweet');
INSERT INTO `j5ui84yug_yng8e54e_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(193, 1, 'Earl Grey Brownies', '&lt;p&gt;Not just your average brownie - our popular Earl Grey-infused brownies really pack a punch! Sink your teeth into our Earl grey brownie base, topped with earl grey-infused chocolate ganache, garnished with dried edible petals. Perfect for tea lovers!&lt;/p&gt;', '', 'Earl Grey Brownies', 'Not just your average brownie - our popular Earl Grey-infused brownies really pack a punch! Sink your teeth into our Earl grey brownie base, topped with earl grey-infused chocolate ganache, garnished with dried edible petals. Perfect for tea lovers!', 'Chocolate, Earl Grey, Blondies, Brownies, Sweet, Tea'),
(194, 1, 'Mini Bubble Tea Tarts', '&lt;p&gt;These mini versions of our ever-popular Bubble Tea Tarts are sure to be a crowd pleaser! Designed as one-bite treats, each box comes with a mix of Matcha and Milk Tea flavours. As featured in The Straits Times, Business Insider, Today, 8 Days and other media outlets!&lt;/p&gt;', '', 'Mini Bubble Tea Tarts', 'These mini versions of our ever-popular Bubble Tea Tarts are sure to be a crowd pleaser! Designed as one-bite treats, each box comes with a mix of Matcha and Milk Tea flavours. As featured in The Straits Times, Business Insider, Today, 8 Days and other me', 'Mini Bubble Tea Tarts, Bubble Tea, Tarts, Mini Bites'),
(195, 1, 'Bubble Tea Tarts', '&lt;p&gt;Our Bubble Tea Tarts are a hit with all. Our almond tart shells are handmade and baked till golden brown for the perfect crust, filled with tea-infused ganache and topped with everyone\'s favourite boba tea pearls cooked fresh daily for the perfect chewy texture.&lt;/p&gt;\n\n&lt;p&gt;Available in two fixed flavours of original milk tea and matcha.&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Bubble Tea Tarts', 'Our Bubble Tea Tarts are a hit with all. Our almond tart shells are handmade and baked till golden brown for the perfect crust, filled with tea-infused ganache and topped with everyone\'s favourite boba tea pearls cooked fresh daily for the perfect chewy t', 'Bubble Tea Tarts, Pearls, Matcha, Milk Tea, Tarts'),
(196, 1, 'Hazelnut Brownies', '&lt;p&gt;Our decadent Hazelnut Brownies are made with 66% Valrhona chocolate and coated with dark chocolate ganache, topped off with a layer ofroasted hazelnut praline and crushed hazelnuts for that extra crunch!&lt;/p&gt;', '', 'Hazelnut Brownies', 'Our decadent Hazelnut Brownies are made with 66% Valrhona chocolate and coated with dark chocolate ganache, topped off with a layer ofroasted hazelnut praline and crushed hazelnuts for that extra crunch!', 'Chocolate, Hazelnut, Blondies, Brownies, Sweet, Hazelnut, Nut'),
(197, 1, 'Salted Speculoos Blondies', '&lt;p&gt;Our Salted Speculoos Blondies are made with salted speculoos frosting and speculoos drizzle, sprinkled with sea salt flakes to balance the sweetness and bring out the lovely spice of the speculoos flavour.&lt;/p&gt;', '', 'Salted Speculoos Blondies', 'Our Salted Speculoos Blondies are made with salted speculoos frosting and speculoos drizzle, sprinkled with sea salt flakes to balance the sweetness and bring out the lovely spice of the speculoos flavour.', 'Chocolate, Salted Speculoos Blondies, Blondies, Brownies, Sweet, Salted, Speculoos'),
(198, 1, 'Vegan Chocolate Fudge Brownies (Egg-Free, Dairy-Free, Gluten-Free)', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nFudgy, rich and guilt-free, these egg-free, dairy-free and gluten-free chocolate brownies with a touch of confetti sprinkles are great for those with dietary restrictions without sacrificing on flavour.&lt;br /&gt;\n&nbsp;&lt;/p&gt;', '', 'Vegan Chocolate Fudge Brownies (Egg-Free, Dairy-Free, Gluten-Free)', 'Fudgy, rich and guilt-free, these egg-free, dairy-free and gluten-free chocolate brownies with a touch of confetti sprinkles are great for those with dietary restrictions without sacrificing on flavour.', 'Chocolate, Blondies, Brownies, Sweet, Vegan Chocolate Fudge Brownies (Egg-Free, Dairy-Free, Gluten-Free), Vegan, Egg Free, Dairy Free, Gluten Free, Chocolate Fudge'),
(199, 1, 'Mini Honey Cake', '&lt;p&gt;Originally created as a special wedding cake order, this cult favourite of a cake was so popular that it became part of our regular menu, and a mini version was created due to popular demand! Featuring three glorious layers of fragrant moist honey sponge, lathered with caramel cream and coated with a generous serving of honey crumbs! A popular celebratory cake and a pantry favourite.&lt;/p&gt;', '', 'Mini Honey Cake', 'Originally created as a special wedding cake order, this cult favourite of a cake was so popular that it became part of our regular menu, and a mini version was created due to popular demand! Featuring three glorious layers of fragrant moist honey sponge,', 'Mini Honey Cake, Honey, Mini Bite, Fresh Cream'),
(200, 1, 'Mini Lemon Loaves', '&lt;p&gt;A crowd favourite, our moist and tangy lemon loaves are glazed with a tangy lemon drizzle and garnished with edible floral petals for a wonderful burst of flavour with every bite. Cut into mini slices to serve even more, but we can&rsquo;t promise that your guests would want to share!&lt;/p&gt;', '', 'Mini Lemon Loaves', 'A crowd favourite, our moist and tangy lemon loaves are glazed with a tangy lemon drizzle and garnished with edible floral petals for a wonderful burst of flavour with every bite.', 'Mini Lemon Loaves, Lemon, Fruit, Mini Bite, Cake, Buttery'),
(202, 1, 'Mini Tarts', '&lt;p&gt;Looking for the perfect mini bakes to add colour to your dessert table, or just a sinful sweet treat between meals? Our S\'mores and Mango Strawberry Mini Tarts are sure to hit the spot!&lt;br /&gt;\n&nbsp;&lt;br /&gt;\nOur S\'mores tarts are filled with dark chocolate ganache, topped with roasted marshmallows, while our Mango Strawberry tarts are filled with mango cream, topped with fresh strawberries.&lt;br /&gt;\n&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Mini Tarts', 'Looking for the perfect mini bakes to add colour to your dessert table, or just a sinful sweet treat between meals? Our S\'mores and Mango Strawberry Mini Tarts are sure to hit the spot! \n \nOur S\'mores tarts are filled with dark chocolate ganache, topped', 'Mini Tarts, Fruit, Mini Bite, Chocolate'),
(203, 1, 'Mini Bites (For duplication)', '&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Comes in fixed quantities of:&nbsp;&lt;/p&gt;\n\n&lt;p&gt;- 2 Boxes of 6&lt;/p&gt;\n\n&lt;p&gt;- 1 Box of 25&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Additional costs will apply for individual paper bags&nbsp;requested.&nbsp;&lt;/p&gt;', '', 'Mini Bites (For duplication)', '', ''),
(204, 1, 'Mini Pandan Coconut Gula Melaka Cupcakes', '&lt;p&gt;One is never enough - our bite-sized pandan cupcakes are topped with salted coconut buttercream and a homecooked gula melaka coconut topping, a crowd favourite for any occasion.&lt;/p&gt;', '', 'Mini Pandan Coconut Gula Melaka Cupcakes', 'One is never enough - our bite-sized pandan cupcakes are topped with salted coconut buttercream and a homecooked gula melaka coconut topping, a crowd favourite for any occasion.', 'Mini Pandan Coconut Gula Melaka Cupcakes, Cupcakes, Mini Cupcakes, Pandan Coconut, Gula Melaka, Pandan, Coconut'),
(205, 1, 'Mini Chocolate Candies Cupcakes', '&lt;p&gt;Topped with our favourite sinful chocolate treats, these mini cupcakes come in an assortment of vanilla and chocolate flavours, a party favourite especially with kids.&lt;/p&gt;', '', 'Mini Chocolate Candies Cupcakes', 'Topped with our favourite sinful chocolate treats, these mini cupcakes come in an assortment of vanilla and chocolate flavours, a party favourite especially with kids.', 'Mini Chocolate Candies Cupcakes, Cupcakes, Mini Cupcakes, Chocolate Candies, Vanilla Cupcakes, Chocolate Cupcakes, Chocolate'),
(206, 1, 'Mini Vegan Vanilla Chocolate Cupcakes (Egg-Free &amp; Dairy-Free)', '&lt;p&gt;A guilt-free alternative for guests with dietary restrictions. These vanilla cupcakes are topped with chocolate cream and sequin sprinkles that will brighten up your dessert table!&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Mini Vegan Vanilla Chocolate Cupcakes (Egg-Free &amp; Dairy-Free)', 'A guilt-free alternative for guests with dietary restrictions. These vanilla cupcakes are topped with chocolate cream and sequin sprinkles that will brighten up your dessert table!', 'Mini Vegan Vanilla Chocolate Cupcakes (Egg-Free &amp; Dairy-Free), Cupcakes, Mini Cupcakes, Egg Free, Dairy Free, Vanilla Cupcake, Chocolate'),
(207, 1, 'Macarons', '&lt;p&gt;These colourful almond cookies are great party favours, bound to brighten up your celebrations.&lt;br /&gt;\n&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Macarons', 'These colourful almond cookies are great party favours, bound to brighten up your celebrations.', 'Macarons, Coffee, Raspberry, Lemon, Earl Grey, Salted Caramel, Orange, Passionfruit, Chocolate'),
(208, 1, 'Assorted Chocolate Box', '&lt;p&gt;Neatly packaged in a box of 4, our handcrafted chocolates are the perfect gift for your loved ones!&lt;/p&gt;', '', 'Assorted Chocolate Box', 'Neatly packaged in a box of 4, our handcrafted chocolates are the perfect gift for your loved ones!', 'Assorted Chocolate Box, Chocolate, Almond, Hazelnut, Milk Chocolate, Matcha, Truffle, White Chocolate, Caramel, Passionfruit, Assorted, Chocolate Box'),
(210, 1, 'Mini Bites Main Template', '&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Comes in fixed quantities of:&nbsp;&lt;/p&gt;\n\n&lt;p&gt;- 2 Boxes of 6&lt;/p&gt;\n\n&lt;p&gt;- 1 Box of 25&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Additional costs will apply for individual paper bags&nbsp;requested.&nbsp;&lt;/p&gt;', '', 'Mini Bited Main Template', '', ''),
