(228, 1, 'Honey Cake', '&lt;p&gt;Originally created as a special wedding cake order, this cult favourite of a cake was so popular that it became part of our regular menu! Featuring six glorious layers of fragrant moist honey sponge, lathered with caramel cream and coated with a generous serving of honey crumbs! A popular celebratory cake and a pantry favourite.&lt;/p&gt;', '', 'Honey Cake', 'Originally created as a special wedding cake order, this cult favourite of a cake was so popular that it became part of our regular menu! Featuring six glorious layers of fragrant moist honey sponge, lathered with caramel cream and coated with a generous', 'Honey Cake, Honey, Mini Bite, Fresh Cream'),
(229, 1, 'Valrhona Chocolate Crunch Cake', '&lt;p&gt;One suitable for all ages! Our best-selling chocolate cake packs a punch with moist chocolate layers, 66% Valrhona chocolate cream, and Valrhona chocolate crunchy pearls. Coated with dark chocolate cake crumbs.&lt;/p&gt;', '', 'Valrhona Chocolate Crunch Cake', 'One suitable for all ages! Our best-selling chocolate cake packs a punch with moist chocolate layers, 66% Valrhona chocolate cream, and Valrhona chocolate crunchy pearls. Coated with dark chocolate cake crumbs.', 'Valrhona Chocolate Crunch Cake, Chocolate Cake, Dark Chocolate, Crunchy, buttercream'),
(230, 1, 'Two Tier Auspicious Longevity Cake', '&lt;p&gt;This popular longevity design features a two-tier red base with gold pearls and gold dusting on the rims. Decorated with marbled fondant koi toppers and beautiful fondant dragons that are individually handpainted gold and placed around the circumference. Topped with a gold glitter paper topper symbolising the Chinese longevity character. In Chinese culture, koi fish are often seen as a symbol of strength, ambition and good luck and are commonly featured during auspicious celebrations. Dragons are also popular motifs that symbolise courage, strength and prosperity.&lt;/p&gt;', '', 'Two Tier Auspicious Longevity Cake', 'This popular longevity design features a two-tier red base with gold pearls and gold dusting on the rims. Decorated with marbled fondant koi toppers and beautiful fondant dragons that are individually handpainted gold and placed around the circumference.', 'Gold, Two tier, longevity, dragons, red, longevity bun, shou tao, prosperity, luck, koi, fish, gold sprinkles, gold dust'),
(231, 1, 'Two Tier Piped Cactus Cake', '&lt;p&gt;This two-tier version of our cactus cake was inspired by our love for spiky greens! Each buttercream cactus is handpiped by our cake artists, garnished with \'sand\' crumble. Topped with a rustic rosemary bunting as a final touch to this beautiful centrepiece for any rustic-themed occasion.&lt;/p&gt;', '', 'Two Tier Piped Cactus Cake', 'This two-tier version of our cactus cake was inspired by our love for spiky greens! Each buttercream cactus is handpiped by our cake artists, garnished with \'sand\' crumble. Topped with a rustic rosemary bunting as a final touch to this beautiful centrepie', 'Cactus, Two Tier. rustic, sand, speculoos crumble, rosemary, desert, succulent'),
(233, 1, 'Two Tier Barnyard Cake', '&lt;p&gt;This barnyard-inspired design features a green base decorated with brown and white fondant bunting on the circumference, along with a top tier of sky blue marble, fondant clouds and handpiped grass on the top surface. The barnyard topper is the crowning jewel of this design - a handcut piece that features a handcarved wooden texture, which can be personalised with a number to commemorate the birthday girl or boy\'s age. Choose to add on fondant letters or animal toppers for a personalised look.&lt;/p&gt;', '', 'Two Tier Barnyard Cake', 'This barnyard-inspired design features a green base decorated with brown and white fondant bunting on the circumference, along with a top tier of sky blue marble, fondant clouds and handpiped grass on the top surface. The barnyard topper is the crowning j', 'Barnyard, Two Tier, Cloud, Animal, Farm, fondant bunting, barn, sky, blue, red, grass'),
(235, 1, 'One Tier Semi Custom Main Template', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'For duplication of One Tier Semi Custom', '', ''),
