(238, 1, 'For duplication of One Tier Semi Custom', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'For duplication of One Tier Semi Custom', '', ''),
(239, 1, 'One Tier Semi Custom Main Template (For Duplication)', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'For duplication of One Tier Semi Custom', '', ''),
(241, 1, 'Solid Colour with Gold Line Accents and Chocolate Sails', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\nPresent an understated geometric look with this gold-accented cake that\'s embellished with gold-dusted tempered dark chocolate sails. Choose your desired cake colour for a personalised look.&lt;br /&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Solid Colour with Gold Line Accents and Chocolate Sails', 'Present an understated geometric look with this gold-accented cake that\'s embellished with gold-dusted tempered dark chocolate sails.', 'Guy-Friendly, classy, classic, chocolates, sails, gold painted, chocolate shards,'),
(242, 1, 'Rustic Caramel Cake with Popcorn, Macarons and Butterwaffels', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n&lt;/style&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\n&lt;span data-sheets-userformat=&quot;{&amp;quot;2&amp;quot;:769,&amp;quot;3&amp;quot;:{&amp;quot;1&amp;quot;:0},&amp;quot;11&amp;quot;:4,&amp;quot;12&amp;quot;:0}&quot; data-sheets-value=&quot;{&amp;quot;1&amp;quot;:2,&amp;quot;2&amp;quot;:&amp;quot;One of our classic rustic designs - this rustic cake is garnished with rosemary herbs and topped with rose petals. Perfect for rustic floral themes.&amp;quot;}&quot; style=&quot;font-size:10pt;font-family:Arial;font-style:normal;&quot;&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;We drizzle salted caramel sauce over this rustic cake, topped with handmade caramel-coated popcorn, mini macarons and butterwaffels for a delightful crunch and texture. Popular with caramel popcorn lovers! Choose from a range of chocolatey flavours that pair well with caramel and popcorn.\r\n&lt;/style&gt;\r\n&lt;/span&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n&lt;/style&gt;\r\nWe drizzle salted caramel sauce over this rustic cake, topped with handmade caramel-coated popcorn, mini macarons and butterwaffels for a delightful crunch and texture. Popular with caramel popcorn lovers! Choose from a range of chocolatey flavours that pair well with caramel and popcorn.&lt;/p&gt;', '', 'Rustic Caramel Cake with Popcorn, Macarons and Butterwaffels', 'We drizzle salted caramel sauce over this rustic cake, topped with handmade caramel-coated popcorn, mini macarons and butterwaffels for a delightful crunch and texture. Popular with caramel popcorn lovers!', 'Rustic Caramel Cake with Popcorn, Macarons and Butterwaffels, Rustic, Popcorn, Caramel, Macarons, Butterwaffels'),
(243, 1, 'Rustic Thyme, Daisies &amp; Baby’s Breath Cake', '&lt;p&gt;This rustic cake is garnished with sprigs of thyme herbs, topped with fresh daisies and baby\'s breath for an ethereal floral finish. A popular choice for floral themed celebrations.&lt;/p&gt;', '', 'Rustic Thyme, Daisies &amp; Baby’s Breath Cake', 'This rustic cake is garnished with sprigs of thyme herbs, topped with fresh daisies and baby\'s breath for an ethereal floral finish. A popular choice for floral themed celebrations.', 'Rustic, Floral, Daisies, Baby\'s Breath, Rustic Daisies &amp; Baby’s Breath Cake'),
(244, 1, 'Rustic Floral Berry Cake', '&lt;p&gt;Our signature Rustic Floral Berry cake is always a stunner. Featuring 24 Karat edible gold leaves which are individually placed onto the cake by our cake artists, this cake is also garnished with fresh berries and florals. Choose between decorative fresh florals or edible petals for a personalised look.\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n&lt;/style&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;Our signature Rustic Floral Berry cake is always a stunner. Featuring 24 Karat edible gold leaves which are individually placed onto the cake by our cake artists, this cake is also garnished with fresh berries and florals. Choose between decorative fresh florals or edible petals for a personalised look.\r\n&lt;/style&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n&lt;/style&gt;\r\n&lt;/p&gt;', '', 'Rustic Floral Berry Cake', 'Our signature Rustic Floral Berry cake is always a stunner. Featuring 24 Karat edible gold leaves which are individually placed onto the cake by our cake artists, this cake is also garnished with fresh berries and florals.', 'Rustic Floral Berry Cake, Rustic, Floral, Berry'),
(245, 1, 'Orange Construction Cake', '&lt;p&gt;Our Orange Construction Cake is every construction lover\'s dream! We adorn the sides with 2D fondant construction vehicles and traffic cones, each handcut individually by our fondant artists. We decorate the top surface with chocolate \'sand\', traffic cones, and a handcut 2D construction vehicle topper.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Orange Construction Cake', 'Our Orange Construction Cake is every construction lover\'s dream! We adorn the sides with 2D fondant construction vehicles and traffic cones, each handcut individually by our fondant artists. We decorate the top surface with chocolate \'sand\', traffic cone', 'Orange, Construction Cake, Fondant, Traffic, Vehicles, Transportation'),
(246, 1, 'Panda Cake', '&lt;p&gt;Our handpiped panda cake is&nbsp;sure to put a smile on anyone\'s face with his cheeky grin!&nbsp;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Panda Cake', 'Our handpiped panda cake is sure to put a smile on anyone\'s face with his cheeky grin! ', 'Panda, Animal, Sculpted Cake, Fondant, Buttercream'),
(247, 1, 'Pastel Rainbow with White Chocolate Drizzle and Meringue Decor', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur signature piped rainbow cake is finished with white chocolate drizzle, and topped with rainbow-sprinkled meringues, rainbow sprinkles and mini marshmallows for a happy, celebratory look.&lt;/p&gt;', '', 'Pastel Rainbow with White Chocolate Drizzle and Meringue Decor', 'Our signature piped rainbow cake is finished with white chocolate drizzle, and topped with rainbow-sprinkled meringues, rainbow sprinkles and mini marshmallows for a happy, celebratory look.', 'pastel yellow, pastel pink, pastel green, pastel blue, pastel orange, pastel purple'),
(248, 1, 'Pastel Blue Ombre Cake with Crescent Moon and Stars', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis pastel blue ombre cake is adorned with adorable cheery fondant gold stars. These stars are handcut and handpainted individually by our fondant artists. Topped with a handcut crescent moon and fondant clouds. A popular choice for baby celebrations.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Pastel Blue Ombre Cake with Crescent Moon and Stars', 'This pastel blue ombre cake is adorned with adorable cheery fondant gold stars. These stars are handcut and handpainted individually by our fondant artists. Topped with a handcut crescent moon and fondant clouds. A popular choice for baby celebrations.', 'Ombre, Blue, Crescent, Stars, Moon, Fondant, Baby Shower'),
(249, 1, 'Space Galaxy Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nWe embellish our galaxy cake with 3D hand-moulded fondant planets, along with a handsculpted fondant rocket blasting off to space. A popular choice for space and galaxy-themed celebrations.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Space Galaxy Cake', 'We embellish our galaxy cake with 3D hand-moulded fondant planets, along with a handsculpted fondant rocket blasting off to space. A popular choice for space and galaxy-themed celebrations.', 'galaxy, infinity and beyond, space, silver splatter, planets with rings, 3D rocket, kids friendly, children, child, kid, party, dark, sky, marbled planets'),
(251, 1, 'Piggy Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOink oink! Our hand-sculpted piggy cake features a handpiped pastel pink exterior, 3D ears and a piggy face. A favourite at birthdays and prosperity celebrations.&lt;/p&gt;', '', 'Piggy Cake', 'Oink oink! Our hand-sculpted piggy cake features a handpiped pastel pink exterior, 3D ears and a piggy face. A favourite at birthdays and prosperity celebrations.', 'Pig, piped cake, sculpted cake, pink pig, longevity, prosperity, oink, animal, animal cake, farm, barnyard, barn'),
(252, 1, 'Piped Lion Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nRoar! Our lion cake features a yellow exterior with a handpiped brown mane. Great for animal lovers and safari themes.&lt;/p&gt;', '', 'Piped Lion Cake', 'Roar! Our lion cake features a yellow exterior with a handpiped brown mane. Great for animal lovers and safari themes.', 'Lion, roar, piped cake, animal, animal cake, farm, sculpted cake, zoo'),
(253, 1, 'Puppy Dog Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nWoof! Our puppy dog cake features handpiped fur buttercream, and is a popular design for dog lovers and kids alike.&lt;/p&gt;', '', 'Puppy Dog Cake', 'Woof! Our puppy dog cake features handpiped fur buttercream, and is a popular design for dog lovers and kids alike.', 'Dog, puppy, woof, doggy, brown, white, animal cake, animal, pet, home'),
(254, 1, 'Rabbit Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur rabbit cake features handpiped fur buttercream, adorned with a pair of fondant ears and an orange carrot. A great gift for animal lovers.&lt;/p&gt;', '', 'Rabbit Cake', 'Our rabbit cake features handpiped fur buttercream, adorned with a pair of fondant ears and an orange carrot. A great gift for animal lovers.', 'rabbit, bunny, easter, carrot, animal, animal cake, cute'),
(284, 1, 'Marbled Cake with Rosettes and Fondant Daisies', '&lt;p&gt;This pink and blue marbled cake is topped with handpiped rosette swirls, green buttercream leaf piping, and finished with handcut fondant daisies.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Marbled Cake with Rosettes and Fondant Daisies', 'This pink and blue marbled cake is topped with handpiped rosette swirls, green buttercream leaf piping, and finished with handcut fondant daisies.', 'Marbled, Buttercream, Rosettes, Fondant, Daisies, Flowers'),
(297, 1, 'Pastel Rainbow and Macarons Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis bright and cheery rainbow cake features a pastel blue drizzle, along with rainbow sprinkles, meringues, and colorful macarons in assorted flavours. A popular choice for celebrations involving both adults and kids. Choose your desired fondant letters for a personalised look.&lt;/p&gt;', '', 'Pastel Rainbow and Macarons Cake', 'This bright and cheery rainbow cake features a pastel blue drizzle, along with rainbow sprinkles, meringues, and colorful macarons in assorted flavours. A popular choice for celebrations involving both adults and kids.', 'children, kid, kids, kid friendly, pastel blue, pastel pink, pastel purple, pastel pink, pastel orange, pastel yellow, pastel shades, drips'),
(298, 1, 'Pastel Galaxy Cake', '&lt;p&gt;Our pastel galaxy cake features a marbling of pastel blue, purple and pink shades, finished with gold pearls and gold powder dusting on the top rim. A popular choice for pastel-themed birthday celebrations.&lt;/p&gt;', '', 'Pastel Galaxy Cake', 'Our pastel galaxy cake features a marbling of pastel blue, purple and pink shades, finished with gold pearls and gold powder dusting on the top rim. A popular choice for pastel-themed birthday celebrations.', 'space, universe, pastel purple, pastel pink, touch of gold, feminine, girly, girls, kid-friendly, children, kids, party, princess'),
(299, 1, 'Gender Reveal Drizzle Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nLooking for a way to announce the gender of your baby? Our gender reveal design allows you the option of choosing either a pink reveal for a girl, or a blue reveal for a boy. Both are vanilla-based sponges with lightly tinted vanilla buttercream to illustrate the gender colour. The exterior features a pink and blue marbled cake, topped with pastel purple drizzle. The top surface is decorated with mini confetti sprinkles, pink and blue candy shards, pink and blue vanilla macarons, and hand-twirled lollipops.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Gender Reveal Drizzle Cake', 'Looking for a way to announce the gender of your baby? Our gender reveal design allows you the option of choosing either a pink reveal for a girl, or a blue reveal for a boy. Both are vanilla-based sponges with lightly tinted vanilla buttercream to illust', 'Surprise, boy or girl, candy themed, children party, pastel theme'),
(300, 1, 'Pastel Purple and Pink Marble with Baby&#039;s Breath and Fondant Daisies', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis pastel purple and pink marbled cake is topped with handpiped rosette swirls, handcut fondant daisies, and baby\'s breath on the bottom rim for a sweet finish.&lt;/p&gt;', '', 'Pastel Purple and Pink Marble with Baby\'s Breath and Fondant Daisies', 'This pastel purple and pink marbled cake is topped with handpiped rosette swirls, handcut fondant daisies, and baby\'s breath on the bottom rim for a sweet finish.', 'pastel, marble, baby\'s breath, floral, daisies, purple, pink'),
(301, 1, 'Pastel Green Ombre Cake with Piped Palm Trees', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;This pastel green ombre base is adorned with buttercream palm trees, each piped individually by hand by our cake artists. Topped with vibrant rainbow sprinkles. Choose from our range of fondant and paper decorations to make this cake your own! &lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis pastel green ombre base is adorned with buttercream palm trees, each piped individually by hand by our cake artists. Topped with vibrant rainbow sprinkles. Choose from our range of fondant and paper decorations to make this cake your own!​​​​​​​&lt;/p&gt;', '', 'Pastel Green Ombre Cake with Piped Palm Trees', 'This pastel green ombre base is adorned with buttercream palm trees, each piped individually by hand by our cake artists. Topped with vibrant rainbow sprinkles.', 'ombre, pastel, piped palm tree, tropical, beach, Hawaii, holiday'),
(302, 1, 'Rustic Woodland Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis popular woodland-themed cake has a pastel rainbow bunting and handcut tree trunks on the circumference. Decorated with fondant daisies, toadstools and logs. Each of these toppers are intricately and individually moulded by our fondant artists. Finished with a beautiful handsculpted cheerful fox topper to complete this rustic cake.&lt;/p&gt;', '', 'Rustic Woodland Cake', 'This popular woodland-themed cake has a pastel rainbow bunting and handcut tree trunks on the circumference. Decorated with fondant daisies, toadstools and logs. Each of these toppers are intricately and individually moulded by our fondant artists. Finish', 'Rustic, animals, woods, forest, mushrooms, trees, trunk, toadstools, rainbow bunting, rainbow, flags, daisies, fox,'),
(303, 1, 'Rustic Floral Petal Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis rustic cake is one of our favourites - the exterior features herb sprigs and edible floral petals carefully and individually placed by hand onto the cake by our cake artists. Perfect for rustic floral themes.&lt;/p&gt;', '', 'Rustic Floral Petal Cake', 'This rustic cake is one of our favourites - the exterior features herb sprigs and edible floral petals carefully and individually placed by hand onto the cake by our cake artists. Perfect for rustic floral themes.', 'edible petals, flowers, edible, florals, petals, herbs, colourful'),
(304, 1, 'Pastel Rainbow with Rainbow Rosettes and Sprinkles', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;span data-sheets-userformat=&quot;{&amp;quot;2&amp;quot;:769,&amp;quot;3&amp;quot;:{&amp;quot;1&amp;quot;:0},&amp;quot;11&amp;quot;:4,&amp;quot;12&amp;quot;:0}&quot; data-sheets-value=&quot;{&amp;quot;1&amp;quot;:2,&amp;quot;2&amp;quot;:&amp;quot;Our signature piped rainbow cake is finished with handpiped rainbow rosettes on the top rim, finished with rainbow sprinkles. A popular for rainbow-themed birthdays.&amp;quot;}&quot; style=&quot;font-size:10pt;font-family:Arial;font-style:normal;&quot;&gt;Our signature piped rainbow cake is finished with handpiped rainbow rosettes on the top rim, finished with rainbow sprinkles. A popular for rainbow-themed birthdays.&lt;/span&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Pastel Rainbow with Rainbow Rosettes and Sprinkles', 'Our signature piped rainbow cake is finished with handpiped rainbow rosettes on the top rim, finished with rainbow sprinkles.', 'pastel, rainbow, rosettes, sprinkles, birthday'),
(305, 1, 'Rustic Gold, Strawberries and Herbs Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis beautiful rustic cake features a uniquely textured surface handpainted with gold swashes, decorated with sprigs of thyme and rosemary herbs, strawberry slices and sprigs of fresh florals. Finished with gold chocolate flakes. A lovely centrepiece for rustic celebrations.&lt;/p&gt;', '', 'Rustic Gold, Strawberries and Herbs Cake', 'This beautiful rustic cake features a uniquely textured surface handpainted with gold swashes, decorated with sprigs of thyme and rosemary herbs, strawberry slices and sprigs of fresh florals. Finished with gold chocolate flakes. A lovely centrepiece for', 'rustic, gold, strawberries, herbs, fruits, thyme, rosemary, swashes, baby\'s breath'),
(306, 1, 'Rustic Longevity Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;Celebrate auspicious occasions in style - this longevity cake features fresh mixed berries and fresh flowers. The cake is decorated with a handcut fondant longevity wording, along with two hand-sculpted fondant \'shou taos\', or longevity buns. According&nbsp;to Chinese folk legend, longevity buns symbolise immortality and are popular auspicious motifs to present to elderly people as a celebration of their age.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nCelebrate auspicious occasions in style - this longevity cake features fresh mixed berries and fresh flowers. The cake is decorated with a handcut fondant longevity wording, along with two hand-sculpted fondant \'shou taos\', or longevity buns. According&nbsp;to Chinese folk legend, longevity buns symbolise immortality and are popular auspicious motifs to present to elderly people as a celebration of their age.&lt;/p&gt;', '', 'Rustic Longevity Cake', 'Celebrate auspicious occasions in style - this longevity cake features fresh mixed berries and fresh flowers. The cake is decorated with a handcut fondant longevity wording, along with two hand-sculpted fondant \'shou taos\', or longevity buns. According to', 'Sweet williams, rustic. flowers, shou tao, longevity buns, strawberries, gold, swashes, longevity, red, luck, prosperity'),
(307, 1, 'Rustic Pineapple Topped Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;Our rustic pineapple cake is adorned with white and nude-coloured hand-moulded fondant seashells and \'sand\' crumble, and topped with an eye-catching pineapple head that\'s sure to be the centre of everyone\'s attention! Great for tropical and beach themes.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur rustic pineapple cake is adorned with white and nude-coloured hand-moulded fondant seashells and \'sand\' crumble, and topped with an eye-catching pineapple head that\'s sure to be the centre of everyone\'s attention! Great for tropical and beach themes.&lt;/p&gt;', '', 'Rustic Pineapple Topped Cake', 'Our rustic pineapple cake is adorned with white and nude-coloured hand-moulded fondant seashells and \'sand\' crumble, and topped with an eye-catching pineapple head that\'s sure to be the centre of everyone\'s attention! Great for tropical and beach themes.', 'rustic, pineapple head, pineapple, seashells, sand, crumbs, beach, tropical, sun, holiday'),
(310, 1, 'Duplicate for Solid Colour One Tier Designs', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Solid Colour with Gold Line Accents and Chocolate Sails', '', ''),
(311, 1, 'Solid Colour with White Chocolate Drizzle and Meringue Decor', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\nPresent an understated look with this cake that\'s glazed with a white chocolate drizzle, and decorated with rainbow-sprinkled meringues and colorful marshmallows. Choose your desired cake colour for a personalised look. To personalise this cake even more, do check out our range of fondant and paper decorations.&lt;/p&gt;', '', 'Solid Colour with White Chocolate Drizzle and Meringue Decor', 'Present an understated look with this cake that\'s glazed with a white chocolate drizzle, and decorated with rainbow-sprinkled meringues and colorful marshmallows. Choose your desired cake colour for a personalised look.', 'Sprinkles, Rainbow Sprinkles, Meringue, Marshmallows, Kid-Friendly, Children, Child, Kids, Birthday Party, Girly'),
(312, 1, 'Two Tier Black &amp; Gold Chocolate Candy Cake', '&lt;p&gt;This cake features a marbled exterior of black and gold, adorned with cascading gold leaves of 24 Karat gold placed individually by our cake artists. Topped with a feast of vanilla macarons and chocolate candies that\'s sure to please candy lovers.&lt;/p&gt;', '', 'Two Tier Black &amp; Gold Chocolate Candy Cake', 'This cake features a marbled exterior of black and gold, adorned with cascading gold leaves of 24 Karat gold placed individually by our cake artists. Topped with a feast of vanilla macarons and chocolate candies that\'s sure to please candy lovers.', 'Black &amp; Gold, Chocolate, Candy, Gold, Kids, two-tier'),
(313, 1, 'Two Tier Black &amp; Navy Blue Marble with Silver Chocolate Sails', '&lt;p&gt;This two-tier cake features a marble of navy blue and black, topped with a white chocolate drizzle. We decorate this cake with silver-painted tempered dark chocolate sails and chocolate gems for a glam finish. Choose to add on fondant letters of your desired colour for a personalised look.&lt;/p&gt;', '', 'Two Tier Black &amp; Navy Blue Marble with Silver Chocolate Sails', 'This two-tier cake features a marble of navy blue and black, topped with a white chocolate drizzle. We decorate this cake with silver-painted tempered dark chocolate sails and chocolate gems for a glam finish.', 'Silver, Chocolate, Marble, Navy Blue, gems, chocolate drizzle,'),
(314, 1, 'Two Tier Bohemian Rustic Cake', '&lt;p&gt;This two-tiered bohemian-inspired design has gold-brushed accents on the circumference, crowned with a brown plaited wreath. Adorned with 24 Karat gold leaves placed individually by our cake artists. Decorated with hand-painted gold-tipped fondant feathers. Perfect for rustic, bohemian-themed occasions.&lt;/p&gt;', '', 'Two Tier Bohemian Rustic Cake', 'This two-tiered bohemian-inspired design has gold-brushed accents on the circumference, crowned with a brown plaited wreath. Adorned with 24 Karat gold leaves placed individually by our cake artists. Decorated with hand-painted gold-tipped fondant feather', 'Rustic, Bohemian, Gold Leaves, Classic, gold painted, wreath, feathers, fondant, gold'),
(315, 1, 'Two Tier Candyland Cake', '&lt;p&gt;This design is a two-tier version of our ever-popular Candyland cake, featuring rainbow sprinkles on the circumference, rainbow-sprinkled meringues, confetti sprinkles and mini marshmallows. Finishing it off with handmade fondant sugar lollipops, swirled in pink and white.&lt;/p&gt;', '', 'Two Tier Candyland Cake', 'This design is a two-tier version of our ever-popular Candyland cake, featuring rainbow sprinkles on the circumference, rainbow-sprinkled meringues, confetti sprinkles and mini marshmallows. Finishing it off with handmade fondant sugar lollipops, swirled', 'Candy, Kid, Lollipop, pink, white, marshmallows, confetti, rainbow, chocolate drizzle'),
(316, 1, 'Two Tier Chocolate Overload Cake', '&lt;p&gt;Calling out to all chocolate lovers! Our Chocolate Overload Cake is topped with dark chocolate drizzle, a gold-dusted tempered dark chocolate sail. Decorated with cookie sticks, Toblerones, Kinder Buenos, and enough chocolates for all chocolate lovers to indugle in chocolate heaven!&lt;/p&gt;', '', 'Two Tier Chocolate Overload Cake', 'Calling out to all chocolate lovers! Our Chocolate Overload Cake is topped with dark chocolate drizzle, a gold-dusted tempered dark chocolate sail. Decorated with cookie sticks, Toblerones, Kinder Buenos, and enough chocolates for all chocolate lovers to', 'Chocolate, Cookies, Kids,  cookie sticks, pocky, Toblerones, Kinder Buenos, macarons, hersheys kisses, rainbow sprinkles, chocolate drizzle'),
(317, 1, 'Two Tier Floral Longevity Cake', '&lt;p&gt;According to Chinese folk legend, longevity buns are a symbol of immortality and are popular auspicious symbols to present to elderly people as a celebration of their age. Our signature longevity cake in two-tier features pink and red cherry blossoms, with each blossom piped individually by hand. The cake is decorated with a handcut fondant longevity wording, along with hand-sculpted fondant \'shou taos\', or longevity buns.&lt;/p&gt;', '', 'Two Tier Floral Longevity Cake', 'According to Chinese folk legend, longevity buns are a symbol of immortality and are popular auspicious symbols to present to elderly people as a celebration of their age. Our signature longevity cake in two-tier features pink and red cherry blossoms, wit', 'Two tier, longevity, longevity bun, shou tao, pink and red cherry blossoms, piped flowers'),
(318, 1, 'Two Tier Gold Ombre with Lavender', '&lt;p&gt;Our classic gold ombre design is garnished with sprigs of lavender and 24 Karat edible gold leaves, place individually by our cake artists. Perfect for floral themes including birthdays and weddings.&lt;/p&gt;', '', 'Two Tier Gold Ombre with Lavender', 'Our classic gold ombre design is garnished with sprigs of lavender and 24 Karat edible gold leaves, place individually by our cake artists. Perfect for floral themes including birthdays and weddings.', 'Two Tier, Gold, Ombre, Lavender, Tea, gold leaves, dried florals'),
(319, 1, 'Two Tier Gold Splatter Cake', '&lt;p&gt;This understated design features an abstract gold splatter for a subtle touch of glam. Choose your desired cake colour and splatter for a customised look. To personalise this cake further, check out our range of fondant and paper toppers in the \'Decorations\' category.&lt;/p&gt;', '', 'Two Tier Gold Splatter Cake', 'This understated design features an abstract gold splatter for a subtle touch of glam.', 'Two Tier, Gold, Blue, Red, splatter,'),
(320, 1, 'Two Tier Jungle Animal Themed Cake', '&lt;p&gt;This two-tier version of our popular jungle-inspired cake is adorned with intricate fondant faces of the hippo, zebra, lion and monkey, handmade by our fondant artists. Finished with handpiped grass piping. To spruce this cake up even more, choose from our range of fondant and paper toppers in the \'Decorations\' category to make this cake truly your own.&lt;/p&gt;', '', 'Two Tier Jungle Animal Themed Cake', 'This two-tier version of our popular jungle-inspired cake is adorned with intricate fondant faces of the hippo, zebra, lion and monkey, handmade by our fondant artists. Finished with handpiped grass piping.', 'Jungle, Animal, Tiger, Monkey, Kid, hippo, zebra, lion, grass'),
(321, 1, 'Two Tier Marbled Cake with Candy Shards and Macaron Decor', '&lt;p&gt;This marbled cake is topped with white chocolate drizzle. Decorated with silver leaves placed individually by our cake artists, along with a feast of candy shards and macarons to match. Choose your desired colour scheme for a more personalised look - the blue scheme is a particularly popular choice for ice princess themes.&lt;/p&gt;', '', 'Two Tier Marbled Cake with Candy Shards and Macaron Decor', 'This marbled cake is topped with white chocolate drizzle. Decorated with silver leaves placed individually by our cake artists, along with a feast of candy shards and macarons to match. The blue scheme is a particularly popular choice for ice princess the', 'Marble, Candy, Macarons, frozen, ice princess, chocolate drizzle, silver leaves, candy shards'),
(322, 1, 'Two Tier Marbled Cake with Pink &amp; Blue Candy Shards and Macaron Decor', '&lt;p&gt;This pink and blue marbled cake is topped with a pastel pink chocolate glaze. Decorated with handplaced silver leaves, along with a medley of blue and pink candy shards and macarons.&lt;/p&gt;', '', 'Two Tier Marbled Cake with Pink &amp; Blue Candy Shards and Macaron Decor', 'This pink and blue marbled cake is topped with a pastel pink chocolate glaze. Decorated with handplaced silver leaves, along with a medley of blue and pink candy shards and macarons.', 'Marbled, Candy shards, Macarons, pink, blue, chocolate drizzle, silver leaves'),
(323, 1, 'Two Tier Marbled Drizzle Cake with Baby&#039;s Breath', '&lt;p&gt;This design features a marbled exterior, topped with white chocolate drizzle and baby\'s breath for a subtle floral touch. Choose your desired marble colour for a personalised look.&lt;/p&gt;', '', 'Two Tier Marbled Drizzle Cake with Baby\'s Breath', 'This design features a marbled exterior, topped with white chocolate drizzle and baby\'s breath for a subtle floral touch.', 'Marble, chocolate Drizzle, Baby\'s Breath');
INSERT INTO `j5ui84yug_yng8e54e_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(324, 1, 'Two Tier Mixed Berries and Thyme Cake', '&lt;p&gt;A popular choice for any rustic-themed celebration! This cake features a rustic exterior, garnished with sprigs of thyme herbs topped with fresh mixed berries for a natural pop of colour.&lt;/p&gt;', '', 'Two Tier Mixed Berries and Thyme Cake', 'A popular choice for any rustic-themed celebration! This cake features a rustic exterior, garnished with sprigs of thyme herbs topped with fresh mixed berries for a natural pop of colour.', 'Mixed Berries, Thyme, Fruit, Two Tier, rustic, strawberries, blueberries, raspberries'),
(326, 1, 'Two Tier Navy Nautical Cake', '&lt;p&gt;This understated nautical-themed cake features a navy blue exterior, embellished with white fondant anchor motifs on the circumference, white plaited wreath and sprinkles for a sophisticated look. A perfect centrepiece for any nautical-themed celebration!&lt;/p&gt;', '', 'Two Tier Navy Nautical Cake', 'This understated nautical-themed cake features a navy blue exterior, embellished with white fondant anchor motifs on the circumference, white plaited wreath and sprinkles for a sophisticated look. A perfect centrepiece for any nautical-themed celebration!', 'Nautical, Boat, Sea, Two Tier, anchor, white, navy blue, under the sea, sailor'),
(327, 1, 'Two Tier Ombre striped with Gold Leaves and Mixed Berries', '&lt;p&gt;We dress up our signature striped ombre design with 24 Karat gold or silver leaves around the circumference, topped with fresh mixed berries for a pop of colour. Choose your favourite ombre colour to make it even more special!&lt;/p&gt;', '', 'Two Tier Ombre striped with Gold Leaves and Mixed Berries', 'We dress up our signature striped ombre design with 24 Karat gold or silver leaves around the circumference, topped with fresh mixed berries for a pop of colour. Choose your favourite ombre colour to make it even more special!', 'Mixed Berries, Fruit, Two Tier, Gold Leaves, Ombre, Strawberries, blueberries, raspberries.  silver leaves'),
(328, 1, 'Two Tier Ombre with Baby&#039;s Breath', '&lt;p&gt;This classic look features our signature ombre cake topped with baby\'s breath for a subtle floral touch. Choose your favourite ombre colour for a personalised look.&lt;/p&gt;', '', 'Two Tier Ombre with Baby\'s Breath', 'This classic look features our signature ombre cake topped with baby\'s breath for a subtle floral touch. Choose your favourite ombre colour for a personalised look.', 'Ombre, Baby\'s Breath, Two Tier'),
(329, 1, 'Two Tier Ombre with Rainbow and Unicorn', '&lt;p&gt;A classic ombre cake decorated with rainbow sprinkles, topped with our signature handmade vibrant&nbsp;rainbow and clouds fondant topper set and a handsculpted unicorn fondant topper. Choose your desired fondant letters for a personalised look.&lt;/p&gt;', '', 'Two Tier Ombre with Rainbow and Unicorn', 'A classic ombre cake decorated with rainbow sprinkles, topped with our signature handmade vibrant rainbow and clouds fondant topper set and a handsculpted unicorn fondant topper. Choose your desired fondant letters for a personalised look.', 'Ombre, Two Tier, Rainbow, Unicorn, Colorful'),
(330, 1, 'Two Tier Ombre with Rainbow Balloons', '&lt;p&gt;This popular two-tier cake features our signature ombre decorated with rainbow sprinkles, topped with an eye-catching bouquet of rainbow fondant balloons that\'s sure to be the centre of everyone\'s attention. Choose your desired rainbow shade and colour for the fondant letters and number for a personalised look. A popular design for kids\' birthdays and rainbow-themed celebrations.&lt;/p&gt;', '', 'Two Tier Ombre with Rainbow Balloons', 'This popular two-tier cake features our signature ombre decorated with rainbow sprinkles, topped with an eye-catching bouquet of rainbow fondant balloons that\'s sure to be the centre of everyone\'s attention. A popular design for kids\' birthdays and rainbo', 'kid-friendly, child, children, party, celebration, red, blue, green, yellow, pink, purple, pastel, vibrant, tiered cake, layer cake, Colourful'),
(332, 1, 'Ombre Striped with Rainbow Bunting', '&lt;p&gt;&lt;br /&gt;\nThis ombre exterior is decorated a rainbow bunting on the circumference and rainbow sprinkles on the top rim for the perfect party look. Choose your desired ombre colour and bunting shades for a personalised look.&lt;/p&gt;', '', 'Ombre Striped with Rainbow Bunting', 'This ombre exterior is decorated a rainbow bunting on the circumference and rainbow sprinkles on the top rim for the perfect party look.', 'Ombre, bunting, Kid Friendly, Birthday, party, rainbow, colourful, yellow, orange, purple, green, blue, children friendly'),
(333, 1, 'Ombre with Baby&#039;s Breath and Mixed Berries', '&lt;p&gt;This ombre exterior is decorated with baby\'s breath on the rims of the cake, topped with fresh strawberries, blueberries and raspberries. Choose your desired ombre colour for a personalised look.&lt;/p&gt;', '', 'Ombre with Baby\'s Breath and Mixed Berries', 'This ombre exterior is decorated with baby\'s breath on the rims of the cake, topped with fresh strawberries, blueberries and raspberries.', 'berries, fruits, antioxidants, floral, white baby\'s breath, girly, 21st birthday, girls, ladies'),
(334, 1, 'Gender Reveal Marbled Cake', '&lt;p&gt;Looking for a way to announce the gender of your baby? Our gender reveal design allows you the option of choosing either a pink reveal for a girl, or a blue reveal for a boy. The exterior features a pink and blue marbled cake topped with handpiped rosettes, and adorned with baby-themed motifs in pink and blue.&lt;/p&gt;', '', 'Gender Reveal Marbled Cake', 'Looking to announce the gender of your baby? Our gender reveal design allows you the option of choosing either a pink reveal for a girl, or a blue reveal for a boy. The exterior features a pink and blue marbled cake topped with handpiped rosettes, adorned', 'Surprise, boy or girl, candy themed, children party, pastel theme'),
(335, 1, 'Pastel Blue Ombre with Hot Air Balloons and Rainbow', '&lt;p&gt;This pastel blue ombre base is adorned with pastel purple hot air balloons, topped with our signature handmade pastel fondant rainbow and clouds topper set and a medley of pastel blue and white sprinkles for a lovely finish.&lt;/p&gt;', '', 'Pastel Blue Ombre with Hot Air Balloons and Rainbow', 'This pastel blue ombre base is adorned with pastel purple hot air balloons, topped with our signature handmade pastel fondant rainbow and clouds topper set and a medley of pastel blue and white sprinkles for a lovely finish.', 'Ombre, aviation, around the world, Kid Friendly, Birthday, party, rainbow, colourful, pastel yellow, pastel orange, pastel purple, pastel blue, children friendly, pastel pink, pastel green, pastel theme, red, white'),
(336, 1, 'Pink &amp; Blue Marbled Cake with Candy Shards and Macarons', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis marbled cake features pink and blue hues, topped with a pastel pink drizzle. Decorated with silver leaves, pink and blue candy shards and pink and white macarons. A popular choice for pastel-themed birthday celebrations.&lt;/p&gt;', '', 'Pink &amp; Blue Marbled Cake with Candy Shards and Macarons', 'This marbled cake features pink and blue hues, topped with a pastel pink drizzle. Decorated with silver leaves, pink and blue candy shards and pink and white macarons. A popular choice for pastel-themed birthday celebrations.', 'hot pink, sprinkles, sky blue, vibrant sprinkles, silver flakes, kid-friendly, children'),
(340, 1, 'Piped Under the Sea Cake', '&lt;p&gt;This blue watercolour ombre base is adorned with handpiped green \'seaweed\', colourful fondant seashells and silver pearls. Choose your desired fondant letters and number for a personalised look.&lt;/p&gt;', '', 'Piped Under the Sea Cake', 'This blue watercolour ombre base is adorned with handpiped green \'seaweed\', colourful fondant seashells and silver pearls.', 'sea, blue, under the sea, birthday, seaweed, seashells'),
(341, 1, 'Rainbow Alphabets and Numbers Cake', '&lt;p&gt;This vibrant, cheerful cake features rainbow-coloured fondant alphabets and numbers on the circumference, topped with a rim of rainbow sprinkles, and a show-stopping bouquet of rainbow balloons that\'s sure to delight everyone. Choose your desired fondant letters for a personalised look.&lt;/p&gt;', '', 'Rainbow Alphabets and Numbers Cake', 'This vibrant, cheerful cake features rainbow-coloured fondant alphabets and numbers on the circumference, topped with a rim of rainbow sprinkles, and a show-stopping bouquet of rainbow balloons that\'s sure to delight everyone.', 'rainbow, balloons, alphabets, numbers, birthday'),
(342, 1, 'Pink and Blue Marbled Gem Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis marbled cake features pink and blue hues, topped with a crescent drizzle of white chocolate. Finished with pink and white piping, and gold-dusted blue gem drops.&lt;/p&gt;', '', 'Pink and Blue Marbled Gem Cake', 'This marbled cake features pink and blue hues, topped with a crescent drizzle of white chocolate. Finished with pink and white piping, and gold-dusted blue gem drops', 'pastel pink, pastel blue, drips, rosettes, geometric chocolate'),
(343, 1, 'One Tier Semi Custom Duplicate (Marbled)', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'One Tier Semi Custom Duplicate (Marbled)', '', ''),
(344, 1, 'Piped Rainbow and Clouds Cake with Fondant Stars', '&lt;p&gt;Our handpiped rainbows are made with pastel rainbow shades swirled together for a natural technicolour effect. Decorated with rainbow sprinkles and handpainted fondant stars and clouds, this cheerful cake is perfect for any pastel rainbow-themed celebrations!&lt;/p&gt;', '', 'Piped Rainbow and Clouds Cake with Fondant Stars', 'Our handpiped rainbows are made with pastel rainbow shades swirled together for a natural technicolour effect. Decorated with rainbow sprinkles and handpainted fondant stars and clouds, this cheerful cake is perfect for any pastel rainbow-themed celebrati', 'pastel, rainbow, stars, clouds, birthday'),
(345, 1, 'Pink and Gold Marble Drizzle Cake with Candy Shards, Mixed Berries and Macarons', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis pink marbled cake is handpainted with gold swashes and drizzled with a pastel pink glaze. Embellished with silver leaves and decorated with pink and white candy shards, fresh berries and macarons.&lt;/p&gt;', '', 'Pink and Gold Marble Drizzle Cake with Candy Shards, Mixed Berries and Macarons', 'This pink marbled cake is handpainted with gold swashes and drizzled with a pastel pink glaze. Embellished with silver leaves and decorated with pink and white candy shards, fresh berries and macarons.', 'silver flakes, raspberries, blueberries, pink macarons, white macarons, girl-friendly, classy, pastel theme'),
(346, 1, 'Rainbow Bunting Cake with Rainbow Balloons', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis popular design features a rainbow bunting on the circumference, rainbow sprinkles on the top rim, and a show-stopping bouquet of rainbow balloons that\'s sure to delight everyone. Choose your desired rainbow shades and fondant letters for a personalised look.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Rainbow Bunting Cake with Rainbow Balloons', 'This popular design features a rainbow bunting on the circumference, rainbow sprinkles on the top rim, and a show-stopping bouquet of rainbow balloons that\'s sure to delight everyone.', 'rainbow, bunting, balloon, birthday'),
(347, 1, 'Ombre Striped with White Chocolate Drizzle and Baby\'s Breath', '&lt;p&gt;This ombre striped cake features a white chocolate drizzle, a medley of silver and white sprinkles on the top rim, and a wreath of baby\'s breath for a floral finish. Choose from 24 Karat gold or silver leaf embellishments, and also your preferred ombre colour for a personalised look.&lt;/p&gt;', '', 'Gold Ombre Striped with White Chocolate Drizzle and Baby\'s Breath', 'This ombre striped cake features a white chocolate drizzle, a medley of silver and white sprinkles on the top rim, and a wreath of baby\'s breath for a floral finish. Choose from 24 Karat gold or silver leaf embellishments, and also your preferred ombre co', 'gold, rose gold, silver, dusty blue, white baby\'s breath, sliver flakes, gold flakes, elegant, classy'),
(348, 1, 'Rainbow Overload', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis colourful rainbow cake is decorated with white chocolate drizzle, rainbow sprinkles, along with a show-stopping handmade fondant rainbow and clouds topper set that\'s sure to be the highlight of the party! Choose your desired rainbow shade, fondant letters and style for a more personalised look.&lt;/p&gt;', '', 'Rainbow Overload', 'This colourful rainbow cake is decorated with white chocolate drizzle, rainbow sprinkles, along with a show-stopping handmade fondant rainbow and clouds topper set that\'s sure to be the highlight of the party!', 'rainbow, drizzle'),
(349, 1, 'Rainbow Polka Dot Cake with Fondant Balloons', '&lt;p&gt;One of our signature designs - this polka-dotted cake is topped with rainbow sprinkles and decorated with colourful fondant balloons that are individually hand-sculpted. Choose your desired rainbow shades and fondant letters for the perfect personalised look.&lt;/p&gt;', '', 'Rainbow Polka Dot Cake with Fondant Balloons', 'One of our signature designs - this polka-dotted cake is topped with rainbow sprinkles and decorated with colourful fondant balloons that are individually hand-sculpted.', 'rainbow, polka dot, balloons, birthday'),
(350, 1, 'Piped Ruffles Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur piped ruffles cake features an ombre of buttercream ruffles, reminiscent of a sweet ballerina\'s tutu.&lt;/p&gt;', '', 'Piped Ruffles Cake', 'Our piped ruffles cake features an ombre of buttercream ruffles, reminiscent of a sweet ballerina\'s tutu.', 'ruffles, ombre, ballet'),
(365, 1, 'Rose Gold Ombre Striped with Gold leaves and Assorted Berries', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis popular rose gold ombre cake is adorned with 24 Karat gold leaves placed individually by our cake artists. Topped with a mound of fresh berries for a pop of colour.&lt;/p&gt;', '', 'Rose Gold Ombre Striped with Gold leaves and Assorted Berries', 'This popular rose gold ombre cake is adorned with 24 Karat gold leaves placed individually by our cake artists. Topped with a mound of fresh berries for a pop of colour.', 'rose gold, ombre, berries, fresh fruits, gold accent'),
(366, 1, 'Ombre with Cascading Gold Leaves &amp; Rainbow Topper', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis ombre exterior features cascading gold leaves on the circumference, rainbow sprinkles on the top rim, topped with our signature rainbow fondant topper for the perfect party look. Choose your desired ombre colour and rainbow shades for a more personalised look.&lt;/p&gt;', '', 'Ombre with Cascading Gold Leaves &amp; Rainbow Topper', 'This ombre exterior features cascading gold leaves on the circumference, rainbow sprinkles on the top rim, topped with our signature rainbow fondant topper for the perfect party look.', 'gold flakes, pastel pink, pink, pastel purple, purple, red, orange, yellow, pastel yellow, pastel orange, blue, pastel blue, green, pastel green, 6-colours, kid-friendly, children, child'),
(367, 1, 'Ombre with Mixed Berries and Fresh Florals', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOur signature ombre cake is adorned with fresh mixed berries and sprigs of fresh florals for a beautiful finish. Choose your desired ombre colour for a personalised look.&lt;/p&gt;', '', 'Ombre with Mixed Berries and Fresh Florals', 'Our signature ombre cake is adorned with fresh mixed berries and sprigs of fresh florals for a beautiful finish.', 'blueberries, raspberries, strawberries, sweet williams, baby\'s breath, white, pink, hot pink, purple, simple, plain'),
(368, 1, 'Ombre with Starfish and Seashells', '&lt;p&gt;Our signature ombre cake is topped with \'sand\' crumble and an assortment of hand-moulded, nude-coloured starfish and seashells. A great choice for understated beach themes and wedding celebrations. Choose your desired ombre colour for a personalised look.&lt;/p&gt;', '', 'Ombre with Starfish and Seashells', 'Our signature ombre cake is topped with \'sand\' crumble and an assortment of hand-moulded, nude-coloured starfish and seashells. A great choice for understated beach themes and wedding celebrations.', 'beach, under the sea, coral, reefs, girl, kid friendly, children, child'),
(369, 1, 'Striped Ombre with Confetti and Rainbow Topper', '&lt;p&gt;Our signature ombre cake is decorated with colourful confetti sprinkles, topped with a stunning handmade fondant rainbow and clouds topper set. A popular design for kids\' birthdays and rainbow-themed celebrations.&lt;/p&gt;', '', 'Striped Ombre with Confetti and Rainbow Topper', 'Our signature ombre cake is decorated with colourful confetti sprinkles, topped with a stunning handmade fondant rainbow and clouds topper set. A popular design for kids\' birthdays and rainbow-themed celebrations.', 'striped, ombre, confetti, rainbow'),
(370, 1, 'Striped Ombre Cake with Sprinkles', '&lt;p&gt;One of our signature designs - choose your preferred ombre colour to match your theme. To personalise this cake even more, do check out our range of fondant and paper decorations.&lt;/p&gt;', '', 'Striped Ombre Cake with Sprinkles', 'One of our signature designs - choose your preferred ombre colour to match your theme.', 'striped, ombre, sprinkles, birthday'),
(371, 1, 'Striped Ombre with Baby&#039;s Breath', '&lt;p&gt;Combining a classic ombre look with fresh florals for an ethereal look. Choose your desired ombre colour for a personalised cake.&lt;/p&gt;', '', 'Striped Ombre with Baby\'s Breath', 'Combining a classic ombre look with fresh florals for an ethereal look.', 'striped, ombre, baby\'s breath, floral'),
(372, 1, 'Rose Gold Ombre Cake with Mixed Berries and Baby&#039;s Breath', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;This rose gold ombre cake is embellished with rose gold-dusted mixed berries and sprigs of fresh florals.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;style type=&quot;text/css&quot;&gt;\n&lt;/style&gt;\nThis rose gold ombre cake is embellished with rose gold-dusted mixed berries and sprigs of fresh florals.&lt;/p&gt;', '', 'Rose Gold Ombre Cake with Mixed Berries and Baby\'s Breath', 'This rose gold ombre cake is embellished with rose gold-dusted mixed berries and sprigs of fresh florals.', 'rose gold, ombre, floral, fresh fruits, berries'),
(373, 1, 'Red and Gold Floral Longevity Cake', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n&lt;/style&gt;\r\nTraditionally, longevity buns are a Chinese symbol of immortality and are popular auspicious motifs to present to elderly people as a celebration of their age. This version of our longevity cake features a red cake base with pink and red cherry blossoms, each blossom piped individually by hand. The cake is decorated with a handcut fondant longevity wording painted gold for a touch of glam, along with a hand-sculpted fondant \'shou tao\', or longevity bun.&lt;br /&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\n&lt;/p&gt;', '', 'Red and Gold Floral Longevity Cake', 'This version of our longevity cake features a red cake base with pink and red cherry blossoms, each blossom piped individually by hand. The cake is decorated with a handcut fondant longevity wording painted gold for a touch of glam, along with a hand-scul', 'longevity, floral, red, gold, longevity bun'),
(374, 1, 'Rainbow Scallop with Rainbow Fondant Topper', '&lt;p&gt;This rainbow scallop cake is a labour of love - each piped scallop texture is created one at a time, with colours piped on individually by hand. We top the cake with our signature handmade fondant rainbow and clouds topper set to create a show-stopping cake. Choose your desired rainbow shades for a personalised look.&lt;/p&gt;', '', 'Rainbow Scallop with Rainbow Fondant Topper', 'This rainbow scallop cake is a labour of love - each piped scallop texture is created one at a time, with colours piped on individually by hand. We top the cake with our signature handmade fondant rainbow and clouds topper set to create a show-stopping ca', 'rainbow, rainbow scallop'),
(375, 1, 'Building Blocks Cake', '&lt;p&gt;This vibrant yellow cake is adorned with building blocks fondant pieces on the circumference, decorated with stacks of blocks on the top surface. Choose your desired fondant letters for a more personalised look.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Building Blocks Cake', 'This vibrant yellow cake is adorned with building blocks fondant pieces on the circumference, decorated with stacks of blocks on the top surface. Choose your desired fondant letters for a more personalised look.', 'building blocks, lego, stacks, fondant'),
(376, 1, 'Floral Engagement Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis rustic cake is adorned with hand-moulded fondant roses and leaves, finished with a romantic silhouette figurine. A great choice for celebrating wedding occasions and anniversaries.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Floral Engagement Cake', 'This rustic cake is adorned with hand-moulded fondant roses and leaves, finished with a romantic silhouette figurine. A great choice for celebrating wedding occasions and anniversaries.', 'Floral, engagement, wedding cake, birthday cake, flowers, fondant'),
(377, 1, 'Gold Marbled Cake with Gold Sails', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\nThis marbled cake features handpainted gold swashes, with a white chocolate drizzle topped with sprinkles. Finished with tempered white chocolate sails painted gold for a glam finish. Choose your desired marble colour for a personalised look.\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\n&lt;/p&gt;', '', 'Gold Marbled Cake with Gold Sails', 'This marbled cake features handpainted gold swashes, with a white chocolate drizzle topped with sprinkles. Finished with tempered white chocolate sails painted gold for a glam finish. Choose your desired marble colour for a personalised look.', 'Marbled, Gold, Chocolate Sails, Chocolate, Candy shards, drizzle, wedding cake, birthday cake'),
(378, 1, 'Mahjong Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis mahjong-inspired cake features an orange marble base, topped with handcarved fondant mahjong tiles and handsculpted fondant longevity buns. Finished with a glittery paper cutout of the Chinese character symbol of longevity. Traditionally, longevity buns are a Chinese symbol of immortality and are popular auspicious motifs to present to elderly people as a celebration of their age.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Mahjong Cake', 'This mahjong-inspired cake features an orange marble base, topped with handcarved fondant mahjong tiles and handsculpted fondant longevity buns. Finished with a glittery paper cutout of the Chinese character symbol of longevity. Traditionally, longevity b', 'mahjong, birthday cake, longevity, longevity bun, shou tao, chinese'),
(379, 1, 'Rose Gold Ombre with Thyme Wreath', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis popular rose gold ombre cake is adorned with 24 Karat gold leaves placed individually by our cake artists. Embellished with sprigs of thyme and fresh florals for a beautiful floral finish.&lt;/p&gt;', '', 'Rose Gold Ombre with Thyme Wreath', 'This popular rose gold ombre cake is adorned with 24 Karat gold leaves placed individually by our cake artists. Embellished with sprigs of thyme and fresh florals for a beautiful floral finish.', 'Rose gold, gold leaves, gold, gold flakes, thyme, sweet williams, fresh florals, flowers. ombre'),
(380, 1, 'Rustic Rainbow Confetti Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis pastel rainbow base features a unique textured exterior, decorated with colorful confetti sprinkles on the circumference. Choose from our range of fondant and paper decorations to make this cake truly your own!&lt;/p&gt;', '', 'Rustic Rainbow Confetti Cake', 'This pastel rainbow base features a unique textured exterior, decorated with colorful confetti sprinkles on the circumference.', 'rustic rainbow, rustic, rainbow, confetti'),
(381, 1, 'Rustic Rose Gold &amp; Thyme', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;This rustic cake is dressed with handpainted rose gold swashes, garnished with thyme herb sprigs and dried rose buds. Perfect for rustic floral themes with a shimmery touch.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis rustic cake is dressed with handpainted rose gold swashes, garnished with thyme herb sprigs and dried rose buds. Perfect for rustic floral themes with a shimmery touch.&lt;/p&gt;', '', 'Rustic Rose Gold &amp; Thyme', 'This rustic cake is dressed with handpainted rose gold swashes, garnished with thyme herb sprigs and dried rose buds. Perfect for rustic floral themes with a shimmery touch.', 'rustic, rose gold, thyme, herb'),
(382, 1, 'Rustic Thyme &amp; Floral Petals Wreath', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;This beautiful cake is adorned with sprigs of thyme herbs and edible dried flowers and petals, a perfect centrepiece for rustic themes.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis beautiful cake is adorned with sprigs of thyme herbs and edible dried flowers and petals, a perfect centrepiece for rustic themes.&lt;/p&gt;', '', 'Rustic Thyme &amp; Floral Petals Wreath', 'This beautiful cake is adorned with sprigs of thyme herbs and edible dried flowers and petals, a perfect centrepiece for rustic themes.', 'rustic, thyme, herb, floral'),
(383, 1, 'Rustic Thyme with Berries', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nThis rustic cake is garnished with sprigs of thyme, topped with a mound of fresh berries for a natural rustic finish. A popular choice for understated rustic themes.&lt;/p&gt;', '', 'Rustic Thyme with Berries', 'This rustic cake is garnished with sprigs of thyme, topped with a mound of fresh berries for a natural rustic finish. A popular choice for understated rustic themes.', 'rustic, thyme, fresh fruits, berries'),
(384, 1, 'Rustic Thyme Wreath Cake', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOne of our classic rustic designs - this rustic cake is garnished with sprigs of thyme herbs and fresh flowers. Finished with 24 Karat edible gold leaves which are individually placed onto the cake by our cake artists.&lt;/p&gt;', '', 'Rustic Thyme Wreath Cake', 'One of our classic rustic designs - this rustic cake is garnished with sprigs of thyme herbs and fresh flowers. Finished with 24 Karat edible gold leaves which are individually placed onto the cake by our cake artists.', 'rustic, thyme, herb'),
(385, 1, 'Rustic Twig and Edible Florals Cake', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;This beautiful cake is adorned with twig wreaths and edible dried flowers and petals, a perfect centrepiece for rustic themes.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\nThis beautiful cake is adorned with twig wreaths and edible dried flowers and petals, a perfect centrepiece for rustic themes.&lt;/p&gt;', '', 'Rustic Twig and Edible Florals Cake', 'This beautiful cake is adorned with twig wreaths and edible dried flowers and petals, a perfect centrepiece for rustic themes.', 'rustic, floral, twig'),
(386, 1, 'Ombre Ice Cream Cone Drizzle Cake', '&lt;p&gt;Our signature ombre cake is glazed with chocolate drizzle and decorated with hand-placed confetti on the circumference. The top surface is adorned with macarons, oreos, ice cream cones, mini marshmallows and confetti sprinkles. Choose the desired macaron colours and fondant letters for a personalised look!&lt;/p&gt;', '', 'Ombre Ice Cream Cone Drizzle Cake', 'Our signature ombre cake is glazed with chocolate drizzle and decorated with hand-placed confetti on the circumference. The top surface is adorned with macarons, oreos, ice cream cones, mini marshmallows and confetti sprinkles. Choose the desired macaron', 'Hot Pink Drizzle, Blue Drizzle, Dark Chocolate Drizzle, White Chocolate Drizzle, Pink, Yellow, Blue, Ice Cream Cone, Ice Cream, Drizzle, Kid-Friendly, Birthday, Ombre, Children, Child'),
(387, 1, 'Rustic Gold with Mixed Berries &amp; Herbs', '&lt;p&gt;This beautiful rustic cake features a uniquely textured surface handpainted with gold swashes, decorated with sprigs of thyme, topped with a mound of fresh mixed berries and freeze-dried raspberry pieces. A lovely centrepiece for rustic celebrations.&lt;/p&gt;', '', 'Rustic Gold with Mixed Berries &amp; Herbs', 'This beautiful rustic cake features a uniquely textured surface handpainted with gold swashes, decorated with sprigs of thyme, topped with a mound of fresh mixed berries and freeze-dried raspberry pieces. A lovely centrepiece for rustic celebrations.', 'rustic, gold, strawberries, herbs, fruits, thyme, rosemary, swashes, baby\'s breath'),
(389, 1, 'Two Tier Ombre with Rainbow Decor', '&lt;p&gt;A classic ombre cake decorated with rainbow sprinkles, topped with our signature handmade vibrant rainbow and clouds fondant topper set. Choose your desired fondant number and letters for a personalised look.&lt;/p&gt;', '', 'Two Tier Ombre with Rainbow Decor', 'A classic ombre cake decorated with rainbow sprinkles, topped with our signature handmade rainbow and clouds fondant topper set.', 'tiered cake, layer, colourful, red, green, blue, yellow, purple, pink, kid-friendly, child, children'),
(390, 1, 'Two Tier Ombre with Stars Cake', '&lt;p&gt;This cheerful ombre cake is adorned with white and gold fondant stars, individually handcut and handpainted by our fondant artists. A popular for baby celebrations. Choose your desired fondant letters for a personalised look.&lt;/p&gt;', '', 'Two Tier Ombre with Stars Cake', 'This cheerful ombre cake is adorned with white and gold fondant stars, individually handcut and handpainted by our fondant artists. A popular for baby celebrations.', 'kid-friendly, child, children, party, celebration, gold, silver, sky, pastel, vibrant, tiered cake, layer cake, Colourful, stars'),
(391, 1, 'Two Tier Pastel Marble with Baby&#039;s Breath', '&lt;p&gt;This design features a pastel pink and pastel blue marbled exterior, decorated with baby\'s breath for a subtle floral touch.&lt;/p&gt;', '', 'Two Tier Pastel Marble with Baby\'s Breath', 'This design features a pastel pink and pastel blue marbled exterior, decorated with baby\'s breath for a subtle floral touch.', 'party, celebration, sky, pastel, vibrant, tiered cake, layer cake, Colourful'),
(392, 1, 'Two Tier Pastel Pink, Mint &amp; Gold with Rainbow Topper', '&lt;p&gt;This two-tier design features two complementary tones of ombre, pastel pink and mint green. 24 Karat gold leaves cascade down the front of the cake for a subtle touch of glam. Topped with our signature handmade pastel rainbow and clouds fondant topper set. Choose your desired fondant letters for a more personalised look.&lt;/p&gt;', '', 'Two Tier Pastel Pink, Mint &amp; Gold with Rainbow Topper', 'This two-tier design features two complementary tones of ombre, pastel pink and mint green. 24 Karat gold leaves cascade down the front of the cake for a subtle touch of glam. Topped with our signature handmade rainbow and clouds fondant topper set.', 'tiered cake, layer, colourful, red, green, blue, yellow, purple, pink, kid-friendly, child, children'),
(393, 1, 'Two Tier Pastel Rainbow Drizzle Cake', '&lt;p&gt;This two-tiered cake is finished with a pastel rainbow exterior, topped with a white chocolate drizzle. Finished with rainbow-sprinkled meringues, rainbow sprinkles and mini marshmallows for a happy, celebratory look. Perfect for all rainbow-themed celebrations.&lt;/p&gt;', '', 'Two Tier Pastel Rainbow Drizzle Cake', 'This two-tiered cake is finished with a pastel rainbow exterior, topped with a white chocolate drizzle. Finished with rainbow-sprinkled meringues, rainbow sprinkles and mini marshmallows for a happy, celebratory look. Perfect for all rainbow-themed celebr', 'Mashmallows, Two tier, Tiered cake, colorful, drizzle, rainbow, meringues. white chocolate drizzle'),
(394, 1, 'Two Tier Rainbow and Ombre with Cascading Gold Cake', '&lt;p&gt;We feature many of our signature designs on this two-tier beauty - a pastel pink ombre cake sits atop a pastel rainbow base, with an exterior decorated with cascading 24 Karat gold leaves placed individually by our cake artists. The cake is then topped with our signature handmade rainbow and clouds fondant topper set. Choose your desired fondant letters to make this cake truly your own!&lt;/p&gt;', '', 'Two Tier Rainbow and Ombre with Cascading Gold Cake', 'We feature many of our signature designs on this two-tier beauty - a pastel pink ombre cake sits atop a pastel rainbow base, with an exterior decorated with cascading 24 Karat gold leaves placed individually by our cake artists. The cake is then topped wi', 'tiered cake, layer, colourful, red, green, blue, yellow, purple, pink, kid-friendly, child, children, Gold'),
(395, 1, 'Two Tier Rainbow Polka Dot Cake', '&lt;p&gt;One of our signature designs, this two-tier polka-dotted cake is topped with rainbow sprinkles and decorated with colourful fondant balloons that are individually hand-sculpted. Choose your desired rainbow shades and fondant letters for a personalised look.&lt;/p&gt;', '', 'Two Tier Rainbow Polka Dot Cake', 'One of our signature designs, this two-tier polka-dotted cake is topped with rainbow sprinkles and decorated with colourful fondant balloons that are individually hand-sculpted.', 'kid-friendly, child, children, party, celebration, red, blue, green, yellow, pink, purple, pastel, vibrant, tiered cake, layer cake, Colourful'),
(396, 1, 'Two Tier Rose Gold Ombre with Thyme and Baby’s Breath', '&lt;p&gt;Our popular rose gold ombre cake is Garnished with thyme sprigs, dried rose petals and baby\'s breath for a subtle floral touch.&lt;/p&gt;', '', 'Two Tier Rose Gold Ombre with Thyme and Baby’s Breath', 'Our popular rose gold ombre cake is Garnished with thyme sprigs, dried rose petals and baby\'s breath for a subtle floral touch.', 'wedding, party, pastel, vibrant, tiered cake, layer cake, thyme, baby\'s breath, ombre'),
(397, 1, 'Two Tier Rustic Chocolate Berries and Thyme', '&lt;p&gt;A chocolate version of our mixed berries and thyme cake is covered with chocolate ganache, garnished with sprigs of thyme herbs topped with fresh mixed berries for a natural pop of colour.&lt;/p&gt;', '', 'Two Tier Rustic Chocolate Berries and Thyme', 'A chocolate version of our mixed berries and thyme cake is covered with chocolate ganache, garnished with sprigs of thyme herbs topped with fresh mixed berries for a natural pop of colour.', 'two tier, fruit, Chocolate, fresh floral, Gold, blueberries, strawberries, thyme'),
(398, 1, 'Two Tier Rustic Daisies and Baby’s Breath Cake', '&lt;p&gt;This popular rustic cake is garnished with sprigs of thyme herbs, topped with fresh daisies and baby\'s breath for an ethereal floral finish. A popular choice for floral themed celebrations and weddings!&lt;/p&gt;', '', 'Two Tier Rustic Daisies and Baby’s Breath Cake', 'This popular rustic cake is garnished with sprigs of thyme herbs, topped with fresh daisies and baby\'s breath for an ethereal floral finish. A popular choice for floral themed celebrations and weddings!', 'Rustic, Fresh Florals, Flowers, Two Tier, thyme, daisies,'),
(399, 1, 'Two Tier Rustic Floral Berry Cake', '&lt;p&gt;Our two-tier version of our stunning Rustic Floral berry cake with 24 Karat edible gold leaves individually placed onto the cake by our cake artists and garnished with fresh berries and florals. Choose between decorative fresh florals or edible petals for a personalised look. Popular for wedding occasions.&lt;/p&gt;', '', 'Two Tier Rustic Floral Berry Cake', 'Our two-tier version of our stunning Rustic Floral berry cake with 24 Karat edible gold leaves individually placed onto the cake by our cake artists and garnished with fresh berries and florals. Choose between decorative fresh florals or edible petals for', 'Rustic, Fresh Florals, Flowers, Two Tier, fruit, strawberry, blueberry, raspberry'),
(400, 1, 'Two Tier Rustic Floral Berry with Thyme', '&lt;p&gt;This rustic cake features thyme herb sprigs, along with 24 Karat edible gold leaves individually placed onto the cake by our cake artists. Garnished with fresh berries and florals. Choose between decorative fresh florals or edible petals for a personalised look. Popular for wedding occasions.&lt;/p&gt;', '', 'Two Tier Rustic Floral Berry with Thyme', 'This rustic cake features thyme herb sprigs, along with 24 Karat edible gold leaves individually placed onto the cake by our cake artists. Garnished with fresh berries and florals. Choose between decorative fresh florals or edible petals for a personalise', 'Rustic, Fresh Florals, Flowers, Two Tier'),
(401, 1, 'Rustic with Dried Lavender', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;One of our classic rustic designs - this rustic cake is garnished with sprigs of lavender. Perfect for rustic floral themes.&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\nOne of our classic rustic designs - this rustic cake is garnished with sprigs of lavender. Perfect for rustic floral themes.&lt;/p&gt;', '', 'Rustic with Dried Lavender', 'One of our classic rustic designs - this rustic cake is garnished with sprigs of lavender. Perfect for rustic floral themes.', 'rustic, lavander'),
(402, 1, 'Rose Gold, Macarons &amp; Strawberries Cake', '&lt;p&gt;This beautiful design features rose gold handpainted with edible luster dust, adorned with 24 Karat gold leaves placed individually by our cake artists. Topped with macarons, strawberry halves and edible floral petals for a lovely rustic finish.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Rose Gold, Macarons &amp; Strawberries Cake', 'This beautiful design features rose gold handpainted with edible luster dust, adorned with 24 Karat gold leaves placed individually by our cake artists. Topped with macarons, strawberry halves and edible floral petals for a lovely rustic finish.​​​​​​​', 'rose gold, gold leaves, gold cake, gold flakes, flower petals, floral cake, macarons, strawberries, fruits'),
(403, 1, 'Rustic Rosemary Wreath Cake', '&lt;p&gt;One of our classic rustic designs - this rustic cake is garnished with rosemary herbs and dried rose buds. Perfect for rustic floral themes.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Rustic Rosemary Wreath Cake', 'One of our classic rustic designs - this rustic cake is garnished with rosemary herbs and dried rose buds. Perfect for rustic floral themes.​​​​​​​', 'Rustic, rosemary, herbs, rose petals, rose, wedding cake, floral cake'),
(404, 1, 'Rustic with Fondant Roses', '&lt;p&gt;This beautiful design combines all our favourite cake elements - a rustic exterior with sprigs of rosemary and thyme herbs, macarons and handsculpted fondant flowers in pink and red. A beautiful centrepiece for all rustic-themed occasions.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Rustic with Fondant Roses', 'This beautiful design combines all our favourite cake elements - a rustic exterior with sprigs of rosemary and thyme herbs, macarons and handsculpted fondant flowers in pink and red. A beautiful centrepiece for all rustic-themed occasions.', 'Rustic cake, floral cake, wedding cake, fondant flowers, macarons, herbs, thyme, rosemary'),
(405, 1, 'Rustic Cake with Rosemary &amp; Rose Petals', '&lt;p&gt;One of our classic rustic designs - this rustic cake is garnished with rosemary herbs and topped with rose petals. Perfect for rustic floral themes.\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Rustic Cake with Rosemary &amp; Rose Petals', 'One of our classic rustic designs - this rustic cake is garnished with rosemary herbs and topped with rose petals. Perfect for rustic floral themes.', 'rustic, rosemary, rose petals, floral cake, rustic cake, wedding cake'),
(406, 1, 'White &amp; Gold Cake with Rosemary &amp; Crescent Decor Berries', '&lt;p&gt;This two-toned white and gold cake is adorned with 24 Karat gold leaves placed individually by our cake artists. Garnished with rosemary sprigs, fresh mixed berries and edible floral petals. A beautiful centrepiece for all occasions.\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\n&lt;/p&gt;', '', 'White &amp; Gold Cake with Rosemary &amp; Crescent Decor Berries', 'This two-toned white and gold cake is adorned with 24 Karat gold leaves placed individually by our cake artists. Garnished with rosemary sprigs, fresh mixed berries and edible floral petals. A beautiful centrepiece for all occasions.', 'gold cake, wedding cake, gold leaves, gold, berries, fresh fruits, floral cake, flowers'),
(407, 1, 'Yellow &amp; Red Car Cake', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\nThis car-themed cake features handcut fondant red and yellow car motifs on the circumference and handpiped buttercream \'grass\' on the top surface. Choose your desired fondant letters and number for a personalised look.\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\n&lt;/p&gt;', '', 'Yellow &amp; Red Car Cake', 'This car-themed cake features handcut fondant red and yellow car motifs on the circumference and handpiped buttercream \'grass\' on the top surface. Choose your desired fondant letters and number for a personalised look.', 'construction cake, transport cake, car cake, fondant, birthday cake, kids birthday cake'),
(408, 1, 'For Ombre Cake Duplication', '', '', 'For Ombre Cake Duplication', '', ''),
(409, 1, 'Two Tier Rustic Lavender Cake', '&lt;p&gt;This classic design features a rustic exterior garnished with sprigs of lavender. Perfect for rustic floral themes.&lt;/p&gt;', '', 'Two Tier Rustic Lavender Cake', 'This classic design features a rustic exterior garnished with sprigs of lavender. Perfect for rustic floral themes.', 'Rustic, Fresh Florals, Flowers, Two Tier, lavender'),
(410, 1, 'Two Tier Rustic Pastel Rainbow with Confetti Sprinkles', '&lt;p&gt;This unusual pastel rainbow base features a unique textured exterior created by hand by our cake artists. The beautiful rustic feel is accentuated by colorful confetti sprinkles on the circumference. Choose from our range of fondant and paper decorations to make this cake truly your own!&lt;/p&gt;', '', 'Two Tier Rustic Pastel Rainbow with Confetti Sprinkles', 'This unusual pastel rainbow base features a unique textured exterior created by hand by our cake artists. The beautiful rustic feel is accentuated by colorful confetti sprinkles on the circumference.', 'Rustic, Pastel, Colorful, Red, Orange, Yellow, Green, Blue, Purple, Candy, rainbow, confetti, kids'),
(411, 1, 'Two Tier Rustic Rose Gold &amp; Thyme', '&lt;p&gt;This rustic cake is handpainted with rose gold swashes on both tiers, garnished with thyme herb sprigs and dried rose buds. Perfect for rustic floral themes with a shimmery touch.&lt;/p&gt;', '', 'Two Tier Rustic Rose Gold &amp; Thyme', 'This rustic cake is handpainted with rose gold swashes on both tiers, garnished with thyme herb sprigs and dried rose buds. Perfect for rustic floral themes with a shimmery touch.', 'Rustic, Fresh Florals, Flowers, Two Tier, Gold, rose gold, thyme, rose buds'),
(412, 1, 'Two Tier Rustic Rosemary and Rose Petal Wreath', '&lt;p&gt;This classic design features a rustic exterior garnished with sprigs of fresh rosemary herbs and dried rose petals and buds. A popular choice for rustic floral themes including weddings and birthdays.&lt;/p&gt;', '', 'Two Tier Rustic Rosemary and Rose Petal Wreath', 'This classic design features a rustic exterior garnished with sprigs of fresh rosemary herbs and dried rose petals and buds. A popular choice for rustic floral themes including weddings and birthdays.', 'Rustic, Fresh Florals, Flowers, Two Tier, rose buds, rosemary, wedding'),
(413, 1, 'Two Tier Rustic Rosemary and Rose Petal Wreath and Gold Accent', '&lt;p&gt;Adding some shimmer to one of our classic rustic designs - featuring a gold-brushed circumference, garnished with rosemary herbs and dried rose buds. This cake is perfect for rustic floral themes including birthdays and weddings.&lt;/p&gt;', '', 'Two Tier Rustic Rosemary and Rose Petal Wreath and Gold Accent', 'Adding some shimmer to one of our classic rustic designs - featuring a gold-brushed circumference, garnished with rosemary herbs and dried rose buds. This cake is perfect for rustic floral themes including birthdays and weddings.', 'Rustic, Fresh Florals, Flowers, Two Tier, Gold, rosemary, rose buds, herbs, wedding'),
(414, 1, 'Two Tier Rustic Texture With Gold And Thyme', '&lt;p&gt;This rustic cake features a unique textured surface, decorated with sprigs of thyme herbs and 24 Karat edible gold leaves, placed individually by our cake artists. A lovely centrepiece for rustic celebrations.&lt;/p&gt;', '', 'Two Tier Rustic Texture With Gold And Thyme', 'This rustic cake features a unique textured surface, decorated with sprigs of thyme herbs and 24 Karat edible gold leaves, placed individually by our cake artists. A lovely centrepiece for rustic celebrations.', 'Rustic, Fresh Florals, Flowers, Two Tier, gold, thyme, gold leaves, wedding');
INSERT INTO `j5ui84yug_yng8e54e_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(415, 1, 'Two Tier Rustic Thyme Wreath', '&lt;p&gt;A two-tier version of our classic rustic design, this rustic cake is decorated with 24 Karat gold leaves which are individually placed onto the cake by our cake artists and garnished with sprigs of thyme herbs and fresh flowers.&lt;/p&gt;', '', 'Two Tier Rustic Thyme Wreath', 'A two-tier version of our classic rustic design, this rustic cake is decorated with 24 Karat gold leaves which are individually placed onto the cake by our cake artists and garnished with sprigs of thyme herbs and fresh flowers.', 'Rustic, Fresh Florals, Flowers, Two Tier, Gold, sweet williams'),
(416, 1, 'Two Tier Rustic Woodland Cake', '&lt;p&gt;This popular woodland-themed cake has a pastel rainbow bunting and handcut tree trunks on the circumference. Decorated with fondant daisies, toadstools and logs. Each of these toppers are intricately and individually moulded by our fondant artists.&nbsp;&lt;/p&gt;', '', 'Two Tier Rustic Woodland Cake', '', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake, tree'),
(417, 1, 'Order Comments', '', '', 'Order Comments', '', ''),
(419, 1, 'Two Tier Sky Blue Ombre Pirate Cake', '&lt;p&gt;This cake features a wavy ombre texture in sky blue, decorated with fondant coins and \'sand\' crumbs. Finished with a handsculpted pirate fondant topper. Add on fondant letters for an even more personalised look!&lt;/p&gt;', '', 'Two Tier Sky Blue Ombre Pirate Cake', 'This cake features a wavy ombre texture in sky blue, decorated with fondant coins and \'sand\' crumbs. Finished with a hand-sculpted pirate fondant topper.', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake, Pirate, Sea'),
(420, 1, 'Two Tier Sky Marble with Hot Air Balloon Decor', '&lt;p&gt;This two-tier design features a marbled exterior of sky blue and white that mimics the colours of the sky. Decorated with handcut fondant clouds and red and white fondant hot air balloons. To complete an aviation-themed celebration, do have a look at our handsculpted plane toppers in our Decorations category.&lt;/p&gt;', '', 'Two Tier Sky Marble with Hot Air Balloon Decor', 'This two-tier design features a marbled exterior of sky blue and white that mimics the colours of the sky. Decorated with handcut fondant clouds and red and white fondant hot air balloons.', 'Marble, kids, Party, Balloon, Sky, Blue, Cloud'),
(421, 1, 'Two Tier Solid Colour with Gold Line Accents and Gold Chocolate Sails', '&lt;p&gt;A classy design for all occasions - this understated geometric look is embellished with gold-dusted tempered dark chocolate sails. Choose your desired cake colour for a personalised look.&lt;/p&gt;', '', 'Two Tier Solid Colour with Gold Line Accents and Gold Chocolate Sails', 'A classy design for all occasions - this understated geometric look is embellished with gold-dusted tempered dark chocolate sails.', 'Two Tier, gold, Chocolate decor, Grand'),
(422, 1, 'Two Tier Space Galaxy Cake', '&lt;p&gt;A two-tier version of our popular Space Galaxy cake, this design features a galaxy-inspired buttercream exterior embellished with 3D hand-moulded planets, along with a handsculpted fondant rocket blasting off to space. A popular choice for space and galaxy-themed celebrations.&lt;/p&gt;', '', 'Two Tier Space Galaxy Cake', 'A two-tier version of our popular Space Galaxy cake, this design features a galaxy-inspired buttercream exterior embellished with 3D hand-moulded planets, along with a handsculpted fondant rocket blasting off to space. A popular choice for space and galax', 'Two Tier, Galaxy, Space, Kid, Party'),
(423, 1, 'Two Tier Strawberries &amp; Herb Cake', '&lt;p&gt;This beautiful two-tier rustic cake features a uniquely textured surface handpainted with gold swashes, decorated with sprigs of thyme and rosemary herbs, strawberry slices and sprigs of fresh florals. Finished with gold chocolate flakes. A lovely centrepiece for rustic themed celebrations.&lt;/p&gt;', '', 'Two Tier Strawberries &amp; Herb Cake', 'This beautiful two-tier rustic cake features a uniquely textured surface handpainted with gold swashes, decorated with sprigs of thyme and rosemary herbs, strawberry slices and sprigs of fresh florals. Finished with gold chocolate flakes. A lovely centrep', 'Fresh Florals, Flowers, Two Tier, Gold, Strawberry, Herb'),
(424, 1, 'Two Tier Tropical Palm Beach Cake', '&lt;p&gt;This design features a pastel blue base adorned with piped grass and buttercream palm trees, each handpiped by our cake artists. The top tier showcases a sky blue marbled exterior finished with fondant clouds and handpiped grass on the top surface. Choose to add on fondant letters to make this cake your own. To personalise it further, choose from our range of fondant and paper toppers in the \'Decorations\' category&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Two Tier Tropical Palm Beach Cake', 'This design features a pastel blue base adorned with piped grass and buttercream palm trees, each handpiped by our cake artists. The top tier showcases a sky blue marbled exterior finished with fondant clouds and handpiped grass on the top surface. Choose', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake, Beach, Sea, palm'),
(425, 1, 'Two Tier Under the Sea Cake', '&lt;p&gt;Dive deep into these sky blue ombre waves - the wavy texture on this two-tier ombre cake is created by hand by our cake artists. The tiered cake is garnished with purple \'seaweed\', hand-moulded seashells and \'sand\' crumble to finish of the perfect \'under the sea\' look.&lt;/p&gt;', '', 'Two Tier Under the Sea Cake', 'Dive deep into these sky blue ombre waves - the wavy texture on this two-tier ombre cake is created by hand by our cake artists. The tiered cake is garnished with purple \'seaweed\', hand-moulded seashells and \'sand\' crumble to finish of the perfect \'under', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake, Sea'),
(426, 1, 'Two Tier White Striped Cake with Fondant Rainbow Bunting', '&lt;p&gt;We adorn this two-tier cake with fondant vibrant rainbow buntings on the exterior, and top the rims with rainbow sprinkles. A popular cake base design, this cake lends welll to all kinds of celebrations. Choose from our range of fondant toppers and paper decorations on the \'Decorations\' tab to make this cake truly your own!&lt;/p&gt;', '', 'Two Tier White Striped Cake with Fondant Rainbow Bunting', 'We adorn this two-tier cake with fondant rainbow buntings on the exterior, and top the rims with rainbow sprinkles. A popular cake base design, this cake lends welll to all kinds of celebrations.', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake'),
(427, 1, 'Two Tier White Striped Cake with Rosemary and Baby&#039;s Breath', '&lt;p&gt;An understated design, this two-tier centrepiece features sprigs of rosemary herbs and fresh baby&rsquo;s breath. Perfect for rustic and floral-themed weddings and birthday celebrations.&lt;/p&gt;', '', 'Two Tier White Striped Cake with Rosemary and Baby\'s Breath', 'An understated design, this two-tier centrepiece features sprigs of rosemary herbs and fresh baby’s breath. Perfect for rustic and floral-themed weddings and birthday celebrations.', 'Rustic, Fresh Florals, Flowers, Two Tier, White, rosemary, baby\'s breath, weddings'),
(428, 1, 'Two Tier White Striped with Crumble and Seashells', '&lt;p&gt;This classic design is decorated with \'sand\' crumble and an assortment of hand-moulded, nude-coloured seashells. A great choice for understated beach themes and wedding celebrations.&lt;/p&gt;', '', 'Two Tier White Striped with Crumble and Seashells', 'This classic design is decorated with \'sand\' crumble and an assortment of hand-moulded, nude-coloured seashells. A great choice for understated beach themes and wedding celebrations.', 'Two Tier, Beach, Seashells, White, Layers'),
(429, 1, 'Two Tier Yellow Bus Cake', '&lt;p&gt;Wheels on the bus go round and round...a two-tier version of our popular Yellow Bus cake, this design features a blue exterior with fondant \'bushes\', traffic lights and clouds, and topped with a handcut yellow bus fondant topper. Choose your desired fondant letters and style for a personalised look.&lt;/p&gt;', '', 'Two Tier Yellow Bus Cake', 'Wheels on the bus go round and round...a two-tier version of our popular Yellow Bus cake, this design features a blue exterior with fondant \'bushes\', traffic lights and clouds, and topped with a handcut yellow bus fondant topper.', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake, Bus, wheels, school'),
(430, 1, 'Number Candles', '', '', 'Number Candles', '', 'Candle, Number, confetti, stars, hearts'),
(431, 1, 'Happy Carrot Cake', '&lt;p&gt;Here\'s one way to enjoy your greens! Our Happy Carrot Cake features a handpiped orange exterior, topped with green fondant \'stalks\', and an ever-happy grin. Always a favourite for putting a smile on anyone\'s face.&nbsp;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Happy Carrot Cake', 'Here\'s one way to enjoy your greens! Our Happy Carrot Cake features a handpiped orange exterior, topped with green fondant \'stalks\', and an ever-happy grin. Always a favourite for putting a smile on anyone\'s face.', 'carrot cake, fondant cake, piped cake, buttercream cake, kids birthday cake'),
(432, 1, 'One Tier Semi Custom Duplicate', '&lt;p&gt;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'For duplication of One Tier Semi Custom', '', ''),
