(434, 1, 'Fondant Letters', '&lt;p&gt;Each fondant letter is approximately 1&quot; in width and height. We recommend the following length of fondant letter for below cake sizes without additional decorations (E.g. piping, berries, florals and etc). &lt;/p&gt;\r\n\r\n&lt;p&gt;6&quot;/ Tall 6&quot; - 5 letters&lt;/p&gt;\r\n\r\n&lt;p&gt;8&quot;/ Medium 8&quot;/ Tall 8&quot; - 6 letters&lt;/p&gt;\r\n\r\n&lt;p&gt;10&quot; - 8 letters&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Note: Please do not adjust the quantity unless you would like for 2 sets of the letters indicated. &lt;/p&gt;', '', 'Fondant Letters', '', ''),
(435, 1, 'Fondant Number', '&lt;p&gt;Each fondant number is approximately 2-3&quot; in width. We recommend the following length of fondant number for below cake sizes without additional decorations (E.g. piping, berries, florals and etc). &lt;/p&gt;\r\n\r\n&lt;p&gt;6&quot;/ Tall 6&quot; / 8&quot;/ Medium 8&quot;/ Tall 8&quot; - 2 Numbers&lt;/p&gt;\r\n\r\n&lt;p&gt;10&quot;/12&quot; - 3 Numbers&lt;/p&gt;\r\n\r\n&lt;p&gt;For designs with decorations, we\'ll recommend for 1 number only. &lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Note: Please do not adjust the quantity unless you would like for 2 sets of the numbers indicated. &lt;/p&gt;', '', 'Fondant Number', '', ''),
