(452, 1, 'Chinese &#039;Happy Birthday&#039; Fondant Letters (生日快乐)', '', '', 'Chinese \'Happy Birthday\' Fondant Letters (生日快乐)', '', 'Chinese, Happy Birthday, Fondant, 生日快乐'),
(453, 1, 'Strawberry Grapefruit Cake', '&lt;p&gt;A&nbsp;fruity pairing of grapefruit and strawberry. We pair handmade strawberry compote (with no added sugar!) with a refreshing grapefruit buttercream, topped with freeze-dried raspberries, strawberries and dehydrated lemon slices.&lt;/p&gt;', '', 'Strawberry Grapefruit Cake', 'A fruity pairing of grapefruit and strawberry. We pair handmade strawberry compote (with no added sugar!) with a refreshing grapefruit buttercream, topped with freeze-dried raspberries, strawberries and dehydrated lemon slices.', 'Strawberry Grapefruit Cake, Fruit, Buttercream'),
(454, 1, 'Mini Lemon Loaf Box Set (min. 10 boxes)', '&lt;p&gt;A crowd favourite, our moist and tangy lemon loaves are glazed with a tangy lemon drizzle and garnished with edible floral petals for a wonderful burst of flavour with every bite. Each box consists of 2 pieces of Lemon Loaf, great as a gift! :)&lt;/p&gt;', '', 'Lemon Loaf Box Set', 'A crowd favourite, our moist and tangy lemon loaves are glazed with a tangy lemon drizzle and garnished with edible floral petals for a wonderful burst of flavour with every bite. Each box consists of 2 pieces of Lemon Loaf, great as a gift! :)', 'Gift, Giftbox, Full Month, 100 days, 1 month, baby, farewell, infant, departure'),
(455, 1, 'Two Tier Gold Ombre Cake with Gold Leaves', '&lt;p&gt;Popular for birthday celebrations and weddings, this ombre striped cake is handpainted with edible luster dust, topped with a medley of sprinkles on the rims. Choose from 24 Karat gold or silver leaf embellishments, and also your preferred ombre colour for the perfect classy look.&lt;/p&gt;', '', 'Two Tier Gold Ombre Cake with Gold Leaves', 'Popular for birthday celebrations and weddings, this ombre striped cake is handpainted with edible luster dust, topped with a medley of sprinkles on the rims. Choose from 24 Karat gold or silver leaf embellishments, and also your preferred ombre colour fo', 'Gold, classy, gold leaves, gold ombre, two tier'),
(456, 1, 'Floral Lollipops (min. 20 pcs)', '', '', 'Floral Lollipops', '', ''),
(457, 1, 'Mini Floral Cupcakes (min. 10 boxes)', '&lt;p&gt;Each box contains 6 Mini Vanilla Cupcakes with edible florals.&lt;/p&gt;', '', 'Mini Floral Cupcakes (min. 15 boxes)', 'Each box contains 6 Mini Vanilla Cupcakes with edible florals.', 'baby, 1 month, 100 days, first month, gifts, gift boxes, farewell, minis, infant'),
(458, 1, 'Rustic Floral Cupcakes Box Set (Min. 10 Boxes)', '&lt;p&gt;Each box contains 2&nbsp;Vanilla Cupcakes with edible florals and herbs.&lt;/p&gt;', '', 'Rustic Floral Cupcakes Box Set', 'Each box contains 2 Vanilla Cupcakes with edible florals and herbs.', ''),
