(480, 1, 'Christmas Special: Brownies (Matcha &amp; Dark Chocolate)', '&lt;p&gt;Our box of brownies consists of two flavours - Dark chocolate and Matcha!&lt;/p&gt;\n\n&lt;p&gt;Comes in a box of 25 (4-cm squares) or 4 boxes of 4, each brownie square is placed on a cupcake liner for ease of distribution.&lt;/p&gt;\n\n&lt;p&gt;Our decadent Dark Choc Brownies are made with 66% Valrhona chocolate and coated with dark chocolate ganache. Our Matcha Blondies are made with premium Matcha powder imported from japan, having a mild natural bitterness that enhances the fragrance of the tea leaves.&lt;/p&gt;\n\n&lt;p&gt;All the sweet treats are topped with gold-dusted assorted festive white chocolate christmas decor to celebrate the season!&lt;/p&gt;\n\n&lt;p&gt;Do note that multiple boxes will be packed together.&lt;/p&gt;', '', 'Christmas Special: Brownies (Matcha &amp; Dark Chocolate)', 'Our box of brownies consists of two flavours - Dark chocolate and Matcha!\n\nComes in a box of 25 (4-cm squares) or 4 boxes of 4, each brownie square is placed on a cupcake liner for ease of distribution.\n\nOur decadent Dark Choc Brownies are made with 6', 'chocolate, brownies, matcha, blondies, christmas, festive'),
(481, 1, 'Christmas Special: Pavlova (Gluten-Free)', '&lt;p&gt;A meringue-based dessert with a crisp crust and marshmallow-y center. Topped with fresh cream and strawberry compote.&lt;/p&gt;\n\n&lt;p&gt;Decorated with edible petals.&lt;/p&gt;\n\n&lt;p&gt;Comes in 8 Boxes of 1.&lt;/p&gt;\n\n&lt;p&gt;Do note that multiple boxes will be packed together.&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Christmas Special: Pavlova (Gluten-Free)', 'A meringue-based dessert with a crisp crust and marshmallow-y center. Topped with fresh cream and strawberry compote. Decorated with edible petals.', 'Pavlova, meringue, strawberry, christmas, festive'),
(482, 1, 'Christmas Special: Speculoos Almond Cookies (Bag)', '&lt;p&gt;These cookies are popular during the month of Christmas, with a tinge of caramel and cinnamon - this is how Christmas smells like, spices. This will be a perfect Christmas gift for friends and families!&lt;/p&gt;', '', 'Christmas Special: Speculoos Almond Cookies', 'These cookies are popular during the month of Christmas, with a tinge of caramel and cinnamon - this is how Christmas smells like, spices. This will be a perfect Christmas gift for friends and families!', 'cookies, speculoos, almond, festive, christmas'),
(483, 1, 'Mini Bites (For duplication)', '&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Comes in fixed quantities of:&nbsp;&lt;/p&gt;\n\n&lt;p&gt;- 2 Boxes of 6&lt;/p&gt;\n\n&lt;p&gt;- 1 Box of 25&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Additional costs will apply for individual paper bags&nbsp;requested.&nbsp;&lt;/p&gt;', '', 'Mini Bites (For duplication)', '', ''),
(484, 1, 'Feuilletine Chocolate Clusters', '&lt;p&gt;These crunchy wafer crisps are coated in rich Valrhona chocolate, making for a delicious, addictive treat. Each bag contains approximately 150g of crispy cookies.&lt;/p&gt;', '', 'Feuilletine Chocolate Clusters', 'These crunchy wafer crisps are coated in rich Valrhona chocolate, making for a delicious, addictive treat. Each bag contains approximately 150g of crispy cookies.', 'mini bites, chocolate'),
(485, 1, 'Flourless Chocolate Cake (Gluten-Free)', '&lt;p&gt;Chocoholics assemble!&nbsp;&lt;/p&gt;\n\n&lt;p&gt;You are in for a treat with our dense, rich and decadent flourless chocolate cake. Made with Valrhona 66% dark chocolate. Decorated with icing sugar and berries.&lt;/p&gt;\n\n&lt;p&gt;Our flourless chocolate cake is great as a guilt-free treat, especially for those on gluten-free diets.&lt;/p&gt;', '', 'Flourless Chocolate Cake (Gluten-Free)', 'Chocoholics assemble! You are in for a treat with our dense, rich and decadent flourless chocolate cake. Made with Valrhona 66% dark chocolate. Decorated with icing sugar and berries.', 'chocolate, flourless, christmas, festive'),
(486, 1, 'Christmas Special: Pandan Coconut Gula Melaka Log Cake (SOLD OUT)', '&lt;p&gt;A time-honored classic for the most wonderful time of the year! We layer soft pandan sponge with salted coconut buttercream and handcooked coconut and gula melaka filling. Decorated with dehydrated lemon slices, herbs and spices for a rustic finish.&lt;/p&gt;\n\n&lt;p&gt;Do note that multiple boxes will be packed together.&lt;/p&gt;', '', 'Christmas Special: Pandan Coconut Gula Melaka Log Cake', 'A time-honored classic for the most wonderful time of the year! We layer soft pandan sponge with salted coconut buttercream and handcooked coconut and gula melaka filling. Decorated with dehydrated lemon slices, herbs and spices for a rustic finish.', 'pandan coconut, pandan, gula melaka, christmas, log cake, festive'),
(487, 1, 'Chocolate Chip Cookies', '&lt;p&gt;Everyone loves a good chocolate chip cookie - these crispy bites are a great addition to your snack stash!&lt;/p&gt;', '', 'Chocolate Chip Cookies', '', 'Chocolate Chip Cookies, Cookies, Chocolate Cookies, Chocolate'),
(488, 1, 'Chocolate Almond Crunch Bites (Egg-Free, Gluten-Free)', '&lt;div class=&quot;product-single__description rte&quot; itemprop=&quot;description&quot;&gt;\n&lt;p&gt;These&nbsp;bite-sized almond clusters are roasted to perfection, then coated with Valrhona 66% dark chocolate. Super addictive and great for guests to munch on during visits, or as a treat for yourself, because...why not? Chocolate almond crunch bites are made without wheat products, dairy or eggs. Each jar contains 24 pieces.&lt;/p&gt;\n\n&lt;p&gt;Do note that our kitchen handles wheat, egg and dairy products on a daily basis and bakes may contain trace amounts of such ingredients.&lt;/p&gt;\n&lt;/div&gt;', '', 'Chocolate Almond Crunch Bites (Egg-Free, Gluten-Free)', '', 'Chocolate Almond Crunch Bites, Almond, Chocolate, Egg-Free, Gluten-Free, Bites'),
(489, 1, 'Happy Birthday Glitter Paper Topper (Pink/Blue)', '', '', 'Happy Birthday Glitter Paper Topper', '', 'Happy Birthday, Gold, Glitter, Paper Topper'),
(490, 1, 'Honey Chrysanthemum Cake', '&lt;div data-qa=&quot;message_content&quot;&gt;For this cake, we\'ve paired a refreshing flower tea with mild notes of honey. &lt;/div&gt;\r\n\r\n&lt;div data-qa=&quot;message_content&quot;&gt; &lt;/div&gt;\r\n\r\n&lt;div data-qa=&quot;message_content&quot;&gt;Made with fluffy honey-scented vanilla sponge layered with chrysanthemum-infused cream, coated with vanilla buttercream, and garnished with marigold petals and white chocolate shards.&lt;/div&gt;\r\n\r\n&lt;div data-qa=&quot;message_content&quot;&gt; &lt;/div&gt;\r\n\r\n&lt;div data-qa=&quot;message_content&quot;&gt;A subtle sweetness with every bite.&lt;/div&gt;\r\n\r\n&lt;div data-qa=&quot;message_content&quot;&gt; &lt;/div&gt;\r\n\r\n&lt;div aria-label=&quot;Message actions&quot; role=&quot;group&quot;&gt; &lt;/div&gt;', '', 'Honey Chrysanthemum Cake', 'We\'ve paired a refreshing flower tea with mild notes of honey for our November special - Honey Chrysanthemum!\r\nMade with fluffy honey-scented vanilla sponge layered with chrysanthemum-infused cream, coated with vanilla buttercream, and garnished with mari', 'chrysanthemum, exotic, honey, buttercream'),
(495, 1, 'Blueberry Elderflower Cake', '&lt;p&gt;Elderflowers are subtle and sweet, perfect for those who prefers a mildly-scented floral flavour. This cake features a unique pairing of elderflower and blueberry.&lt;/p&gt;\r\n\r\n&lt;p&gt;We infuse elderflower extracted from elder blossoms into our buttercream with handmade blueberry compote and topped it with ivory chocolate glaze, blueberries and marigold petals, for a crisp, palate-cleansing finish&lt;/p&gt;', '', 'Blueberry Elderflower Cake', 'Elderflowers are subtle and sweet, perfect for those who prefers a mildly-scented floral flavour. Our October special features a unique pairing of elderflower and blueberry.\r\n\r\nWe infuse elderflower extracted from elder blossoms into our buttercream with', 'blueberry, elderflower, fruity'),
(496, 1, 'Lemon Drizzle Bundt', '&lt;p&gt;Our moist and tangy lemon bundt cake is drizzled with a lovely lemon glaze, garnished edible floral petals for a wonderful burst of flavour with every bite.&nbsp;&lt;/p&gt;', '', 'Lemon Drizzle Bundt', 'Our moist and tangy lemon bundt cake is drizzled with a lovely lemon glaze, garnished edible floral petals for a wonderful burst of flavour with every bite. ', ''),
(497, 1, 'Mini Cookie Jar (Min. 10 Jars)', '', '', 'Mini Cookie Jar', '', 'Cookies, cookie, mini jar, gift'),
(498, 1, 'Mini Cookie Jar + Customised Sticker (Min. 10 Jars)', '', '', 'Mini Cookie Jar', '', 'Cookies, cookie, mini jar, gift'),
(500, 1, 'Buttery Pineapple Tarts (Sugar-Free, Diabetic-Friendly)', '&lt;p&gt;Celebrate the festive Chinese New Year season with our buttery pineapple tarts that will give you all the pleasure without the guilt. Our recipe is made sugar-free with erythritol, a natural sugar found in plants and fruits. It contains almost no calories (it has 95% less calories than table sugar), and has a low glycemic impact (GI), making it great for diabetics and those on keto diets. Our pineapple jam is also handcooked in small batches with Thai honey pineapples, to ensure the highest quality and a comforting, homemade taste. &lt;/p&gt;', '', 'Buttery Pineapple Tarts (Sugar-Free, Keto-Friendly, Diabetic-Friendly)', 'Celebrate the festive Chinese New Year season with our buttery pineapple tarts that will give you all the pleasure without the guilt. Our recipe is made sugar-free with erythritol, a natural sugar found in plants and fruits. It contains almost no calories', 'Buttery Pineapple Tarts, Sugar-Free, Keto-Friendly, Diabetic-Friendly, low sugar, healthy cookies, healthy, keto, diabetic'),
(501, 1, 'White Sesame Cookies (Gluten-Free, Vegan, Diabetic-Friendly, Refined-Sugar Free, Paleo-Friendly)', '&lt;p&gt;These addictive white sesame cookies are so indulgent, no one will ever guess they\'re healthy! Our nuts are well-roasted for fragrant, crunchy cookies, paired with just a few ingredients to ensure a burst of flavour with every bite. These cookies are egg-free, dairy-free, gluten-free, refined-sugar free, making them a healthier choice for diabetics and those on paleo diets. &lt;/p&gt;', '', 'White Sesame Cookies (Gluten-Free, Vegan, Diabetic-Friendly, Refined-Sugar Free, Paleo-Friendly)', 'These addictive white sesame cookies are so indulgent, no one will ever guess they\'re healthy! Our nuts are well-roasted for fragrant, crunchy cookies, paired with just a few ingredients to ensure a burst of flavour with every bite. These cookies are egg-', 'White Sesame Cookies, Gluten-Free, egg-free, dairy-free, singapore, Vegan, Diabetic-Friendly, Refined-Sugar Free, Paleo-Friendly, low sugar, healthy cookies, healthy, keto, diabetic, paleo'),
(502, 1, 'Chocolate Fleur De Sel Cookies (Egg-Free)', '&lt;p&gt;Our best-selling egg-free chocolate fleur de sel cookies are a great addition to any snacking platter. These rich and dark morsels are filled with chunks of Valrhona chocolate and sprinkled with sea salt for a kick of flavour.&nbsp;&lt;/p&gt;', '', 'Chocolate Fleur De Sel Cookies', 'Our best-selling egg-free chocolate fleur de sel cookies are a great addition to any snacking platter. These rich and dark morsels are filled with chunks of Valrhona chocolate and sprinkled with sea salt for a kick of flavour. ', 'Chocolate Fleur De Sel Cookies, Cookies, Chocolate Cookies, Chocolate, Sea Salt, egg-free, healthy cookies, singapore'),
(503, 1, 'Chinese New Year Auspicious Hamper Set', '&lt;p&gt;Our festive CNY hamper set is a great gift for friends, clients, colleagues and loved ones, filled with premium handmade bakes and goodies that are sure to impress.&lt;/p&gt;\n\n&lt;p&gt;Each hamper set includes:&lt;br /&gt;\n1 Jar of Edith Patisserie\'s Buttery Pineapple Tarts (Sugar-Free, Diabetic-Friendly)&lt;br /&gt;\n1 Jar of Edith Patisserie\'s Chocolate Fleur De Sel Cookies (Egg-Free)&lt;br /&gt;\n1 Jar of Edith Patisserie\'s White Sesame Cookies (Gluten-Free, Vegan, Diabetic-Friendly, Refined-Sugar Free, Paleo-Friendly)&lt;br /&gt;\n1 Loaf of Edith Patisserie\'s Fragrant Butter Cake&lt;br /&gt;\n1 Box of Roji\'s Milky Popcorn Tea (Japanese Sencha with Roasted Rice and Butterscotch Popcorn)&lt;br /&gt;\n1 Jar of Ujong Gourmet\'s Straits Kaya (Artisanal Butterfly Pea &amp; Pandan Coconut Jam)&lt;br /&gt;\n2 Mandarin Oranges&lt;/p&gt;', '', 'Chinese New Year Auspicious Hamper Set', 'Our festive CNY hamper set is a great gift for friends, clients, colleagues and loved ones, filled with premium handmade bakes and goodies that are sure to impress.', 'Buttery Pineapple Tarts, Sugar-Free, Keto-Friendly, Diabetic-Friendly, low sugar, healthy cookies, healthy, keto, diabetic, white sesame cookies, CNY hamper, healthy hamper, Chinese new year hampers singapore'),
(504, 1, 'January Special: Ispahan Cake', '&lt;p&gt;Celebrate Chinese New Year with a refreshing burst of flavour. Our Ispahan cake brings together three complementary flavours - lychee, raspberry, and rose. We pair a light, fluffy vanilla sponge cake with lychee cream made from fresh lychees, fresh raspberry pieces sprinkled in between, finished off with a rose buttercream.&nbsp;&lt;br /&gt;\n&lt;br /&gt;\nWe then drizzle the top with raspberry glaze. This glaze is made with premium Valrhona Framboise Inspiration, a fruit couverture chocolate that delivers an intensely flavourful raspberry flavour with natural flavours and no colouring.&nbsp;&lt;/p&gt;\n\n&lt;p&gt;To finish off this festive cake, we decorate the top with chocolate ingots and koi fish, which are both popular motifs to signify auspiciousness and fortune during Chinese New Year.&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'January Special: Ispahan Cake', 'Celebrate Chinese New Year with a refreshing burst of flavour. Our Ispahan cake brings together three complementary flavours - lychee, raspberry, and rose.', 'Chinese new year cake, lychee rose, lychee, rose, bandung, singapore, raspberry, Ispahan Cake'),
(505, 1, 'Rainbow Clouds Fondant Topper', '&lt;p&gt;Our signature rainbow and clouds fondant topper comes in two shades: pastel and vibrant.&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Rainbow Clouds Fondant Topper', '', 'Rainbow Clouds, Rainbow, Fondant Topper'),
(506, 1, 'Assorted Brownies', '&lt;p&gt;An assortment of everyone\'s favourite mini bites. Each box of four brownies comes with one of each flavour: &lt;/p&gt;\r\n\r\n&lt;p&gt;Salted Speculoos Blondie&lt;/p&gt;\r\n\r\n&lt;p&gt;Earl Grey Brownie&lt;/p&gt;\r\n\r\n&lt;p&gt;Hazelnut Brownie&lt;/p&gt;\r\n\r\n&lt;p&gt;Matcha Blondie &lt;/p&gt;', '', 'Assorted Brownies', 'An assortment of everyone\'s favourite mini bites. Each box of four brownies comes with one of each flavour: Salted Speculoos Blondie, Earl Grey Brownie, Hazelnut Brownie, Matcha Blondie ', 'Chocolate, Earl Grey, Blondies, Brownies, Sweet, Tea, Matcha, Speculoos'),
(507, 1, 'Honey Cream Cake (Cane Sugar-Free)', '&lt;p&gt;This moist honey&nbsp;cake is a great alternative for those wishing to avoid cane sugar. We use 100% Australian honey with no added sugars or syrups. Frosted with a honey-scented fresh cream frosting,&nbsp;sprinkled with edible flowers.&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;', '', 'Honey Cream Cake (Cane Sugar-Free)', 'This moist honey cake is a great alternative for those wishing to avoid cane sugar. We use 100% Australian honey with no added sugars or syrups. Frosted with a honey-scented fresh cream frosting, sprinkled with edible flowers.', 'honey, refined sugar free, cane sugar free'),
(508, 1, 'Two Tier Rustic Floral Petal Cake', '&lt;p&gt;This rustic cake is one of our favourites - the exterior features herb sprigs and edible floral petals carefully and individually placed by hand onto the cake by our cake artists. Perfect for rustic floral themes.&lt;/p&gt;', '', 'Two Tier Rustic Floral Petal Cake', 'This rustic cake is one of our favourites - the exterior features herb sprigs and edible floral petals carefully and individually placed by hand onto the cake by our cake artists. Perfect for rustic floral themes.', 'edible petals, flowers, edible, florals, petals, herbs, colourful, two tier'),
(509, 1, 'Firetruck Cake', '&lt;p&gt;Our Firetruck Cake is&nbsp;perfect for fireman-themed parties! The sides feature handpiped red and orange &quot;flames&quot; with the top surface&nbsp;decorated with a 2D handcut firetruck topper, along with grass and a fireman\'s hose.&nbsp;\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\n&lt;/style&gt;\n&lt;/p&gt;', '', 'Firetruck Cake', '', 'Fire, Blue, Fire truck cake, fireman, Fondant, Traffic, Vehicles, Transportation'),
(510, 1, 'Two Tier Transportation Cake', '&lt;p&gt;This transportation cake is sure to put a smile on any boy\'s face.&nbsp;The sides of this cake are adorned with 2D handcut fondant vehicles, along with a cheery rainbow bunting and 3D handsculpted vibrant fondant balloons. Personalise this cake even more with a fondant number and fondant name of your choosing.&lt;/p&gt;', '', 'Two Tier Transportation Cake', 'This transportation cake is sure to put a smile on any boy\'s face. The sides of this cake are adorned with 2D handcut fondant vehicles, along with a cheery rainbow bunting and 3D handsculpted vibrant fondant balloons. Personalise this cake even more with', 'kid-friendly, child, children, party, celebration, tiered cake, layer cake, Bus, wheels, school'),
(511, 1, 'Pine Wood Cake Stand', '&lt;p&gt;This wooden cake stand is made of pine and iron, measuring 30cm in diameter and 21cm in height. Cake stands are a great way to prop up your cake and create a more eye-catching display.&lt;/p&gt;', '', 'Pine Wood Cake Stand', '', 'Pine Wood Cake Stand, wooden cake stand, cake stand singapore'),
(512, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(514, 1, 'February Special: Strawberry Chocolate Cake', '&lt;p&gt;Celebrate February, the season of love, with a time-honoured pairing of strawberry and chocolate. Our Strawberry Chocolate&nbsp;Cake consists of moist and dark chocolate sponge sandwiched between layers of handmade strawberry compote. Finished off with a coating of rich dark chocolate ganache made with Valrhona chocolate, fresh strawberries and freeze-dried strawberry sprinkles.&lt;/p&gt;', '', 'February Special: Strawberry Chocolate Cake', 'Celebrate February, the season of love, with a time-honoured pairing of strawberry and chocolate. Our Strawberry Chocolate Cake consists of moist and dark chocolate sponge sandwiched between layers of handmade strawberry compote. Finished off with a coati', 'strawberry, chocolate, february, cake, valentine\'s day, delivery, singapore'),
(515, 1, 'Valentine&#039;s Day Bundle', '&lt;p&gt;This Valentines\' Day, impress your other half or loved ones with our exclusive Valentine\'s Day Bundle. The bundle comes with a mini 4.5&quot;&nbsp;Madagascan vanilla bean cake with a rustic finish, adorned with fresh&nbsp;rosemary and dried rose buds and petals, and a preserved rose bouquet. With every bundle purchase, receive a free box of four Valrhona Inspiration Framboise chocolates, a fruit couverture chocolate that delivers an intense, natural raspberry flavour with no colouring.&lt;/p&gt;', '', 'Valentine\'s Day Bundle', 'This Valentines\' Day, impress your other half or loved ones with our exclusive Valentine\'s Day Bundle. The bundle comes with a mini 4.5&quot; Madagascan vanilla bean cake with a rustic finish, adorned with fresh rosemary and dried rose buds and petals, an', 'flowers, mini cake, vanilla, valentines, valentine, bouquet, chocolate, cake, singapore'),
(516, 1, 'March Special: Blood Orange Yuzu Cake', '&lt;p&gt;This month, treat yourself to a refreshing blood orange and yuzu combination. This fresh cream cake features a blood orange cream between fluffy layers of vanilla sponge, finished with a yuzu chantilly cream. Topped with dried edible petals.&lt;/p&gt;', '', 'March Special: Blood Orange Yuzu Cake', 'This month, treat yourself to a refreshing blood orange and yuzu combination. This fresh cream cake features a blood orange cream between fluffy layers of vanilla sponge, finished with a yuzu chantilly cream. Topped with dried edible petals.', 'blood orange cake, yuzu cake, singapore, cake delivery singapore, cream cake'),
(517, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(518, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(519, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(520, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(521, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(522, 1, 'Standard Cake Main Template (For duplication)', '', '', 'Standard Cake Main Template (For duplication)', '', ''),
(523, 1, 'April Special: Three-Cheese Cake', '&lt;p&gt;Celebrate Easter with our three-cheese cake, a heavenly combination of sweet and savory. Our fluffy vanilla sponge is paired with a light cream featuring a trio of cheeses - parmesan, mascarpone and cream cheese. The cake is coated with parmesan cheese, and finished with speckled half-egg domes for an Easter look.&lt;/p&gt;', '', 'April Special: Three-Cheese Cake', 'Celebrate Easter with our three-cheese cake, a heavenly combination of sweet and savory. Our fluffy vanilla sponge is paired with a light cream featuring a trio of cheeses - parmesan, mascarpone and cream cheese. The cake is coated with parmesan cheese, a', 'Easter, three-cheese, cake, parmesan, chocolate egg, fresh cream, mascarpone, cream cheese'),
(524, 1, 'Mini Bites (For duplication)', '&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Comes in fixed quantities of:&nbsp;&lt;/p&gt;\n\n&lt;p&gt;- 2 Boxes of 6&lt;/p&gt;\n\n&lt;p&gt;- 1 Box of 25&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;Additional costs will apply for individual paper bags&nbsp;requested.&nbsp;&lt;/p&gt;', '', 'Mini Bites (For duplication)', '', ''),
(525, 1, 'Easter Special: Mini Chocolate Cupcakes', '&lt;p&gt;Make this Easter egg-stra special with our mini chocolate cupcakes, topped with vanilla bean frosting and decorated with speckled half-egg domes in assorted colours! Each box will have 6 mini cupcakes.&lt;/p&gt;', '', 'Easter Special: Mini Chocolate Cupcakes', 'Make this Easter egg-stra special with our mini chocolate cupcakes, topped with vanilla bean frosting and decorated with speckled half-egg domes in assorted colours! Each box will have 6 mini cupcakes.', 'Easter, chocolate, cupcakes, chocolate egg, Easter special, chocolate cupcakes, cakes, mini'),
