INSERT INTO `j5ui84yug_yng8e54e_proemail_content` (`content_id`, `type`, `from_name`, `from_email`, `to`, `subject`, `content`, `template`, `file`, `language_id`, `store`) VALUES
(2559, 'customer.approve', '', '', '', '{store_name} - Your account has been activated!', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Welcome to Edith Patisserie! Your account has now been activated. You can log in by visiting our website through the button below:&lt;/p&gt; &lt;p&gt;[button={account_url}]My Account[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to access your order history, reward points and edit your account information. Looking forward to bake for you! &lt;br&gt;&lt;/p&gt; &lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2560, 'customer.credit', '', '', '', '{store_name} - Store Credits', '&lt;p&gt;Hi {firstname},&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;You have received {amount} worth of store credits and your total amount of credits is now &lt;b&gt;{total}&lt;/b&gt;.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;Store credits will be automatically deducted on your next purchase.&lt;/p&gt; &lt;p&gt;[button={account_url}]My Account[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2561, 'customer.forgotten', '', '', '', '{store_name} - Password Reset', '&lt;p&gt;Hi {firstname},&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;We have received a request from you to reset your password for your account. You may reset your password by clicking on the button below:&lt;/p&gt; &lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;[button={reset_link}]Reset my password[/button]&lt;/p&gt; &lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;/p&gt;', '', '', 1, 0),
(2562, 'customer.register', '', '', '', '{store_name} - Thank you for registering', '&lt;p&gt;Hi {firstname},&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Welcome to Edith Patisserie! Your account has now been activated. You can log in by visiting our website or through the button below:&lt;/p&gt;&lt;p&gt;[button={account_url}]My Account[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Upon logging in, you will be able to access your order history, reward points and edit your account information. Looking forward to bake for you! :)&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2563, 'customer.reward', '', '', '', '{store_name} - Reward Points', '&lt;p&gt;Hi {firstname},&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;You have received {amount} Reward Points from your order! Your current reward points is&amp;nbsp;&lt;b&gt;{total}&lt;/b&gt;.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your account, click on the button below:&lt;/p&gt; &lt;p&gt;[button={account_url}]My Account[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2564, 'customer.voucher', '', '', '', '{from} has sent you a Gift Card', '&lt;p&gt;Hi {firstname},&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;You have received a Gift Card worth &lt;b&gt;{amount} &lt;/b&gt;from&amp;nbsp;&lt;b&gt;{from}!&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Redemption code:&lt;/b&gt;&amp;nbsp;&lt;b&gt;{code}&lt;/b&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;{message}&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;You may redeem the Gift Card through the link below where the code can be entered at the checkout page.&lt;/p&gt; &lt;p&gt;[button={store_url}]{store_name}[/button]&lt;/p&gt; &lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;/p&gt;', '', '', 1, 0),
(2565, 'enquiry.confirm', '', '', '', '{store_name} - Enquiry {enquiry_order_id}', '&lt;p&gt;Hi {firstname},&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;Thank you for your interest in {store_name}. Your enquiry has been received and we will get back to you as soon as we can!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your enquiry click on the link below:&lt;/p&gt; &lt;p&gt;[button={enquiry_order_url}]My Enquiry[/button]&lt;/p&gt;&lt;br&gt; &lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;/p&gt;', '', '', 1, 0),
(2566, 'order.confirm', '', '', '', '{store_name} - Order {order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Thank you for your purchase! We are currently processing your order&amp;nbsp;&lt;b&gt;#{order_id}.&amp;nbsp;&amp;nbsp;&lt;/b&gt;Should there be any issues with your order which we need to clarify, we will contact you via a follow-up email.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;A separate confirmation email will be sent when the order has been processed. Orders are typically processed within 2-3 working days. For any order enquiries, you may reply to this email and we\'ll try our best to get back as soon as we can.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Thank you and have a nice day! :)&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your order, you may do so via the button below:&lt;/p&gt;&lt;p&gt;[button={order_url}]My Order[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2567, 'order.return', '', '', '', '{store_name} - Return Update {return_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Your order&amp;nbsp;&lt;b&gt;#{order_id}&amp;nbsp;&lt;/b&gt;has been cancelled&lt;b&gt;.&amp;nbsp;&amp;nbsp;&lt;/b&gt;We\'ll be in touch soon via email for the follow-up. Thank you! :)&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your order click on the button below:&lt;/p&gt;&lt;p&gt;[button={order_url}]My Order[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2568, 'admin.customer.register', '', '', '', 'New Customer Sign-Up', '&lt;p&gt;A new customer has signed up:&lt;/p&gt; &lt;p&gt;&lt;/p&gt;&lt;table&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td style=&quot;width:43%&quot;&gt;Web Site:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{store_url}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;Customer Group:&amp;nbsp;&lt;/td&gt;&lt;td&gt;&lt;b&gt;{customer_group}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;First Name:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{firstname}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;Last Name:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{lastname}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;E-Mail:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{email}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;Telephone:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{telephone}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p&gt;&lt;/p&gt; &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(2569, 'admin.enquiry.confirm', '', '', '', '{store_name} - Enquiry {enquiry_order_id}', '&lt;p&gt;You have received an Enquiry.&lt;/p&gt; &lt;p&gt;Enquiry Status: &lt;b&gt;{order_status}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;{invoice}&lt;/p&gt;', '', '', 1, 0),
(2570, 'admin.information.contact', '', '', '', 'Enquiry - {enquiry_subject}', '&lt;p&gt;You received a new enquiry.&lt;/p&gt; &lt;p&gt;&lt;b&gt;Name:&lt;/b&gt; {enquiry_name}&lt;br&gt;&lt;b&gt;Email:&lt;/b&gt;&amp;nbsp;{enquiry_mail}&lt;br&gt;&lt;b&gt;Telephone:&lt;/b&gt;&amp;nbsp;{enquiry_telephone}&lt;br&gt;&lt;b&gt;No of Pax:&lt;/b&gt; {enquiry_pax}&lt;br&gt;&lt;b&gt;Date Required:&lt;/b&gt;&amp;nbsp;{enquiry_date}&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt; &lt;p&gt;&lt;b&gt;Message:&lt;/b&gt;&lt;br&gt;{enquiry_message}&lt;/p&gt; &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(2571, 'admin.order.confirm', '', '', 'orders@edithpatisserie.com', '{store_name} - Order {order_id}', '&lt;p&gt;You have received an order.&lt;/p&gt; &lt;p&gt;Order Status: &lt;b&gt;{order_status}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;{invoice}&lt;/p&gt;', '', '', 1, 0),
(2572, 'admin.product.enquiry', '', '', 'orders@edithpatisserie.com', 'Enquiry - {enquiry_subject}', '&lt;p&gt;You received a new enquiry.&lt;/p&gt; &lt;p&gt;&lt;b&gt;Name:&lt;/b&gt; {enquiry_name}&lt;/p&gt;&lt;p&gt;&lt;b&gt;Email:&lt;/b&gt; {enquiry_email}&lt;/p&gt;&lt;p&gt;&lt;b&gt;Date Required&lt;/b&gt;&lt;b&gt;:&lt;/b&gt;&amp;nbsp;{enquiry_date_required}&lt;/p&gt;&lt;p&gt;&lt;b&gt;No. of Pax:&lt;/b&gt;&amp;nbsp;{enquiry_no_pax}&lt;/p&gt;&lt;p&gt;&lt;b&gt;Sample Link:&lt;/b&gt;&amp;nbsp;{enquiry_sample_link}&lt;br&gt;&lt;/p&gt; &lt;p&gt;&lt;b&gt;Message:&lt;/b&gt;&lt;br&gt;{enquiry_message}&lt;/p&gt; &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(2573, 'admin.product.vote', '', '', '', 'Vote - {product_name}', '&lt;p&gt;Customer have vote past creation product&lt;/p&gt; &lt;p&gt;&lt;b&gt;Product Name:&lt;/b&gt; {product_name}&lt;/p&gt;&lt;p&gt;&lt;b&gt;Message:&lt;/b&gt;&lt;/p&gt;&lt;p&gt;{message}&lt;/p&gt; &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(2574, 'common.top', '', '', '', '', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2575, 'common.header', '', '', '', '', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2576, 'common.footer', '', '', '', '', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2577, 'common.bottom', '', '', '', '', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2578, 'order.update.7', '', 'orders@edithpatisserie.com', '', '{store_name} - Order Cancellation {order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Your order&amp;nbsp;&lt;b&gt;#{order_id}&amp;nbsp;&lt;/b&gt;has been cancelled&lt;b&gt;&amp;nbsp;&lt;/b&gt;as per your request. We hope to have another opportunity to bake for you again!&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your order, please log in and select \'Order History\' by clicking on the button below:&lt;/p&gt;&lt;p&gt;[button={order_url}]Log In[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;The {store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2579, 'order.update.5', 'Edith Patisserie', 'orders@edithpatisserie.com', '', '{store_name} - Reminder: Your Order {order_id} is Confirmed!', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Thank you for your order! &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;[if_message]&lt;/p&gt;&lt;p&gt;&lt;b&gt;{message}&lt;/b&gt;&lt;/p&gt;&lt;p&gt;[/if_message]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;This is a reminder that your order &lt;b&gt;#{order_id} &lt;/b&gt;will be ready for collection/delivery as per your order details. Please check through your order details to ensure that they are correct, so that your bakes have a smooth journey to you.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Do let us know what you think here:&amp;nbsp;&lt;a href=&quot;https://forms.gle/rK9upKGjGSbkCFvR7&quot;&gt;https://forms.gle/HdJvHNCDBxekwwqu6&lt;/a&gt;!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(47, 118, 152);&quot;&gt;{invoice}&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(47, 118, 152);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;Delivery&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;If you have opted for a delivery, please ensure that&amp;nbsp;&lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;a recipient will be present throughout the two-hour time slot of the delivery selected&lt;/span&gt;&amp;nbsp;as re-delivery charges will apply if the delivery is unsuccessful.&amp;nbsp;&lt;/b&gt;The third party delivery company we work with only offers standard delivery time slots of a two-hour time frame and we are unable to guarantee a specific time delivery or alternative time slots.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;In-Store Collection&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;If you are self-collecting your order, do take note of our store\'s operating hours:&lt;/p&gt;&lt;p&gt;Monday: CLOSED&lt;br&gt;Tuesday-Saturday: 10am-5pm (last preorder collection: 5.30pm)&lt;br&gt;Sunday: 10am-2pm (last preorder collection: 2.30pm)&lt;/p&gt;&lt;p&gt;&lt;i&gt;If you are planning to collect your cake at an earlier timing or should you be running late, do call us at 6443 7150 during our operating hours so our friendly staff can advise accordingly to avoid any unnecessary waiting on your part.&amp;nbsp;&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;br&gt;&lt;/i&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We look forward to baking for you on your special occasion!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;The {store_name} Team&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;br&gt;&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2580, 'order.update.2', '', 'orders@edithpatisserie.com', '', '{store_name} - Order Confirmation for {order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Thank you for ordering from Edith Patisserie! Your order&amp;nbsp;&lt;b&gt;#{order_id} &lt;/b&gt;is now confirmed with the below details.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(47, 118, 152);&quot;&gt;{invoice}&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Do note that order cancellations and order amendments cannot be processed&lt;b&gt;&amp;nbsp;&lt;/b&gt;as full order payment has now been completed.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;Delivery&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;If you have opted for a delivery, please ensure that &lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;a recipient will be present throughout the two-hour time slot of the delivery selected&lt;/span&gt; or re-delivery charges will apply if the delivery is unsuccessful. &lt;/b&gt;The third party delivery company we work with only offers standard delivery time slots of a two-hour time frame and we are unable to guarantee a specific time delivery or alternative time slots.&amp;nbsp; &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;In-Store Collection&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Please note our operating hours for self-collection:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tuesday to Saturday: 10am to 5pm (Last collection at 5.30pm)&lt;/p&gt;&lt;p&gt;Sunday: 10am to 2pm (Last collection at 2.30pm)&lt;/p&gt;&lt;p&gt;&lt;i&gt;If you are planning to collect your cake at an earlier timing or should you be running late, do call us at 6443 7150 during our operating hours so our friendly staff can advise accordingly to avoid any unnecessary waiting on your part.&amp;nbsp;&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;For further clarification, you may reply to this email and we\'ll get back as soon as we can. Thank you and have a nice day! &lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;The {store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2581, 'order.update.1', '', 'orders@edithpatisserie.com', '', '{store_name} - Order Received {order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Thank you for your purchase!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;[if_message]&lt;/p&gt;&lt;p&gt;&lt;b&gt;We have a question regarding your order:&amp;nbsp;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;{message}&lt;/b&gt;&lt;/p&gt;&lt;p&gt;[/if_message]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We are currently processing your order&amp;nbsp;&lt;b&gt;#{order_id}.&amp;nbsp;&amp;nbsp;&lt;/b&gt;A separate confirmation email will be sent when the order has been processed. For any order enquiries, you may reply to this email and we\'ll get back to you as soon as we can.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(47, 118, 152);&quot;&gt;{invoice}&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Thank you and have a nice day! &lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;You may log into your account to check your order through the link below:&lt;/p&gt;&lt;p&gt;[button={order_url}]Log In[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;The {store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2582, 'enquiry.update.7', '', '', '', '{store_name} - Order Cancellation {enquiry_order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Your order&amp;nbsp;&lt;b&gt;#{order_id}&amp;nbsp;&lt;/b&gt;has been cancelled&lt;b&gt;&amp;nbsp;&lt;/b&gt;as per your request. We hope to have another opportunity to bake for you again!&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your order, please log in and select \'Order History\' by clicking on the button below:&lt;/p&gt;&lt;p&gt;[button={order_url}]Log In[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;The {store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2583, 'enquiry.update.5', '', '', '', '{store_name} - Order Completed {enquiry_order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;This is an automated reminder email for your order&amp;nbsp;&lt;b&gt;#{order_id}.&amp;nbsp;&amp;nbsp;&lt;/b&gt;For any order enquiries, please contact us during operating hours (Tuesday to Saturday, 10am to 5pm). Thank you! &lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your order click on the button below:&lt;/p&gt;&lt;p&gt;[button={order_url}]My Order[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;This is an automatically generated email, please do not reply to this message.&amp;nbsp;&lt;/i&gt;&lt;br&gt;&lt;/p&gt;', '', '', 1, 0),
(2584, 'enquiry.update.2', '', '', '', '{store_name} - Order confirmation for {enquiry_order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Thank you for ordering from Edith Patisserie! Your order&amp;nbsp;&lt;b&gt;#{order_id}&amp;nbsp;&lt;/b&gt;is now confirmed with the below details&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;span style=&quot;color: rgb(47, 118, 152);&quot;&gt;{invoice}&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Do note that order cancellations and order amendments&amp;nbsp;&lt;b&gt;are not allowed&amp;nbsp;&lt;/b&gt;as total order payment has been completed. &lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;Delivery&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;If you have opt for a delivery, please ensure that &lt;span style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;a recipient will be present throughout the two-hour time slot of the delivery selected&lt;/span&gt; or re-delivery charges will apply if the delivery is unsuccessful. &lt;/b&gt;The\r\n third party delivery company we work with only offers standard delivery\r\n time slots of a two-hour time frame and we are unable to guarantee a \r\nspecific time delivery or alternative time slots.&amp;nbsp; &lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;In-Store Collection&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Please note our operating hours for self-collection:&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Tuesday to Saturday: 10am to 5pm (Last collection at 5.30pm)&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Sunday: 10am to 2pm (Last collection at 2.30pm)&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;If\r\n you are planning to collect your cake at an earlier timing or should \r\nyou be running late, do call us at 6443 7150 during our operating hours \r\nso our friendly staff can advise accordingly to avoid any unnecessary \r\nwaiting on your part.&amp;nbsp;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;For further \r\nclarification, you may reply to this email and we\'ll try our best to get\r\n back as soon as we can. Thank you and have a nice day!&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;', '', '', 1, 0),
(2585, 'enquiry.update.1', '', '', '', '{store_name} - Order Received {enquiry_order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Thank you for your purchase! We are currently processing your order&amp;nbsp;&lt;b&gt;#{order_id}.&amp;nbsp;&amp;nbsp;&lt;/b&gt;Should there be any issues with your order which we need to clarify, we will contact you via a follow-up email.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;A separate confirmation email will be sent when the order has been processed. Orders are typically processed within 2-3 working days. For any order enquiries, you may reply to this email and we\'ll try our best to get back as soon as we can.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Thank you and have a nice day! &lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To view your order, you may do so via the button below:&lt;/p&gt;&lt;p&gt;[button={order_url}]My Order[/button]&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Best Regards,&lt;br&gt;{store_name} Team&lt;/p&gt;', '', '', 1, 0);
