(3, 1, 'Samaritans of Singapore (SOS)', '', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\nSamaritans of Singapore (SOS) is dedicated to providing confidential emotional support to individuals facing a crisis, thinking about suicide or affected by suicide. Comprising full-time staff and volunteers, their services include specialised counselling, support groups, training and workshops, and community outreach.&lt;/p&gt;', '', '', '', '', '', '', '', ''),
(4, 1, 'HCA Hospice (HCA)', '', '&lt;p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;&lt;!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--&gt;\r\n&lt;/style&gt;\r\nHCA Hospice Care (HCA) is a registered charity, and the largest home hospice provider in Singapore. They specialise in palliative care for all ages, which includes services such as caregiver training, bereavement support and outreach programmes.&lt;/p&gt;', '', '', '', '', '', '', '', ''),
