(7, 1, 'Cat Welfare Society', '', '&lt;p&gt;The Cat Welfare Society (CWS) is a charity that aims to promote a humane and informed society in Singapore where cats are cared for responsibly. They work on community mediation through campaigns and events, stray cat sterilisation and lowering the overall culling rate of cats islandwide.&lt;/p&gt;\r\n\r\n&lt;p&gt;As an ongoing initiative, we carry an exclusively curated catalogue featuring our local cats, with 100% of the proceeds going to CWS.&lt;/p&gt;\r\n\r\n&lt;p&gt;Last Valentine’s Day, we released a limited-edition mini kitty cake, purr-fect for celebrating the day with your kitty-loving partners. 20% of the sale proceeds for this cake was channelled directly to CWS, so all our friendly community cats felt the love too! Thank you for your amazing support! &lt;/p&gt;', '', '', '', '', '', '', '', ''),
