INSERT INTO `j5ui84yug_yng8e54e_setting` (`setting_id`, `store_id`, `code`, `key`, `value`, `serialized`) VALUES
(42200, 0, 'faq_manager', 'faq_manager_sections', '[{\"title\":{\"1\":\"Order and Lead Time Enquiries  \"},\"groups\":[{\"question\":{\"1\":\"What is the lead time for Standard cakes\\/Mini Bites?\"},\"answer\":{\"1\":\"&lt;p&gt;Our Standard cakes.Mini Bites have a &lt;b&gt;2&lt;\\/b&gt;\\u00a0days ordering lead time.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;b&gt;Do note that as available slots are filled on a first come, first served basis, we\'d recommend placing your order asap to secure your slot!\\u00a0\\u00a0&lt;\\/b&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What is the lead time for semi-customised cakes?\"},\"answer\":{\"1\":\"&lt;p&gt;Our Semi-customised cakes (existing designs found on our website with no further changes)\\u00a0have a &lt;strong&gt;3-&lt;\\/strong&gt;&lt;b&gt;5&lt;\\/b&gt;\\u00a0days ordering lead time.\\u00a0\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;b&gt;Do note that as available slots are filled on a first come, first served basis, we\'d recommend placing your order asap to secure your slot!\\u00a0\\u00a0&lt;\\/b&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What is the lead time for fully customised cakes?\"},\"answer\":{\"1\":\"&lt;p&gt;&lt;meta charset=&quot;utf-8&quot; \\/&gt;Our fully customised cakes\\u00a0have a &lt;b&gt;21&lt;\\/b&gt;\\u00a0days ordering lead time.\\u00a0\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Cake designs\\/fondant pieces that are not part of our existing catalogue, and modifications to existing designs are considered fully customised cakes.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;b&gt;Do note that as available slots are filled on a first come, first served basis, we\'d recommend placing your order asap to secure your slot!\\u00a0\\u00a0&lt;\\/b&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What is the colour we can choose for the exterior of the cake? \"},\"answer\":{\"1\":\"&lt;p&gt;Kindly refer to our colour chart here:\\u00a0&lt;strong&gt;&lt;a href=&quot;https:\\/\\/cdn.shopify.com\\/s\\/files\\/1\\/1598\\/2105\\/files\\/ColourChart2.11.jpg?4756212907826924928&quot;&gt;Colour Chart&lt;\\/a&gt;\\u00a0&lt;\\/strong&gt;for the available colours.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Do note that\\u00a0colours available are dependent on\\u00a0each individual design.\\u00a0&lt;\\/p&gt;\\r\\n\"}}]},{\"title\":{\"1\":\"Cake Size and Storage Enquiries\"},\"groups\":[{\"question\":{\"1\":\"How do I store buttercream\\/ganache cakes? \"},\"answer\":{\"1\":\"&lt;p&gt;Buttercream cake frosting is thickened with butter and it is soft and creamy at room temperature.\\u00a0The cake can be displayed in an air-con room (at least 18\\u00b0C) for up to 4 hours. It is not recommended to display or store cakes without air con, especially under the hot sun or in warm and humid areas.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;If refrigerated, thaw at room temperature for approx. 30-60min or until cream is soft to touch. Do not consume straight from the fridge as it will be crumbly and hard to cut.Leftovers can be kept in the fridge in an air-tight container up to 3 days, thaw 20-30mins before consumption.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;meta charset=&quot;utf-8&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How do I store fresh cream cakes?\"},\"answer\":{\"1\":\"&lt;p&gt;Fresh cream cakes should be kept refrigerated (not frozen) till time of consumption. Leftovers can be kept in the fridge in an air-tight container up to 3 days&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"My chosen cake design has fondant components, how should I store my cake? \"},\"answer\":{\"1\":\"&lt;p&gt;&lt;strong&gt;For fondant that has been assembled&lt;\\/strong&gt;: We\'d recommend keeping your cake in a cool aircon environment (at least 18 degrees) for up to 4 hours for optimal appearance.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;For fondant that has been packed separately&lt;\\/strong&gt;: We\'d recommend keeping fondant pieces in a cool aircon environment.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;For the cake itself, do follow our recommended storage instructions for your correponding cake types!&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Do you provide ice packs for the cakes?\"},\"answer\":{\"1\":\"&lt;p&gt;We don\'t provide ice packs or cooler bags&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How long can I keep my cake for after cutting?\"},\"answer\":{\"1\":\"&lt;p&gt;All cakes are best consumed on the same day. To ensure freshness, we recommend keeping remaining slices in the fridge in an air-tight container for up to three (3)\\u00a0days from date of collection\\/delivery.&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How long can the cakes last outside?\"},\"answer\":{\"1\":\"&lt;p&gt;Try not to stay out in the hot sun too long and follow our storage instructions listed on our cake boxes. Our merciless weather isn\'t kind to our cakes, especially the fresh cream ones!&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How do I store my mini bites?\"},\"answer\":{\"1\":\"&lt;p&gt;&lt;strong&gt;Tarts&lt;\\/strong&gt;:\\u00a0Display in cool, air-conditioned area and consume within the same day for best taste and texture. Not recommended for overnight storage as tart shell may soften overnight\\/pearls will harden overnight&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;Cupcakes\\/Loaves&lt;\\/strong&gt;:\\u00a0Display in cool, air-conditioned area and consume within the same day for best taste and texture. Leftovers can be kept in the fridge (in air-tight container) up to 2 days, thaw 20-30mins before consumption&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;Brownies\\/Blondies&lt;\\/strong&gt;:\\u00a0Keep refrigerated for best taste and texture or display in air-con room for up to 5 hours. Leftovers can be kept in the fridge (in air-tight container) up to 3 days&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;Macarons&lt;\\/strong&gt;:\\u00a0Keep refrigerated for best taste and texture. Leftovers can be kept in the fridge (in air-tight container) up to 3 days&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;Mini Honey Cake&lt;\\/strong&gt;:\\u00a0Must be refrigerated for best taste and texture. Leftovers can be kept in the fridge (cling wrap or in air-tight container) up to 2 days&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;Cookies\\/Crunch Bites&lt;\\/strong&gt;:\\u00a0Keep in airtight container for up 1-month&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What are the cake sizes available?\"},\"answer\":{\"1\":\"&lt;p&gt;We do not offer every size for each design; available sizes will be in the dropdown option on each product page!&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;One tier cakes:\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;img alt=&quot;Two Tier Sizing Chart-1&quot; class=&quot;img-responsive &quot; src=&quot;image\\/catalog\\/Sizing Chart\\/Sizing Chart.PNG&quot; style=&quot;width: 519px; height: 169px;&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Two-tier cakes:&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;img alt=&quot;Two Tier Sizing Chart-1&quot; class=&quot;img-responsive &quot; src=&quot;image\\/catalog\\/Sizing Chart\\/Two Tier Sizing Chart-1.PNG&quot; style=&quot;width: 334px; height: 94px;&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Do you have Standard cakes bigger than 10\\u201d?\"},\"answer\":{\"1\":\"&lt;p&gt;For 12&quot; cake orders, which are approximately 4kg and serves 40-50 pax, drop us an email at orders@edithpatisserie.com to enquire! Please note that not all our flavours are available in 12&quot;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Can I stack two standard cakes to make a two-tier cake?\"},\"answer\":{\"1\":\"&lt;p&gt;Unfortunately this is not possible. With two-tier cakes, it is not just a matter of stacking two cakes together as the process of assembling and decorating is entirely different from a standard, single-tier cake. We would not want to compromise on the look and taste of the final product. Check out our &lt;strong&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/products\\/custom-bakes\\/two-tier&quot;&gt;Two-tier collection&lt;\\/a&gt;&lt;\\/strong&gt;\\u00a0for larger cake options to feed more mouths!\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;meta charset=&quot;utf-8&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Which Standard Bakes are fresh cream? \"},\"answer\":{\"1\":\"&lt;p&gt;Do check out our collection of fresh cream flavours below:\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/chocolate-hazelnut-cake&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/chocolate-hazelnut-cake&lt;\\/a&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/chocolate-truffle-cake&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/chocolate-truffle-cake&lt;\\/a&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/blood-orange-yuzu-cake&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/blood-orange-yuzu-cake&lt;\\/a&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/april-special-three-cheese-cake&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/april-special-three-cheese-cake&lt;\\/a&gt;\\u00a0\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/black-forest-cake&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/black-forest-cake&lt;\\/a&gt;\\u00a0 (contains alcohol)\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/strawberry-shortcake&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/standard-bakes\\/whole-cakes\\/strawberry-shortcake&lt;\\/a&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/honey-cream-cake-cane-sugar-free&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/honey-cream-cake-cane-sugar-free&lt;\\/a&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}}]},{\"title\":{\"1\":\"Delivery and Collection Enquiries\"},\"groups\":[{\"question\":{\"1\":\"Are there any areas that you do not deliver to? \"},\"answer\":{\"1\":\"&lt;p&gt;Do check out our list of restricted zones\\u00a0&lt;strong&gt;&lt;a href=&quot;https:\\/\\/drive.google.com\\/file\\/d\\/1rJ_9ghLMZcFTO8LuiINlGvuzpofTEdxx\\/view?usp=sharing&quot;&gt;here&lt;\\/a&gt;\\u00a0&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;We also do not deliver to areas affected by road closure (i.e. during F1, NDP), and deliveries to Sentosa are\\u00a0available at\\u00a0an additional $10 surcharge.\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What are your delivery timing and charges? \"},\"answer\":{\"1\":\"&lt;p&gt;&lt;b id=&quot;docs-internal-guid-e37a0b0e-7fff-0b03-dab8-4af5d53f5795&quot;&gt;Orders below $150:\\u00a0&lt;\\/b&gt;$15 delivery charge&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-e37a0b0e-7fff-0b03-dab8-4af5d53f5795&quot;&gt;Orders above $150:\\u00a0&lt;\\/b&gt;Free delivery (Except to Sentosa and NA for restricted Zones)&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;Deliveries to Sentosa are\\u00a0available at\\u00a0an additional $10 surcharge.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-043d857a-7fff-31af-b631-bd301247ff09&quot;&gt;Available Delivery Time Slots:&lt;\\/b&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-043d857a-7fff-31af-b631-bd301247ff09&quot;&gt;Tuesday to Sunday (CLOSED ON MONDAYS)&lt;\\/b&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;10am-12pm&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;12pm-2pm&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;2pm-4pm&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;5pm-7pm (Not available on Sundays)&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;Do note that we are unable to guarantee delivery by a certain time or time slot.\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What are your collection timings?\"},\"answer\":{\"1\":\"&lt;p&gt;&lt;strong&gt;Collection Timings:&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;br \\/&gt;\\r\\n&lt;strong&gt;Tuesday to Saturday:&lt;\\/strong&gt; 10am-5pm (Last collection at 5.30pm)&lt;br \\/&gt;\\r\\n&lt;strong&gt;Sunday:&lt;\\/strong&gt; 10am-2pm (Last collection at 2.30pm)&lt;br \\/&gt;\\r\\n&lt;strong&gt;Monday:&lt;\\/strong&gt; CLOSED&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Do you do delivery to restaurants and hotels?\"},\"answer\":{\"1\":\"&lt;p&gt;Yes, we do.\\u00a0Do inform us of your\\u00a0&lt;u&gt;&lt;strong&gt;reservation details (name and contact number)&lt;\\/strong&gt;&lt;\\/u&gt; to ensure smooth delivery and for deliveries to &lt;strong&gt;hotels&lt;\\/strong&gt;,\\u00a0we would require someone to meet the delivery driver at the hotel lobby to receive the order.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;*Staff\\/Concierge must\\u00a0be aware of the delivery and be open during the delivery time slot chosen if the recipient would not be present to receive the delivery.&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;br \\/&gt;\\r\\nFor optimal taste and texture of your cake,\\u00a0it would also be best to inform staff of storage conditions (i.e. Buttercream cakes are best kept in air-conditioned areas while Fresh cream cakes needs to be refrigerated)&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Why can\'t I choose my desired date?\"},\"answer\":{\"1\":\"&lt;p&gt;&lt;strong&gt;Dates may be blocked for three main reasons:&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;ol&gt;\\r\\n\\t&lt;li&gt;We are full for deliveries\\/collections for that day&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;All orders are unavailable on Mondays as our shop is closed&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;It is too close to your desired delivery date&lt;\\/li&gt;\\r\\n&lt;\\/ol&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;As orders are processed on a first-come-first-served basis, we recommend placing your order ASAP to secure your desired date.&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"I can\'t make it in time to receive my delivery. What should I do?\"},\"answer\":{\"1\":\"&lt;p&gt;A strict&lt;strong&gt; 10-minute waiting time&lt;\\/strong&gt; applies\\u00a0to every delivery. Items not collected within this period will incur a return-to-shop delivery fee as stipulated by the third party delivery company. Same day re-deliveries are not possible and collection\\u00a0of the returned orders\\u00a0are only available during operating hours. &lt;strong&gt;You have 2 days to collect your order after which the cake will be disposed&lt;\\/strong&gt;.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Can someone collect my order on my behalf?\"},\"answer\":{\"1\":\"&lt;p&gt;Yes you can, please provide the &lt;strong&gt;order number, name and contact number&lt;\\/strong&gt; of the person that made the order upon collection.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Can I engage my own courier to collect for me?\"},\"answer\":{\"1\":\"&lt;p&gt;If you\\u2019re engaging a &lt;u&gt;&lt;strong&gt;third party courier service&lt;\\/strong&gt;&lt;\\/u&gt;, inform them that they will have to:&lt;\\/p&gt;\\r\\n\\r\\n&lt;ul&gt;\\r\\n\\t&lt;li&gt;Verify that everything is in order&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Provide their signature as confirmation that the collection has been completed accurately&lt;\\/li&gt;\\r\\n&lt;\\/ul&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;\\u00a0*Signing the collection sheet denotes that the items have been checked and received in a\\u00a0good and undamaged condition. We will not be liable for any damage to the items once the transfer of responsibility has been passed.&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Do you do surprise deliveries?\"},\"answer\":{\"1\":\"&lt;p&gt;An email confirmation\\u00a0will be sent\\u00a0a\\u00a0day before,\\u00a0to the person whom made the\\u00a0order to confirm the order and delivery\\/collection information.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Do note that the recipient have to be present during the chosen delivery time-slot to receive the delivery.\\u00a0&lt;b&gt;However, in the event where the intended recipient is not present during the delivery time slot chosen, re-delivery charges will apply and deliveries will be arranged for the earliest available day&lt;\\/b&gt;&lt;b&gt;.&lt;\\/b&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;meta charset=&quot;utf-8&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"I\\u2019m sending a cake to a recipient, what are some things I should take note of?\\u00a0\"},\"answer\":{\"1\":\"&lt;p&gt;Do ensure the recipient is present, aware and contactable\\u00a0during the chosen 2-hour delivery time slot.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;meta charset=&quot;utf-8&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-9b5cce04-7fff-d60f-9fed-a5d227fe5ef6&quot;&gt;*Receptions of healthcare establishments, office buildings and areas requiring a change\\u00a0of visitor pass will\\u00a0not receive any deliveries\\u00a0on behalf. Drivers have a 10-minute waiting period before re-delivery charges apply. &lt;\\/b&gt;&lt;\\/p&gt;\\r\\n\"}}]},{\"title\":{\"1\":\"Dietary Requirement Enquiries\"},\"groups\":[{\"question\":{\"1\":\"Are your bakes halal?\"},\"answer\":{\"1\":\"&lt;p&gt;We\\u00a0are not a halal-certified bakery and our kitchen handles alcohol for the production of some of our cake flavours. Some of our cake flavours contain\\u00a0beef gelatin.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;meta charset=&quot;utf-8&quot; \\/&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-ccc29075-7fff-3d20-a228-8112fa1135c6&quot;&gt;*&lt;\\/b&gt;Cake flavours that contain Alcohol: &lt;strong&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online/demo10\\/products\\/standard-bakes\\/whole-cakes\\/alcohol&quot;&gt;https:\\/\\/fcscommerce.online/demo10\\/products\\/standard-bakes\\/whole-cakes\\/alcohol&lt;\\/a&gt;&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-ccc29075-7fff-3d20-a228-8112fa1135c6&quot;&gt;*&lt;\\/b&gt;Cake flavours that contain Beef Gelatin: Strawberry Shortcake, Black Forest, Yuzu Matcha,\\u00a0\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b id=&quot;docs-internal-guid-ccc29075-7fff-3d20-a228-8112fa1135c6&quot;&gt;*&lt;\\/b&gt;All our Mini Bites do not contain any alcohol&lt;\\/p&gt;\\r\\n\\r\\n&lt;p dir=&quot;ltr&quot;&gt;&lt;b&gt;*&lt;\\/b&gt;All bakes do not contain Pork Gelatin\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Are vegan or gluten-free options available?\"},\"answer\":{\"1\":\"&lt;p&gt;Yes! Do check out our \\u201cHealthier\\u00a0Options\\u201d collection\\u00a0for available vegan and gluten-free options.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Cakes:\\u00a0&lt;strong&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/products\\/standard-bakes\\/whole-cakes\\/specials&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/products\\/standard-bakes\\/whole-cakes\\/specials&lt;\\/a&gt;&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Mini Bites:\\u00a0&lt;strong&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online\\/\\demo10\\/products\\/mini-bites\\/healthier-options&quot;&gt;https:\\/\\/fcscommerce.online\\/\\demo10\\/products\\/mini-bites\\/healthier-options&lt;\\/a&gt;&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What if I have a nut allergy?\"},\"answer\":{\"1\":\"&lt;p&gt;The following bakes have nuts as a main ingredient&lt;br \\/&gt;\\r\\n- Chocolate Hazelnut Cake&lt;br \\/&gt;\\r\\n- Peanut Butter Banana Cake&lt;br \\/&gt;\\r\\n- Lemon Drizzle Bundt&lt;br \\/&gt;\\r\\n- Hazelnut Brownies&lt;br \\/&gt;\\r\\n- Chocolate Almond Crunch Bites&lt;br \\/&gt;\\r\\n- Macarons&lt;br \\/&gt;\\r\\n- Mini Tarts&lt;br \\/&gt;\\r\\n- Bubble Tea Tarts&lt;br \\/&gt;\\r\\n- Mini Lemon Loaves&lt;br \\/&gt;\\r\\n- Mini Chocolate Candy Cupcakes&lt;br \\/&gt;\\r\\n*Our monthly flavour specials may contain nuts as well!*&lt;br \\/&gt;\\r\\n\\u00a0&lt;br \\/&gt;\\r\\n&lt;strong&gt;Do note that we handle nuts on a daily basis and some of the ingredients we use are manufactured in factories that handle and\\/or produce nut products. As such, we would advise against serving any of our cakes to individuals who have very bad nut allergies as we are unable to guarantee 100% nut-free bakes.&lt;\\/strong&gt;&lt;br \\/&gt;\\r\\n\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Can I request for my cake to be less sweet? \"},\"answer\":{\"1\":\"&lt;p&gt;We are not able to reduce sugar in the recipes as it would change the cake\\u2019s taste and texture.\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What flavours are available for Custom Cakes? What will the interior of my cake look like? \"},\"answer\":{\"1\":\"&lt;p&gt;Available flavours are:&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;br \\/&gt;\\r\\n&lt;u&gt;&lt;strong&gt;Standard&lt;\\/strong&gt;&lt;\\/u&gt;&lt;br \\/&gt;\\r\\nValrhona Chocolate Crunch*&lt;br \\/&gt;\\r\\nRaspberry Passionfruit*&lt;br \\/&gt;\\r\\nChocolate Salted Caramel&lt;br \\/&gt;\\r\\nEarl Grey Lavender*&lt;br \\/&gt;\\r\\nMadagascan Vanilla&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;u&gt;&lt;strong&gt;Premium Flavours\\u00a0&lt;\\/strong&gt;&lt;\\/u&gt;&lt;br \\/&gt;\\r\\nChocolate Hazelnut&lt;br \\/&gt;\\r\\nSpeculoos Chocolate Crunch*&lt;br \\/&gt;\\r\\nPandan Coconut Gula Melaka*&lt;br \\/&gt;\\r\\nVanilla &amp; Strawberry Compote*&lt;br \\/&gt;\\r\\nLychee Rose*&lt;br \\/&gt;\\r\\nSpeculoos Cookie Dough\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;br \\/&gt;\\r\\n*Popular&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;To\\u00a0get a better idea of the ingredients of each flavour\\u00a0and sample images\\u00a0of\\u00a0the cake interiors, do check them out here:\\u00a0&lt;a href=&quot;https:\\/\\/fcscommerce.online/demo10\\/products\\/standard-bakes\\/whole-cakes&quot;&gt;https:\\/\\/fcscommerce.online/demo10\\/products\\/standard-bakes\\/whole-cakes&lt;\\/a&gt;&lt;\\/p&gt;\\r\\n\"}}]},{\"title\":{\"1\":\"Loyalty Programme\"},\"groups\":[{\"question\":{\"1\":\"How do I sign up for an account? \"},\"answer\":{\"1\":\"&lt;p&gt;For existing and new customers, kindly register for an account here:\\u00a0&lt;strong&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online/demo10\\/register&quot;&gt;https:\\/\\/fcscommerce.online/demo10\\/register&lt;\\/a&gt;&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;If you have previously\\u00a0registered for an account, kindly login to your account here:&lt;strong&gt;\\u00a0&lt;a href=&quot;https:\\/\\/fcscommerce.online/demo10\\/login&quot;&gt;https:\\/\\/fcscommerce.online/demo10\\/login&lt;\\/a&gt;&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How do I earn points?\"},\"answer\":{\"1\":\"&lt;p&gt;Points are credited into your account within 3 working days upon completion of\\u00a0orders placed via the website. E.g. Collection\\/Delivery date of order is on 15 Dec 2019, points will be reflected in your account by 18 Dec 2019. 1 point is given for every dollar purchased (excluding delivery and any miscellaneous charges).\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Do note that\\u00a0crediting of points will be delayed if there are changes made to your order and points will be revoked for cancellations.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Our loyalty points programme is not applicable for fully customised orders.\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Do my points have an expiry date? \"},\"answer\":{\"1\":\"&lt;p&gt;All points accumulated will have a 3-months validity before it expires, i.e. Points earned on 31\\u00a0December 2019 will expire on 31 March 2020 or\\u00a0points earned on 1 January 2020 will expire on 1 April 2020 and so forth.\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How do I redeem my points?  \"},\"answer\":{\"1\":\"&lt;p&gt;Point can be redeemed at the check-out page under \'Enter reward points to use\'. 100 points is the minimum amount required for redemption and entitles you to $5 off your order.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Points\\u00a0have to be redeemed in denominations of 100 or the system will be\\u00a0unable to deduct your points for redemption if other amount is entered (e.g. 120points, 250points and etc.)&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"I forgot to login to my account before placing my order, can I still accumulate or redeem my points?\"},\"answer\":{\"1\":\"&lt;p&gt;Unfortunately, logging into the account would be required for points to be accumulated or redeemed. We are unable to award points or deduct points retroactively once payment for\\u00a0the order has been made.\\u00a0&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"I have existing points from my previous orders but my account doesn\'t reflect them \"},\"answer\":{\"1\":\"&lt;p&gt;During our system upgrade from 1 Dec 2019 to 30 April\\u00a02020, points for your account will be credited in batches. Please remember to register for an account with the same email address for us to reinstate your points.\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Do note that the these points will expire on 30 June 2020. The transfer of points will cease from 30 April 2020. If you haven\'t registered for a new account, please do so\\u00a0here now:\\u00a0&lt;strong&gt;&lt;a href=&quot;https:\\/\\/fcscommerce.online/demo10\\/register&quot;&gt;https:\\/\\/fcscommerce.online/demo10\\/register&lt;\\/a&gt;&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Can I accumulate or redeem points in-store? \"},\"answer\":{\"1\":\"&lt;p&gt;Unfortunately, point accumulation and point redemption are\\u00a0not\\u00a0available for in-store purchases.\\u00a0&lt;\\/p&gt;\\r\\n\"}}]}]', 1),
