(47658, 0, 'our_team', 'our_team_content_1', '[{\"title\":\"Why Work with Us?\",\"image\":\"catalog\\/demo 10\\/About Us\\/tab 3\\/image_abt3-1.jpg\",\"position\":\"1\",\"description\":\"&lt;p&gt;&lt;span class=&quot;marker&quot;&gt;&lt;\\/span&gt;- Our team consists of experienced and dedicated members with a wealth of experience they love to share\\u00a0&lt;br \\/&gt;\\r\\n- We may be fun, but we\'re serious about cake! There\'s always an opportunity to learn because of our wide-ranging menu and offerings&lt;br \\/&gt;\\r\\n- Team is family, and we take care of\\u00a0all!\\u00a0&lt;\\/p&gt;\\r\\n\"},{\"title\":\" Cake Froster &amp; Decorator (Full-Time)\",\"image\":\"catalog\\/demo 10\\/About Us\\/tab 3\\/image_abt3-2.jpg\",\"position\":\"0\",\"description\":\"&lt;p&gt;- Learn how to frost and decorate all kinds of cakes, from everyday designs to showstopping tiered cakes!&lt;br \\/&gt;\\r\\n- Prepare and decorate mini bites like tarts, cupcakes, brownies and more&lt;br \\/&gt;\\r\\n- Valid food hygiene certification required&lt;br \\/&gt;\\r\\n- Pastry diploma or some commercial bakery experience required&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;To apply:&lt;\\/em&gt;&lt;\\/strong&gt;&lt;br \\/&gt;\\r\\n- Email\\u00a0&lt;a href=&quot;mailto:andrea@edithpatisserie.com&quot;&gt;ethel@edithpatisserie.com&lt;\\/a&gt;\\u00a0attaching your CV (including name, age, nationality, education and employment history and recent photo)\\u00a0&lt;br \\/&gt;\\r\\n- Subject to be titled \'Cake Froster &amp; Decorator (Full-Time)\'&lt;br \\/&gt;\\r\\n- Successful applicants will be notified within 7 days and an interview will be arranged.&lt;\\/p&gt;\\r\\n\"},{\"title\":\"Baker and Fondant Artist (Full-Time)\",\"image\":\"catalog\\/demo 10\\/About Us\\/tab 3\\/image_abt3-1.jpg\",\"position\":\"1\",\"description\":\"&lt;p&gt;- Learn how to bake everything from cake sponges to macarons&lt;br \\/&gt;\\r\\n- Create beautiful and intricate fondant toppers and sugar decorations&lt;br \\/&gt;\\r\\n- Valid food hygiene certification required&lt;br \\/&gt;\\r\\n- Pastry diploma or some commercial bakery experience required&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;To apply:&lt;\\/em&gt;&lt;\\/strong&gt;&lt;br \\/&gt;\\r\\n- Email\\u00a0&lt;a href=&quot;mailto:andrea@edithpatisserie.com&quot;&gt;ethel@edithpatisserie.com&lt;\\/a&gt;\\u00a0attaching your CV (including name, age, nationality, education and employment history and recent photo)\\u00a0&lt;br \\/&gt;\\r\\n- Subject to be titled \'Baker and Fondant Artist (Full-Time)\'&lt;br \\/&gt;\\r\\n- Successful applicants will be notified within 7 days and an interview will be arranged.&lt;\\/p&gt;\\r\\n\"},{\"title\":\"Front of House Crew (Part-Time)\",\"image\":\"catalog\\/demo 10\\/About Us\\/tab 3\\/image_abt3-2.jpg\",\"position\":\"0\",\"description\":\"&lt;p&gt;- Execute and maintain operations for service excellence&lt;br \\/&gt;\\r\\n- Be a brand ambassador by projecting a positive and professional image&lt;br \\/&gt;\\r\\n- Establish interpersonal relationships with customers\\u00a0&lt;br \\/&gt;\\r\\n- No experience required, just a friendly face and positive attitude!&lt;br \\/&gt;\\r\\n- Flexi shifts available&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;To apply:&lt;\\/em&gt;&lt;\\/strong&gt;&lt;br \\/&gt;\\r\\n- Email\\u00a0&lt;a href=&quot;mailto:andrea@edithpatisserie.com&quot;&gt;andrea@edithpatisserie.com&lt;\\/a&gt;\\u00a0attaching your CV (including name, age, nationality, education and employment history and recent photo)\\u00a0&lt;br \\/&gt;\\r\\n- Subject to be titled \'Front of House Crew (Part-Time)\'&lt;br \\/&gt;\\r\\n- Successful applicants will be notified within 7 days and an interview will be arranged.&lt;\\/p&gt;\\r\\n\"},{\"title\":\"Kitchen Assistant (Part-Time)\",\"image\":\"catalog\\/demo 10\\/About Us\\/tab 3\\/image_abt3-1.jpg\",\"position\":\"1\",\"description\":\"&lt;p&gt;- Learn how to decorate tarts, cupcakes and mini bites&lt;br \\/&gt;\\r\\n- Cook pastry components such as creams, ganache and buttercream\\u00a0&lt;br \\/&gt;\\r\\n- Learn how to sculpt simple fondant decorations and figurines&lt;br \\/&gt;\\r\\n- Valid food hygiene certification required&lt;br \\/&gt;\\r\\n- Flexi shifts available&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;To apply:&lt;\\/em&gt;&lt;\\/strong&gt;&lt;br \\/&gt;\\r\\n- Email\\u00a0&lt;a href=&quot;mailto:andrea@edithpatisserie.com&quot;&gt;ethel@edithpatisserie.com&lt;\\/a&gt;\\u00a0attaching your CV (including name, age, nationality, education and employment history and recent photo)\\u00a0&lt;br \\/&gt;\\r\\n- Subject to be titled \'Kitchen Assistant (Part-Time)\'&lt;br \\/&gt;\\r\\n- Successful applicants will be notified within 7 days and an interview will be arranged.&lt;\\/p&gt;\\r\\n\"},{\"title\":\"Driver (Ad-Hoc)\",\"image\":\"catalog\\/demo 10\\/About Us\\/tab 3\\/image_abt3-2.jpg\",\"position\":\"0\",\"description\":\"&lt;p&gt;- Liaise with customers regarding cake deliveries&lt;br \\/&gt;\\r\\n- Deliver cakes on time\\u00a0&lt;br \\/&gt;\\r\\n- Confirm good condition of items when delivered&lt;br \\/&gt;\\r\\n- Report back to logistics team regarding completion of deliveries&lt;br \\/&gt;\\r\\n- Deliveries will be allocated based on your availability and rates will be confirmed prior to jobs being confirmed&lt;br \\/&gt;\\r\\n- Applicants to use their own vehicle (passenger or commercial, no motorbikes)&lt;br \\/&gt;\\r\\n- To be polite with good communication skills&lt;br \\/&gt;\\r\\n- Valid Class 3\\/3A driver\'s licence&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;To apply:&lt;\\/em&gt;&lt;\\/strong&gt;&lt;br \\/&gt;\\r\\n- Email\\u00a0&lt;a href=&quot;mailto:andrea@edithpatisserie.com&quot;&gt;andrea@edithpatisserie.com&lt;\\/a&gt;\\u00a0attaching a copy of your driver\'s licence and your availability.&lt;br \\/&gt;\\r\\n- Subject to be titled \'Driver (Ad-Hoc)\'&lt;br \\/&gt;\\r\\n- Successful applicants will be notified within 7 days and an interview will be arranged.&lt;\\/p&gt;\\r\\n\"}]', 1),
